	var cardData = [{ Cards: [{
	      name: 'The Fool',
	      src: 'https://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/00_MajorFool.jpg',
	      keywords: {
	         upright: 'Beginnings, innocence, spontaneity, a free spirit',
	         reversed: 'Naivety, foolishness, recklessness, risk-taking'
	      },
	      description: {
	         basic: 'The Fool is numbered 0, the number of unlimited potential, and does not actually have a specific place in the sequence of the Tarot cards. The Fool can come either at the beginning of the Major Arcana or at the end. The Major Arcana is often considered as the Fool’s journey through life and as such, he is ever present and therefore needs no number.\n\n The Fool is shown at the beginning of his journey with unlimited potential. The sun rising up behind him represents the beginning of his journey. He is facing north-west, the direction of the unknown. He is looking upwards, toward the sky, or Spirit. He is about to step off a cliff into the material world but is he prepared? He has all the tools and resources he needs in the bag on his staff but he has not opened the bag yet. The white rose in his left hand represents purity and innocence. He has a guardian in the little white dog who will protect him throughout his journey but who will also push him to learn the lessons the Fool came here to learn. The mountains behind the Fool represent the realms of Spirit that he has just left and will spend his life trying to regain.',
	         upright: 'The Fool Tarot card is a card of potential, new beginnings and innocence. This Tarot card shows the highest potential for your life, reaching a state of renewal and new beginnings, where each day is an adventure and each moment is lived to the fullest. The Fool card represents the beginning of all creativity and a desire to accomplish new goals (or to, at least, start the process of working towards those goals). The Fool indicates that anything can happen and the opportunities are just waiting to be taken advantage of.\n\nIn a Tarot reading, the Fool represents the need to set forth on a new journey, one that is completely unknown and will take you to uncharted territories. The Fool is all about new experiences, personal growth, development and adventure. The Fool Tarot card asks you to take a ‘leap of faith’ and to trust in the Universe in that if you begin a new journey, you will find success. This Fool lives a carefree life, free from worry and anxiety. He does not seem to mind if he does not really know what lies ahead.\n\nThe Fool Tarot card may represent a choice to be made—one of vital importance. However, there are always many different options available and the choice must be made wisely. If you are facing a decision or moment of doubt, the Fool encourages you to believe in yourself and follow your heart no matter how crazy or foolish your impulses may seem. This is a time when you need to truly ‘believe’ and have faith in where the Universe is taking you.\n\nThe Fool is an excellent Tarot card to meditate on if you are experiencing a lot of fear in your life. The Fool enhances courage, risk-taking and the creative expression needed to open up new areas in your life.\n\nThe Fool is always whole, healthy and without fear. He is the spirit of who we are, the spirit expressed and experienced as wonder, awe, curiosity and anticipation. We never know what is in the future but like the Fool we must blindly go forward. You need to trust that you are a spirit born into flesh to enjoy life and grow in experience. Take a chance and see what happens.',
	         reversed: 'Reversed, the Fool Tarot card suggests that you may be acting in total disregard of the consequences of your actions and indeed acting ‘the fool’. You are trying to live ‘in the moment’ rather than planning ahead. You are acting recklessly, wanting to break free of the usual routine in order to ‘find yourself’ but doing it in a way that completely disregards others.\n\nThe Fool reversed cautions you about potentially being taken advantage of or entering into a deal where you do not fully understand the consequences of your decisions. If you are offered an opportunity that seems too good to be true then it probably is. It is really important that you do almost a ‘due diligence’ on the opportunities presented to you to ensure that you are making the right choice and not simply going with the most enticing offer at the time. Be prepared for the challenges that lie ahead so that you are not taken by surprise. Do your research and make sure you are well prepared for critical events, such as job interviews, applications, presentations and meetings.\n\nIn a career Tarot reading, the Fool reversed suggests that you do not want to be placed in a work situation where you are completely out of your depth and have no clue what you are doing. You want to feel at least competent that you know what you need to do and you most certainly do not want to look like the fool or the ‘newbie’ on the block. Even if you have not been in the workforce for a little while, you want to be respected for your experience to date and do not want to have to start at square one again.\n\nIn a relationship Tarot reading, the Fool reversed can indicate that the nature of the relationship is highly changeable and uncertain, with spontaneity taken to a whole new level. You may be unsure about where the relationship is heading and whether you can safely depend on your partner. You may both be risk-takers with little consideration for the long-term consequences of your actions. This may bring with it excitement and suspense but also an underlying feeling of uncertainty and insecurity.'
	      }
	   }, {
	      name: 'The Magician',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/01_Major_Magician.jpg',
	      keywords: {
	         upright: 'Power, skill, concentration, action, resourcefulness',
	         reversed: 'Manipulation, poor planning, latent talents'
	      },
	      description: {
	         basic: 'The Magician is associated with the planet, Mercury and carries with it skill, logic, and intellect. The number of the Magician is one, the number of beginnings. The Magician is the bridge between the world of the spirit and the world of humanity. His right hand holds a staff raised toward the sky and his left hand points to the earth. He takes the power of the Universe and channels it through his own body and directs it to the physical plane. Above the Magician’s head is the symbol of eternity and around his waist is a snake biting its own tail, another symbol of eternity. His magical table holds all four suits of the Tarot, each of which represents one of the four primordial elements of the alchemists – earth, air, fire and water. These symbolise the appropriate use of mind, heart, body and soul in the process of manifestation. The Magician’s robe is white, symbolising the purity and innocence found in the Fool but his cloak is red, representing worldly experience and knowledge. In the bed of flowers at his feet this duality is repeated in the mix of pure white lilies and thorny red roses.',
	         upright: 'The Magician Tarot card typically appears in a Tarot reading at a time in your life when you have the creative power and energy to create a new life cycle for yourself. You have the ability to take the power of the Universe and manifest your desires. The Magician Tarot card suggests that a situation has been (or soon will be) presented to you that has all the inherent components to allow the manifestation of your desires. Those desires may be spiritual (fire), physical (earth), emotional (water), or mental (air), and are each aligned with the four elements of the Tarot. You have the ability to make it happen!\n\nWith the Magician Tarot card, you are inspired to apply skill and initiative to accomplish all your goals. You have a strong desire to begin something new, to ‘do, act, or go forth’. A ‘can-do’ attitude and strong sense of optimism will dominate a new beginning and thus the decisions that you make will have positive results.\n\nThe Magician card sees you creating success in everything that you do. This is a Tarot card about manifesting your goals by utilising the skills, tools and resources that are available to you. The Magician suggests that you will come up with creative ways to solve problems and you will be able to use your existing knowledge and networks to arrive at solutions.\n\nThe Magician Tarot card is a good omen when you have a specific wish, when you begin a project involving creativity, or when you need to make a transformation of any kind. This is a great Tarot card for meditation when you need to call all the elements for help and wisdom.\n\nThe Magician Tarot card indicates that you can benefit from your creative forces if you can claim your power and act with awareness and concentration. This card is a signal to act consciously and act now provided you understand exactly what you want and are committed to getting it. You need to know what you are doing and why you are doing it. Be clear about your underlying motives and intentions.\n\nThe Magician is also a Tarot card of deep concentration on a specific task or activity. You need to be focused on a single goal or purpose at this time and you need to channel all of your energy, tools and resources towards this one goal. Commitment to the task is essential and as such, you will need to eliminate any distractions that will take your focus away from what you want to achieve.\n\nThe Magician shows that you are doing a great job at pulling together all of the skills, resources and tools that are available to you in order to bring about an outcome that suits you. You are keeping a very pragmatic head about you and you are trying to remain as objective and ‘can-do’ as possible, even if you are worried on the inside. Keep this up as it will help you to create as much success as possible. Keep thinking about what other skills and resources you can use and keep focused on the task at hand.',
	         reversed: 'Reversed, the Magician can indicate greed, deceit, manipulation and using one’s skill and ability for negative ends. It can reflect trickery and cunning, untrustworthiness and mental confusion.\n\nThe reversed Magician may represent your typical used-car salesman. He uses his charm and his power in a manipulative manner to convince you of his point of view. Always be careful of this type. Make sure you know what you are buying into rather than being swept away by the excitement he generates.\n\nThe Magician reversed often suggests that you may be out of touch with reality and struggling to bring yourself back down to earth. There may be confusion, impatience and lack of a clear plan. You need to return to the lesson of the Fool and free yourself from the current situation in order to give yourself some perspective and reassess the situation. Ask yourself, where am I focusing my energy? Are my objectives clear? What skills and abilities are needed in this situation? How am I communicating with others? What do I want others to believe or see about me?\n\nThe Magician reversed shows that you have a lot of skills, talents and abilities that are not being utilised at the moment and you feel as if your true potential is not being maximised. You may be feeling that you have so much more to give, that there are skills or talents that you have gained over the years that you are not using right now. There is something that you know you are very good at but you have not allowed yourself the opportunity to really nurture and explore this skill. You will already know what these talents are, so ask yourself, “Why am I not putting these talents to good use? What is getting in the way of drawing upon my skills and abilities and reaching my full potential? What needs to change in order to be the best person I can be?” You will need to find opportunities where you can tap into this unused skill and bring it into the conscious mind.\n\nSimilarly, the Magician reversed in a spiritual reading suggests that you have a particular skill or talent that could help your spiritual journey but you are not yet using this skill. For example, you may be studying the Tarot and reading for friends and family but what you do not realise is that you have a real talent for reading Tarot and could be reading professionally for a much wider audience. If you were to expand your Tarot reading, you may find that it also has benefits for your own spiritual journey. You may also be keen to pursue new spiritual interests, particularly if your current path is not fully meeting your needs. Be open to change and know that it is ok to build up a ‘portfolio’ of different spiritual beliefs and skills.'
	      }
	   }, {
	      name: 'The High Priestess',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/02_Major_High_Priestess.jpg',
	      keywords: {
	         upright: 'Intuition, Higher powers, mystery, subconscious mind',
	         reversed: 'Hidden agendas, need to listen to inner voice'
	      },
	      description: {
	         basic: 'The High Priestess is also known as Persephone, Isis, the Corn Maiden and Artemis. She sits at the gate before the great Mystery, as indicated by the Tree of Life in the background. She sits between the darkness and the light, represented by the pillars of Solomon’s temple, which suggests it is she who is the mediator of the passage into the depth of reality. The tapestry hung between the pillars keeps the casual onlookers out and allows only those initiated to enter. The pomegranates on the tapestry are sacred to Persephone. They are a symbol of duty (because Persephone ate a pomegranate seed in the underworld which forced her to return every year). The blue robe the Priestess is wearing is a symbol of knowledge. She is wearing the crown of Isis symbolising the Triple Goddess. The solar cross on her breast is a symbol of balance between male and female.\n\nIn her lap, she holds the half-revealed and half-concealed Torah, representative of the exoteric and the esoteric teachings and higher knowledge. The moon under her left foot shows her dominion over pure intuition. The palm indicates fertility of the mind and the cube on which she sits is the earth. The planet associated with the High Priestess is the Moon.',
	         upright: 'The High Priestess represents wisdom, serenity, knowledge and understanding. She is often described as the guardian of the unconscious. She sits in front of the thin veil of awareness, which is all that separates us from our inner selves. The High Priestess knows the secret of how to access these realms. She represents spiritual enlightenment and inner illumination, divine knowledge and wisdom. She has a deep, intuitive understanding of the Universe and uses this knowledge to teach rather than to try to control others. She generally appears in a Tarot reading when you need to listen to and trust your inner voice.\n\nThe High Priestess Tarot card represents a link to the subconscious mind, which cannot be accessed through the everyday world but only through dreams and symbols. When this Tarot card appears in a Tarot reading, pay attention to your dreams and intuition. Look for areas in your life that may be out of balance or that require greater foresight and wisdom. Knowledge of how to fix it will not come through logic or intellect but through your intuition so put aside a time when you can meditate and listen to your own inner voice. Your intuitive sense right now is providing you with useful and helpful information and is assisting you to become more in touch with your subconscious mind.\n\nFor a male especially, the High Priestess Tarot card indicates that he must learn of his ‘anima’ or female side, or he will fail to grow. For a woman, the High Priestess suggests that she must learn to trust herself and to be truly feminine, rather than succumbing to the pressures of having to act more like her male counterparts.\n\nThe High Priestess in a Tarot reading can also point to the unknown and can indicate that your life is changing. Things that once seemed certain can no longer be taken for granted. Some puzzling mysteries become clearer but all is not yet revealed at this point. On the plus side, you will find that your intuitive powers are increasing and you may be inspired to be creative. The High Priestess Tarot card is therefore a particularly good card for poets and writers.',
	         reversed: 'The High Priestess reversed can signify that you are not listening to your inner voice and may need to take time for reflection and meditation. It is as though your intuition is calling out to you but for some reason you have switched off and are no longer really listening to what your subconscious is trying to tell you. Think of the High Priestess as the calm center inside of you that is untouched by your external world and know that she is always there when you need her. She is a part of you that you have not had much time to connect with but she is an important part of you. Whenever you feel that things are just getting too crazy and you are faced with impossible choices, find a quiet space and listen to your inner voice. If you stop thinking about your issues or just give yourself some space and time of ‘nothingness’, the answer will come to you without having to even think about it. So, try listening to the ‘nothingness’ and see what comes to you. There are some very important answers that lie within that you can access right now.\n\nThe reversed High Priestess also suggests in a Tarot reading that you are normally an intuitive person who is connected with your inner self but in recent times you have lost this connection. You may be rushing around and worrying excessively about external issues and other people’s problems that you have lost focus on your own needs. You are not listening to your inner guidance anymore and this is leading you further astray. The strong message here is that you need to take some time out for YOU and you only, so that you can tune into your inner voice and connect once again with your subconscious mind. Meditation or spiritual study may help.\n\nThis Tarot card can also represent repressed feelings, an over-reliance on the opinions of others and an excessive need for approval and validation. What is needed is greater confidence in yourself and a deeper ‘knowing’ that you have the answers already within you and do not need the validation of others.\n\nIf the High Priestess appears reversed in your Tarot reading, it can indicate that you have been gaining occult knowledge on a superficial level without any comprehension of its true significance, perhaps merely to impress others. It can also indicate that you have not been listening to your intuition or have been trying to ignore something that you know deep down is true. In either case this will cause problems for you. On a deeper level, the High Priestess reversed can mean that you have failed to come to terms with yourself as a woman. If you are a man, it can indicate a damaging refusal to accept the feminine, emotional, intuitive side of yourself.\n\nFinally, the secretive nature of the High Priestess can be turned into the negative with the reversal of this Tarot card, indicating that there may be gossip, hidden agendas and issues going on under the surface. Demand to know the truth and prevent others from ‘beating around the bush’ and keeping secrets and other information from you.'
	      }
	   }, {
	      name: 'The Empress',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/03_Major_Empress.jpg',
	      keywords: {
	         upright: 'Fertility, femininity, beauty, nature, abundance',
	         reversed: 'Creative block, dependence on others'
	      },
	      description: {
	         basic: 'The Empress is the archetypal Earth Mother, the Anima, the Feminine Principle, Demeter, Freyja and the Goddess of Fertility. Ruled by Venus, the planet of love, creativity, fertility, art, harmony, luxury, beauty and grace.\n\nThe main feature of this card is the Empress herself, a full-figured woman with blond hair and a peaceful and calm aura about her. On her head she wears a crown of stars, showing her connection with the mystical realm of angels and fairies. She is dressed in a patterned robe of pomegranates, symbolic of fertility and is seated upon a luxurious array of cushions and flowing red velvet with the symbol of Venus emblazoned upon it.\n\nThe Empress is surrounded by a beautiful, lush forest with a stream running through it, demonstrating the Empress’s deep emotional connection with Mother Earth and life. She draws her sense of peace from the trees and the water and is rejuvenated by the energy of nature. In the foreground, golden wheat springs from the ground, reflecting abundance from a recent harvest.',
	         upright: 'The Empress shows a deep connection with our femininity. Femininity translates in many ways – beauty, sensuality, fertility, creative expression, nurturing – and is necessary in creating balance in both men and women. The Empress calls on you to connect with your feminine energy. Create beauty in your life. Get in touch with your sensuality through taste, touch, sound, smell and sight. Draw on these senses to experience pleasure and deep fulfilment. Treat yourself to a day spa, learn massage, enjoy a fine dining experience, or simply spend more time with your partner. Discover new ways to creatively express yourself, be it through painting, music, drama, or other art forms. This may be the perfect time to take up a new hobby that enables you to access this part of yourself.\n\nThe Empress may also indicate pregnancy or birth. Look to other cards in the reading to confirm if this is an actual pregnancy or birth (for example, the Ace or Page of Cups or the Four of Wands) or if it is metaphorical (for example, the Ace of Wands). On a metaphorical level, the Empress may represent the birth of a new idea, a product, or a new way of being. New ideas and projects will be implemented resulting in the success of all your projects and interests. Bring forth those ideas that have been growing and developing inside of you.\n\nThe Empress encourages you to spend time in nature. Use your holiday time not to stay in fancy hotels in busy cities but to explore nature by pitching a tent or hiking through its beautiful terrain. Allow yourself the time and the space to enter into a different frame of mind in which you can truly connect with Mother Earth and receive her into your heart and mind. Take a trip to your favourite natural setting, be it a forest, beach, mountain or lake and simply sit for a couple of minutes, hours or even days to breathe in the energy that surrounds you while marvelling in the beauty of the earth. The Empress highlights that you are grounded in the material plane (a stabilising influence), yet you can reach into higher planes of consciousness through your connection with nature. You have the potential to connect between the Earth and the Universe.\n\nThe Empress is a deeply nurturing and caring card. If you are a mother yourself, you may be exploring your ‘mother’ role even more deeply than you have before and truly appreciating the gift that has been bestowed upon you. You are blessed by maternal, protective forces or influences. For fathers, the Empress encourages you to nurture your children and open the lines of communication between you and your child. Encourage growth and development of your children, and be there to support and guide when needed.\n\nMore broadly, the Empress encourages you to connect with others by nurturing, caring and supporting those around you. Find ways to support dialogue and open communication, creating a space to openly express your feelings.\n\nWhen we allow ourselves to truly experience the connections with Mother Earth, our femininity and those around us, we create abundance and radiance in our lives. Take a moment to reflect on the love that surrounds you and build on this energy to create even more abundant love in your life. Know that love is limitless. A wonderful affirmation associated with the Empress is, “I bring forth my creations with joy. I love and nurture them to fruition.”\n\nSimilarly, the Empress indicates that the Universal energy is about to intervene in your life. It may be just enough to give you a glimpse of a miracle or it may be even more. You may or may not know whom or what brings such good fortune but the care and nurturing that will result come as no accident. What appears to be coincidental good luck may actually be the result of a series of good choices you have made. It is your turn to have things work out in your favour, to be blessed and to feel nurtured. Know that you are worthy of receiving this loving embrace.',
	         reversed: 'Reversed, the Empress suggests a loss of personal power through placing too much emphasis on another person’s emotional or material needs, thus neglecting your own. The reversed position of this card deals with indecisiveness concerning others and confusion about the direction a relationship may be taking. You may also be finding it difficult to work cooperatively with others. The reason for this lack of harmony is likely to be within you and therefore introspection is required.\n\nIn a relationship reading, the Empress reversed suggests that you are feeling very challenged because you do not have an avenue to express your true thoughts and feelings and you are obliged to bottle a lot of it up inside. Have you got a close friend in whom you can confide? You need to share your feelings with someone so that you can understand them and get in touch with your inner self. This card can also suggest a dependence on other people’s feelings, indicating that you may be playing a waiting game now to see how your partner reacts and what emotion he/she displays. It is best not to do this but instead work through your own emotions independently of him or her.\n\nIf you are struggling in a relationship, the first step for you is to take some time to yourself in order to restore your energy levels and your belief in yourself. Unfortunately, your past relationships have impacted how you see yourself and your ability to truly love and trust another person. As a result, you may be doubting your inner beauty and losing your inspiration for creating beautiful, loving relationships.\n\nYou may also be overprotective of someone you love and this is straining your relationship. Be mindful that you are not becoming a smothering, demanding mother. Are you ‘mothering’ your partner, friends, or family too much? Be careful not to overdraw on the characteristics of the upright Empress. You may need to follow the example of the High Priestess who listens to her inner psyche for the answers.\n\nMore generally, the Empress reversed indicates that you are feeling discontented because something is missing or lacking in your life, or because you want to find something creative, meaningful or fulfilling to do but you do not know what. This card can indicate a creative block. You may find your mood is depressed or negative. Work can feel laborious and mundane. This is not a time to think, act or do. You are already overloaded and mental pursuits will not give you what you need. Further attempts to follow your intellect or reasoning mind will only cause frustration or lead you astray.\n\nThe Empress reversed may also indicate issues with pregnancy, whether it is infertility or an unwanted pregnancy.'
	      }
	   }, {
	      name: 'The Emperor',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/04_Major_Emperor.jpg',
	      keywords: {
	         upright: 'Authority, father-figure, structure, solid foundation',
	         reversed: 'excessive control, rigidity, inflexibility'
	      },
	      description: {
	         basic: 'The Emperor is the complement to the Empress. He is the Masculine Principle, the Animus and the Patriarch. He represents power and authority, and his stern attitude is quite a departure from the sensual beauty of the Empress. The Emperor has a long, white beard, a symbol of his experience. As an archetype, it is common to see masculine figures of authority or father figures with long white beards. It suggests that this man has acquired years of wisdom and experience and he is worthy of listening to because he has seen first-hand the consequences of his actions.\n\nBehind his throne are barren mountains and the throne itself is decorated with four rams’ heads, representing intellectual heights, determination, action, initiative and leadership. The ram is also a symbol of Aries, the astral ruler of the Emperor. In his right hand, the Emperor holds an Ankh, the Egyptian symbol of Life, and in his left is an orb representing the world over which he rules. The orange background and the Emperor’s red clothing symbolise his passion and energy for life and the challenges it offers.',
	         upright: 'The Emperor is the father figure of the Tarot deck. He is the ‘provider’ and protects and defends his loved ones. He has established a solid family line and is often seen as the patriarch of a wide network of family members. He offers guidance, advice and wisdom to others and in doing so, demonstrates authority and grounding. His wisdom is obtained through worldly, life experience. He has ‘been there, done that’, and has the battle armour to prove it. He takes what he has learned, and passes it on to the next generation, so someday they can be as wise and powerful as he is. He brings security and comfort to those around him.\n\nThe Emperor is also representative of structure and stability. He is able to create order out of chaos by carefully categorising his thoughts and mapping out what needs to be done to solve the problem. He is a systematic and strategic thinker and is highly organised and coordinated in his approach. He sticks to a plan and ensures he sees it out until the end. Thus, this card indicates that you have a strong desire to see your ideas manifested on the physical plane in the form of material gain or accomplishment. An opportunity will arrive that could be the foundation of a very successful future.\n\nThe Emperor reflects rules and regulations. He establishes law and order by applying principles or guidelines to a specific situation. He likes to operate within a defined structure with set boundaries. He respects routine and follows a specific regimen or discipline.\n\nDomination of the mind over the heart is sometimes unwanted or best avoided but with the Emperor, it is necessary and even welcomed. If you are facing difficult choices, you must maintain your concentration and focus. Enjoy the assertiveness and confidence that this self-control and focus brings. Push ahead and do what you know is best. Know that if you can master yourself then you should have little problem mastering the world and everything in it.\n\nThe Emperor is a powerful leader who demands authority and dominance. He is most comfortable in a leadership role where he can command and direct others. He likes to be in a position of strength, where he can exert control and bring a sense of organisation to his activities. He often represents a solid establishment that is built on strong foundations. As a leader, he rules with a firm but fair hand. He will listen to the advice of others but he will always have the final say. He is not afraid of war and/or conflict and he will not hesitate to use his force and power to protect those he cares about. The privileged few whom he favours always repay him with the loyalty and respect he deserves.\n\nThe Emperor heralds status, success and recognition. You will have an earnest desire to be recognised as a strong figure of unquestioned achievement and authority. You will want to be known as the dominant force, the leader and the ‘expert’. Focus your attention completely on your goal and be very careful not to reveal any weaknesses or personal doubt.\n\nIf you come across the Emperor in your own life, then you will need to be ready to impress! The Emperor administers and governs the area you wish to enter. You cannot achieve your dreams and goals without this person’s blessing. With the Emperor’s support, you will have a much better chance of actualising your dream and you can begin to benefit from the established structure he has formed.\n\nSometimes, the Emperor can represent the power of the government or a decision-making body. Within yourself, there is also a force that governs your actions. These forces are will power and self-control. You may have discussions concerning contractual agreements, profit sharing, subsidies or management.',
	         reversed: 'Reversed, the Emperor can suggest that there is an over-use and abuse of authoritative power surrounding you at this time. He can be incredibly domineering and rigid in his thinking. It could be originating from you or from another person, often a boss, partner or a father-figure. There may be an insecure man throwing his weight around who has a need for control.\n\nYou may feel powerless when the Emperor reversed appears in a reading. Dealing with authority is fraught with difficulties at this time and whether this manifests as a dominant partner, problems with your father or battles with officials, you do not seem to be making any headway. Paradoxically, freedom lies within such structures now. This is not the time to rebel, instead try to get in touch with your own need to control events and deal with any problems logically.\n\nSometimes, the reversed Emperor asks you to stand up to authority and to know that you do not always have to go about matters in the most traditional way. You may be fed up with an over-bearing boss or a hierarchical organisation and you will be compelled to enter a more flexible and adaptive environment. You may also be inspired to work independently, perhaps even starting up your own business in order to be free of corporate life and oppressive bosses!\n\nIf the reversed Emperor comes up in a career reading, you may be at a point now where you want to avoid having to deal with this type of person and you are now ready to embrace something new. You may also be seeking a career where you can have greater flexibility and creativity in how you complete your work. You are sick of having to always work within the confines of a particular structure or way of doing things and you want to break free of this.\n\nAs a career aspiration, the Emperor reversed indicates that you are trying to avoid the energies of the Emperor in your future career direction. You may find that having to take an authoritarian role every day just does not sit well with you anymore. You want to free yourself from the routine and the structures that have permeated your life and held you back. You want to provide yourself with greater freedom to explore your creativity, rather than getting bogged down in the detail and the routine.\n\nOn a personal level, the reversed Emperor can indicate that you lack self-control, ambition and the ability to deal with any kind of authority. In fact, you probably show contempt for any kind of order. However, you may need to bring more structure into your life at this time. Things may have gotten quite chaotic recently and now it is time to bring about order once again.\n\nIn a relationship reading, the reversed Emperor suggests that you may be in an unequal relationship and this is making you unhappy in the long-term. Your partner has become over-bearing, possessive, dominating and authoritative. While you may have been looking for a partner to take care of you and provide a stable foundation for the future, it has gone too far now and you feel as though much of your independence and freedom have been taken away. Your partner has become stubborn, rules-based, argumentative and highly structured. This is putting strain on the relationship and preventing a creative flow of energies to flow between you. He/she feels benevolently toward you but has inflexible expectations of you.'
	      }
	   }, {
	      name: 'The Heirophant',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/05_Major_Hierophant.jpg',
	      keywords: {
	         upright: 'Religion, group identification, conformity, tradition, beliefs',
	         reversed: 'Restriction, challenging the status quo'
	      },
	      description: {
	         basic: 'The Hierophant is known as the High Priest in some decks. He is the masculine counterpart to the High Priestess. He is also known as Chiron, the Pope and the Shaman. The Hierophant is ruled by Taurus.\n\nThe Hierophant is represented by a religious figure, sitting within a formal church environment. He is wearing three elaborate vestments of his office that represent the three worlds. The crown he is wearing has three tiers to. His right hand is raised in benediction, the same hand the Magician has raised. While the Magician was taking raw power from the Universe and manifesting it on the material plane, the Hierophant channels that power through society (as in the religions of the world). The triple sceptre is another symbol of his dominion over the three worlds. The crossed keys represent a balance between the conscious and subconscious minds and unlock the mysteries. Before him kneel two initiates. The Hierophant’s task is to bring the two initiates into the church so that they can take up their appointed roles. This symbolises entry into all types of institutions where there is a shared group identity. These could include schools, clubs, teams, companies and societies.',
	         upright: 'The Hierophant is very conventional and this Tarot card suggests that you have a desire to follow due process and to stay within the conventional bounds of what is typically an orthodox approach. Instead of being innovative, you will need to adapt to the existing set of beliefs and systems that are already in place. You will need to do what is expected of you. The appearance of the Hierophant in a Tarot reading indicates that this is certainly not a time to challenge the status quo!\n\nThe Hierophant Tarot card suggests that you may be wise to follow established social structures and traditions. You may be involved in some sort of ritual, ceremony, or the trappings of religion. There is also a need to honour some tradition in your life, or maybe start some traditions of your own if you have none. Consider also exploring your spiritual or religious heritage.\n\nIn Tarot readings, the Hierophant card often stands for institutions and their values. The Hierophant is a symbol of the need to conform to rules or fixed situations. His appearance can show that you are dealing with a force that is not innovative, free-spirited or individual but is instead fixated on the ‘way we have always done things around here’. Groups can be enriching or stifling depending on circumstances. Sometimes we need to follow a program or embrace tradition, while at other times we need to trust ourselves.\n\nThe Hierophant Tarot card indicates that you may feel compelled to join some sort of group or institution. It may be as significant as joining a new church or religious group, or as simple as joining a gym. This Tarot card is about identifying with a group and a way of thinking that will have benefit for you and will prompt further learning.\n\nIn his focus on sharing knowledge through an institution, the Hierophant represents education and the pursuit of knowledge. This Tarot card can indicate a period of increased studying and learning, through formal mechanisms. You seek to understand a field of study that has been widely explored and documented, and so you may go to a well-known or established teacher to find out more.\n\nThe Hierophant may also appear in your life as a psychotherapist, a wise counsellor, a priest, or a spiritual mentor to whom you will turn for wisdom and knowledge. He may be an authority or a kind and generous mentor who nurtures a spiritual awareness. You will learn new skills from this helpful teacher as he has the wisdom to provide good counsel and advice.\n\nThe Hierophant Tarot card represents an institutionalised means for accessing the sacred and is the carrier and transmitter of ancient wisdom and religious teaching. He represents a link between us and the Divine and, for this reason, he is often referred to as the Pope. The role of the Pope is traditionally that of the mediator between God and mankind. As such, the Hierophant represents the spiritual teacher who helps us come into contact with the Divine. Unlike the Magician, who simply points the way, the Hierophant is a trusted guide, one who will take us by the hand and lead us to our spiritual goal. He represents a gateway to a higher consciousness reached in a ritualised manner. He teaches that which can be learned by word and example.\n\nAll things that are righteous and sacred come with the Hierophant Tarot card – marriage, alliance, captivity, servitude, mercy and goodness, inner conscience and outer conscience.',
	         reversed: 'The Hierophant reversed indicates that you are feeling restricted or constrained by structure and rules, and as a result, you have lost a lot of flexibility and control in your life. You have a strong desire to go against the grain and break free from convention. You may be tempted to go about your business in an unorthodox manner, to do something that is out of character or against social norms. The Hierophant reversed is about breaking the rules and challenging the status quo. You no longer accept the rigid structures, tradition and dogma surrounding you, and now seek out opportunities to rebel and retaliate. You want to challenge ideas and concepts that you once thought of as written in stone.\n\nThe reversed Hierophant is about questioning tradition and asking yourself whether what you are doing is really the right thing by you. You may have been running on automatic so far and following the crowd but now you realise that perhaps things are not the way they seem and changes need to be made.\n\nIn this way, the Hierophant reversed is like a rebellious teenager or young adult who begins to question society and participate in political activities. There may be a run-in with authorities or conflict with a parent or authoritative figure.\n\nThe reversed Hierophant can sometimes reflect societal or group pressure. You are being forced to conform but you do not agree with the fundamental belief systems.\n\nThe Hierophant can also represent a person who is in a leadership role or position of authority. He may indicate a religious leader, a father figure, or even a boss at work. When the Hierophant is reversed, you may find that this person is ruling with an iron fist, forcing others to conform and abide by the rules, afraid to step out and do something different or challenge the status quo. If this person is ‘in charge’ then you may have little choice but to follow.'
	      }
	   }, {
	      name: 'The Lovers',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/06_Major_Lovers.jpg',
	      keywords: {
	         upright: 'Love, union, relationships, values alignment, choices',
	         reversed: 'Disharmony, imbalance, misalignment of values'
	      },
	      description: {
	         basic: 'The sign associated with the Lovers is Gemini. The two figures in the Lovers card are blessed and protected by the angel in the clouds above them. Angels, in general, represent the refinement of earthly desires. This angel, in particular, is Raphael, the angel of Air. One of the associations of Air is communication, necessary for a healthy relationship. The purple cloak on the angel represents royalty, a symbol of how important communication is. The sun shines brightly over the couple, bringing warmth and security. The earth at their feet is green and fertile and suggests life and happiness. The snake in the fruit-laden tree behind the woman suggests the story of Adam and Eve, the fall of humanity from grace, and the temptations of the world. The snake is also a symbol of the senses. The flames behind the man represent the flames of passion, indicating the primary concern of the man. There are twelve flames, representing the twelve zodiac signs, the symbol of time and eternity. The man looks to the woman, who looks to the angel, indicating the path of the conscious to the subconscious to the super-conscious, or from physical desire to emotional needs to spiritual concerns. The mountain is a phallic symbol, while the water is a feminine symbol, indicating balance between the two.',
	         upright: 'The Lovers represent perfection, harmony and mutual attractiveness. Their trust in one another gives them strength and confidence to overcome the obstacles in life. The bond that the two lovers has created is incredibly strong and is often reflective of a marriage, soul mate connection or very intimate and close relationship.\n\nThe Lovers can also indicate a very strong sexual connection that goes beyond instant gratification and lust to suggest a very deep desire and passion that exists between two beings. The physical attraction is strong and so too is the desire to be intimate with one another.\n\nOn a more personal level, the Lovers card represents the establishment of a personal belief system and becoming clearer about your own values. This is a time when you are figuring out what you stand for and what your personal philosophy on life is. Having gone through the indoctrination of the Hierophant, you are now ready to establish your own belief system and make up your own mind about what is and what is not important in life. This is also a time when you need to stay true to yourself and be as authentic and genuine as possible.\n\nThe Lovers also represents choices on a grand scale. A dilemma will be presented demanding an action or decision, and you will want to decipher the best way to proceed or make the right choice. Something is going to change your plans or the course of your experience, something that may look negative on the surface but will later prove to be a blessing in disguise.\n\nWhen the Lovers card appears in a reading, it is important to think about what decisions and choices you are facing. The fact that the Lovers is a Major Arcana card indicates that these decisions or choices are incredibly important and significant so it is essential that you choose the right path. There may be an easy option available but you will need to ask yourself whether this is the right path for you in the long run. Oftentimes, it is the more difficult path that will bring you the greatest benefit, particularly on a deeper level.\n\nIf you find yourself at a moral crossroads where you must choose between taking the moral high ground or the low ground, then you need to consider all consequences before acting. The Lovers card highlights that your own value system is being challenged, and you must make a definite choice based on that system. The choices are never really easy or obvious, either. Unlike the Fool’s choice which has no wrong answer, the choice of the Lovers is very much right or wrong because one of those options will almost certainly take you down a negative path. Thus, it is wise to seek higher guidance before making your final decision. You must be completely honest with yourself in the situation. Do not take things strictly on face value but deeply examine your motives, your feelings, your options and your personal values.',
	         reversed: 'The Lovers reversed indicates that you are avoiding responsibility for the consequences of your own actions. You have made a rushed decision based purely on your desire for instant gratification and now you are trying to lay the blame on others or on fate. You must do what you can to make amends but if this is not possible, let the past go and resolve to make better choices in the future.\n\nThe Lovers reversed can also indicate inner conflicts and being at war with yourself rather than with external forces. It suggests disharmony and difficulty in being able to balance your own inner union. Perhaps you are punishing yourself for something you have done or feel responsible for? To help you out of this situation, you will need to focus on clearly articulating your personal belief systems and values. This will help to guide you in making better decisions next time. In addition, you may need to return to the energy of the Hierophant and seek the counsel and advice of an institution or spiritual mentor.\n\nIn a relationship reading, the Lovers reversed indicates that there may be some imbalance. You may feel that a once-close union is starting to fragment and break down. Your vibrations with each other may be out of tune, and you may feel as though you are both out of harmony. Despite an immense amount of potential when you first met, this potential is now being brought into question. You are starting to realise that your values are actually different and your visions of the future are different. These fundamental differences may be a showstopper for the relationship if they cannot be resolved.\n\nThe Lovers reversed may also reflect that the feelings within a relationship are not mutual. One person in the partnership may have stronger feelings than the other and may be more emotionally involved. This could lead to disappointments later down the track and feelings of insecurity about the relationship. You may be reluctant to open your heart up to the relationship for fear of getting hurt.\n\nYou need to be aware that an imbalance in your relationships exists. With this in mind, you can alter your behaviour to accommodate being out of sync with your partner or someone else who is important in your life. Work hard to bring things back to the level point and do not allow things to get out of control. You may be experiencing a slight downturn at this stage but it certainly does not mean it is all over! Simply try to maintain the balance and harmonise your union together.'
	      }
	   }, {
	      name: 'The Chariot',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/07_Major_Chariot.jpg',
	      keywords: {
	         upright: 'Control, will power, victory, assertion, determination',
	         reversed: 'Lack of control and direction, aggression'
	      },
	      description: {
	         basic: 'The Chariot is associated with the astrological sign of Cancer. He sits within a canopy of six-pointed stars, representing the celestial influences at work in this Tarot card. The crescent moons on the man’s shoulders are outward facing to refer to the formative world. The symbols on his tunic are alchemical symbols, representing the spiritual transformation of man. The square signifies earth, a sign of strength of will. The laurel and star crown indicate the highest attainment of man in spiritual evolution.\n\nThe wings on the Chariot represent inspiration and the Hindu sign of the union of positive and negative. The black and white sphinxes have the same meaning. The Charioteer holds no reins, just the wand from the Magician card. He controls through strength of will in the same way the Magician does. The city is behind him, indicating he has turned his back on civilisation and materialism in order to seek spiritual matters.',
	         upright: 'The Chariot represents conquest, victory and overcoming opposition through your confidence and control. Any success will be a result of applying these factors to the situation. You will need to use the strength of your willpower to overcome any obstacles or challenges in your way. You may even find that by leveraging any opposing forces surrounding you at this time you can use them to your advantage. You must be determined, self-disciplined, and hard working. If you are, you will triumph over any difficulties or anyone who is trying to limit you. This struggle will ultimately make you stronger.\n\nYou will be successful at pursuing your goals, so long as you maintain focus, determination and confidence in your abilities. You need to focus completely on the task at hand, get in the race and win it. You have to dominate and beat the competition. You must cultivate the ability to withstand the rigours of what is required. In fact, striving towards your goal can be as satisfying as attaining it. This is a time to be strong and in control. You must also draw upon your willpower and self-discipline.\n\nYou may be wondering if you should pursue a plan or continue a project but you will be driven to do so, and your perplexing dilemma will be resolved for the time being.\n\nThe Chariot requires you to assert yourself and be bold. You may need to look after yourself at this time and be confident in expressing your needs and wants, otherwise you will not get your way. You need to have faith in yourself and know fundamentally who you are and what you stand for (thus building off the personal belief systems and values established through the Lovers card).\n\nSometimes, the Chariot asks you to come to terms with your own aggressive impulses. Aggression is part of human nature, part of your innate survival mechanism. Aggression cannot be simply suppressed; to do so will only turn it inward on yourself, leaving it to manifest itself in the form of physical illness. Aggression can be very destructive but it is also a powerful energy that can be channelled creatively. This is a time when you need to be the master of your emotions and curb any impulses or anger. You need to show who is the boss and achieve control of the situation but this will also require you to be in control of yourself.\n\nThe Chariot can also represent a lot of driving and even a road trip. You may even be considering buying an RV and heading off across the country!',
	         reversed: 'Reversed, the Chariot suggests that you are feeling as if you have very little control over your life. You may have lost steering power over the opposing forces and you are now at their mercy. You may feel dragged through time, in whatever direction fate takes you. If you are someone who likes to have some control over your destiny and to know where you are heading, this is the time to tighten the reins and become more disciplined and focused on what you are doing. While the feeling of loss of power can be quite demoralising, the key is to look at what you can control and what you cannot control. Do not allow yourself to be worried about what is out of your control as there is nothing you can do about it. Instead, focus your energies on what IS in your control. Examine what you can do to change the situation. At this stage, you need to be able to feel as if you have at least some direction, because currently you feel pushed and pulled around in the sea of fate.\n\nThe Chariot reversed also suggests that you are collapsing under pressure and losing your self-control. Your aggression is being channelled in the wrong direction, wildly at other people, at fate, at external circumstances. This is a complete waste of your energy and resources. Redefine your aggression as determination and willpower, stop clinging weakly to unrewarding ideas, habits, people, and objects and move forward.\n\nYou may be feeling that up until this point, you have been at the beck and call of others and have been forced to deal with other people’s issues. You may have felt a loss of personal control, as if life was just being ‘done’ to you. As a result, you have lost some of your confidence and personal power, and you may be feeling directionless. You seek greater control over your life and you are determined not to let others influence you as significantly as they have in the past. You want a mind of your own and you want to steer your life in the direction YOU wish to, not what someone else wants.\n\nThe Chariot reversed may also suggest that you need to be more comfortable with not always being in control. There are going to be moments in the future where you feel as though aspects of your life are out of your hands. Be open to spontaneity and new experiences, even if it is not aligned to your original plan. Do not be afraid to let someone else steer for a period of time and take you on new adventures. You do not always have to be in the driver’s seat!'
	      }
	   }, {
	      name: 'Strength',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/08_Major_Strength.jpg',
	      keywords: {
	         upright: 'Strength, courage, patience, control, compassion',
	         reversed: 'Weakness, self-doubt, lack of self-discipline'
	      },
	      description: {
	         basic: 'Under a golden sky, a woman gently pats a lion on its forehead and lower jaw. The woman gazes down at the lion with a peaceful smile on her face and appears to be successfully taming this wild beast. The fact that Strength is represented by a woman indicates that this card is not focused on pure physical strength. She has the infinity symbol above her head, the same symbol seen in the Magician. Her white robe is that of the innocent Fool, indicating a purity of spirit. The blue mountain in the background is the same phallic symbol seen in the Lovers. The lion is a symbol of our animal passions and desires. The lion itself is sticking out his tongue. Animals that are preparing to bite do not stick their tongues out. This lion is happy to submit and surrender to the woman. The woman overcomes the lion with a quiet strength that can only come from within. Her left arm represents mental effort, while the right arm represents physical effort. Her right arm is merely holding, while the left arm is exerting all the pressure. She wears a belt and crown of flowers and stands unprotected in an open green field. The crown on her head represents the fullest, most beautiful expression of nature and transient life. The sign associated with the Strength card is Leo.',
	         upright: 'The Strength Tarot card represents strength, determination, and power in a manner similar to the Chariot. However, the differences between the two Tarot cards are obvious. Where the Chariot represents outer strength and will, the Strength card represents inner strength and the power of the human spirit to overcome any obstacle. The meaning of the Strength Tarot card is about knowing that you can endure life’s obstacles by drawing upon your inner strength and confidence. You have great stamina and persistence, tempered by an underlying patience and inner calm. You are focused on what you need to do, and you go about it in a way that demonstrates great composure and maturity.\n\nThe Strength Tarot card also reflects a compassionate approach. You are like the woman in this card who offers love and patience to the ferocious lion in order to be able to tame him. You give others space and you are tolerant of their needs. You are accepting and can easily forgive any imperfections. In doing this, you create a safe and trusting environment where you can then gently influence others. This demonstrates a level of ‘soft’ control, persuading and coaxing others to your way of thinking.\n\nThe Strength archetype teaches you that you have the strength to tame the beasts within yourself. Meditating on this card can assist your process of honouring and experiencing the inherent strength that is within your nature.\n\nThe lion in the Strength card symbolises your animalistic nature. And the young woman symbolises your opportunity to tame the wild beast within. So, when you learn to fully master your raw, instinctual behaviours, thoughts and emotions, the positive qualities of the Strength Tarot card will emerge from within you. The main lesson from this card is that emotions must be transcended if spiritual wisdom and intuition are to be awakened. Your inner voice is often drowned out by the dominant noise of ego and fear. Let go of these negative emotions and you will begin to create the silence you need to hear your inner self. Conquer your fears, control your impulses, and never lose patience with yourself or what you are doing. Eventually you will see the wisdom of letting go of your lower, animalistic self.\n\nThe Strength Tarot card shows a balance of the aspects of you that are human, animal and divine. It may seem impossible but love, kindness and a brave heart can bring them into balance. In a Tarot reading, the appearance of the Strength Tarot card indicates a time when you need to be very conscious of your instinctual urges and reactions, and bring them into balance with the greater good and meaning in life. This is not a time to act out in rage or in hatred but instead to look at the situation from a place of love and compassion.\n\nThe Strength Tarot card represents a higher level of consciousness that allows you to take responsibility for yourself, so that you can master yourself and your world. The Strength card reminds us that inside each of us is a passionate and instinctual side that, depending on the person, will either burst out frequently or infrequently. If you are one of those people who acts impulsively or irrationally, and who blurts out angry comments or negative things to others, the Strength Tarot card calls on you to try to tame yourself. The woman in this card is calmly subduing the lion by offering peace, love, and warmth. You may need to do the same to prevent yourself from leaping out at others and saying some things you might later regret.\n\nIn a Tarot reading, Strength offers you the hope of connecting with both your inner and outer strength. It asks you to find the confidence within yourself to present yourself to the world as strong, assertive, and persevering. If you have been self-doubting, the Strength Tarot card gives you the confidence to fight those doubts. Additionally, if you are feeling worn out or stressed, Strength says to you, “Things are going to get better! You are going to find the strength within yourself and within others to keep going!”\n\nWhen you see the Strength card in a Tarot reading, it is an important sign that you are strong and you have the endurance necessary to see whatever task that is bothering you through to its eventual end. If you are pushing too hard and forcing change, Strength shows the need to withdraw for the moment, and to be patient. Alignment with your Higher Self and full manifestation of your goals will come only when the time is right – it cannot be rushed.\n\nWith the Strength Tarot card, it is clear that strength and courage will be applied to all your endeavours. Results may be slow in coming but you will hold your own, get a lot accomplished and summon up enough energy to do what it takes to get the job done. One way or another, you will be recognised or rewarded for your efforts.',
	         reversed: 'Strength reversed indicates weakness. You may have recently experienced a setback, or you are questioning your own journey and whether you are on the right track. Your inner strength and courage is lacking right now and you are feeling inadequate and vulnerable as a result. While these feelings may seem very real when you are in the moment, you will soon come to realise that they exist only to remind you that you are only temporarily out of touch with your inner strength. You need to remember that your core strength will always be with you and now is as good a time as any to reconnect with this core strength. Look towards the positive aspects in your life to reinvigorate self-confidence and self-esteem. Return to the lesson of the Chariot, where you need to draw upon your willpower, focus and determination in order to overcome your obstacles and be victorious.\n\nSimilarly, the reversed Strength Tarot card suggests that you may be starting to doubt yourself and lose some self-esteem and self-confidence. Instead of taking the lead and manifesting your goals, you may be engaging in self-doubt and becoming dependent on others’ feelings and actions that then dictate your own.\n\nIn a Tarot reading, Strength is also related to inner control and, in its reversed position, suggests that you may be giving in to your instinctual reactions and lacking the self-discipline you need. Aggression may be an issue and, as such an anger management course may be a good path forward for you. You need to exercise more control over your raw emotions to ensure that you do not lash out at others and later regret your actions and words.\n\nIn a relationship reading, the reversed Strength card may indicate that you doubt yourself and feel as if you are not ‘good enough’ for the relationship. You may not feel completely secure in the relationship and often question whether your partner really has strong feelings for you. This may lead you to be someone other than your true self, someone who is worried, anxious or overly protective about the relationship.'
	      }
	   }, {
	      name: 'The Hermit',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/09_Major_Hermit.jpg',
	      keywords: {
	         upright: 'Soul-searching, introspection, being alone, inner guidance',
	         reversed: 'Isolation, loneliness, withdrawal'
	      },
	      description: {
	         basic: 'The Hermit stands alone on the top of a mountain with a lantern in his hand. Mountains typically symbolise achievement, growth, and accomplishment. The Hermit has attained his spiritual pinnacle and is ready to share his knowledge with others. He is also continuing the path he has chosen, committed to his goal of ultimate awareness. The star in the lantern is a six-pointed star (the Seal of Solomon, a symbol of wisdom). The staff carried by the Hermit is the patriarch’s staff, a symbol of the narrow path of initiation and an emblem of power and authority. It represents the Hermit’s ability to use his isolation and the knowledge he has gained as a tool upon his path to reach even higher levels of awareness. The staff is in the Hermit’s left hand, the hand associated with the subconscious mind. The snow at his feet represents the heights of spiritual attainment. He wears the grey cloak of invisibility. His secrets are not for everyone, only for those earnestly seeking them and those willing to climb the heights to wisdom. The astrological correspondence for this card is Virgo and the number 9 signifies accomplishment, wisdom, the attainment of goals, as well as the search for truth.',
	         upright: 'The Hermit Tarot card suggests that you are in a phase of introspection where you are drawing your attention and focus inward and looking for answers within. You have a strong need to understand, not just at the surface level but to really know why life is the way it is. The Hermit reflects that your consciousness has moved inward and you now realise that the truth and understanding you seek is within yourself and not in the distractions of the outside world. This is a perfect time to take a step back from your day-to-day life and deeply contemplate your motivations, personal principles and values.\n\nThe Hermit reflects that you are engaging in a period of soul searching. You want to seek the truth at all costs. You desire a new direction in life and, as a result, have recently begun a journey of self-discovery and contemplation. There comes a point in life when we begin to question the status quo, knowing that there is a deeper meaning to life, and thus, we begin to search for it. This search is mainly a solitary quest because the answers do not lie in the external world but within us. Thus, the Hermit Tarot card indicates a time when you seek solitude and isolation from others. You need to be alone and you want to withdraw from the world around you. This is so that you can retreat further into your own private world and experience a deep sense of seclusion.\n\nThrough meditation, contemplation and self-examination, you may begin to re-evaluate your personal goals and change your overall direction. You will look at your life with a deeper, more spiritual understanding and will begin to change some of your priorities as a result. There is a certain level of spiritual attainment that is associated with the Hermit. The appearance of the Hermit in a Tarot card reading suggests that you need to develop the true power of a spiritual master through deep introspection. Be content with being alone or associate only with those on your level. Do not waste time and energy on those not ready or not worthy.\n\nThe Hermit represents the desire to turn away from a consumerist or materialistic society to focus on the inner world. Have you ever seen the movie or read the book, “Into the Wild”? After graduating from university, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity and hitchhikes to Alaska to live in the wilderness on his own. Whilst his story has a sad and tragic ending, his journey into the wild reminds me a lot of the Hermit, who seeks answers within and knows that they will come only with quiet and solitude.\n\nThe Hermit has learned to help others with love and compassionate detachment. This Tarot card indicates that you have gone beyond the point of being critical and you can now understand and appreciate that the varied paths people choose for themselves all lead to the same higher purpose. You have reached a high enough level of spiritual attainment yourself that you no longer need to convince others of what they should do. You can honour silence and allow your inner light to shine out towards others as a means of communication.\n\nMeditating on the Hermit Tarot card teaches you to honour the wisdom within yourself. You must find your own light, shine it on your soul and create your own special path. Through meditation and visualisation, the Hermit allows you to get in touch with the wise person inherent within you.',
	         reversed: 'The reversed Hermit can go one of two ways. You are either not taking enough time for personal reflection, or you are taking too much. If you are struggling to connect more deeply with your spiritual self, the Hermit reversed encourages you to create more time and space so that you can meditate and reflect on your spiritual self. It is time to go more deeply into your inner being and rediscover your greater meaning and purpose on this earth. You may have been so busy dealing with the day-to-day issues that you have forgotten to reflect inwardly and listen to your inner voice. The Hermit asks you to search deep within your soul to help you find your way again and to focus on rebuilding yourself on a spiritual level.\n\nIf you have already been spending a lot of time reflecting on your inner self, then the appearance of the reversed Hermit may suggest that you are spending too much time alone in excessive isolation. You are literally becoming a hermit and cutting yourself off from others. While this period is helping you on a spiritual level, you may be feeling temporarily isolated and alone. Do not underestimate the value of staying connected with others, even while you are going through your own spiritual journey. Be mindful, too, of other people’s needs. You do not want to become so absorbed in yourself and your personal dilemmas that you shut out your family and friends.\n\nIn a relationship reading, the reversed Hermit can indicate unwelcome isolation. For example, one person may want to be alone or may be withdrawing from the relationship, while the other person wants to deepen the connection. You will need to respect each other’s request for space but also be there to support as appropriate. Alternatively, the idea of being alone and on your own is so daunting and unappealing at this time that you do everything in your power to stay together. Even if there are challenges in the relationship, you both do not want to be apart from each other as separation will only bring a feeling of emptiness. It is almost too soon to be apart and you still both want to work things out together. If you have separated already, then the Hermit reversed may indicate that you are ready to explore a reconnection as you have found that you have had long enough on your own.\n\nIf you are currently single, you may be growing tired of being alone, and instead strongly desire a relationship or close connection at this time.'
	      }
	   }, {
	      name: 'The Wheel Of Fortune',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/10_Major_Wheel_of_Fortune.jpg',
	      keywords: {
	         upright: 'Good luck, karma, life cycles, destiny, a turning point',
	         reversed: 'Bad luck, negative external forces, out of control'
	      },
	      description: {
	         basic: 'The Wheel of Fortune is highly symbolic. The angel in the top left corner is Aquarius, the eagle is Scorpio, the lion is Leo and the bull is Taurus. These are the four fixed signs of the Zodiac but all have wings signifying stability amidst movement and change. The book they each have in their hands is the Torah, representing wisdom. On the wheel itself are the Hebrew letters IHVH (Yod Heh Vau Heh), the unpronounceable name of God. Interspersed with these letters are TORA (read anti-clockwise) or TARO (read clockwise) which also translates to TAROT when you return to the spot where you started. The snake descending on the left side of the Wheel is the Egyptian god Typhon, the god of evil. The snake also represents the life force descending into the material world. The Anubis rising on the right side of the Wheel is Hermes, a symbol of intelligence, wisdom ascending or our shadow selves. The Sphinx on the top of the wheel represents life’s riddles. The middle wheel contains the alchemical symbols for mercury, sulphur, water and salt – the building blocks of life and the four elements – and represents formative power. The outer circle represents the material world. The eight spokes in the wheel represent the Universal radiant energy, as well as the eight Sabbats of the year. The blue background represents wisdom.\n\nThe planet of this card is Jupiter, the planet of opportunity, growth, success, and expansion. The number 10 is a higher octave of the number 1, empowering the qualities of the 1.',
	         upright: 'The Wheel of Fortune refers to the fact that things tend to go in cycles. There are good times and there are bad times. Even if your external environment is difficult and challenging, there will come a time when this will ease off and you will be able to focus more on creating fun and frivolity. The lesson of the Wheel of Fortune is that you must accept that there are always ups and downs in life. If you were to have only good times, you would become less appreciative of what you have. Sometimes the bad times provide the contrast and perspective you need to be able to recognise how blessed you are when the good times come. So, when times are good, enjoy the benefits but do not become complacent because things can change. When times are bad, do not be discouraged because even when things seem their worst it simply suggests that things can only get better!\n\nThe Wheel of Fortune suggests that you should not simply stand still and accept what life hands you. You can take an active hand to try and remain on the upside of the Wheel. When things are down, instead of waiting and hoping for things to get better, you can work actively towards improving your situation, thereby speeding up the recovery process. Finally, the Wheel asks you to not become discouraged when faced with adversity. Adversity is a natural part of life and should be expected from time to time. The fact that bad times happen should not worry you. Accept them as natural and not necessarily indicative of problems. Instead, look for ways in which you can face and conquer the adversity. If it cannot be addressed, then that might be taken as a suggestion of a problem.\n\nThe Wheel of Fortune suggests that there are external factors that are influencing your situation that may be unknown to you or outside of your control. It is as though the Universe is just dishing up whatever it pleases at this time, and it can feel quite unpredictable and unnerving as a result (especially if you like being in control most of the time!). This is one of the challenging aspects of the Wheel of Fortune since no matter which way the Wheel of Fortune turns, it is impossible to try and change it. So, you might as well try to accept what is happening and adapt accordingly. If a crisis seems inevitable, recall that in every crisis lies opportunity. When you have been pushed in a new direction, know that every path leads somewhere, even if you do not know where it is. Such events are simply out of your control, and if you can accept that then the ride gets a lot easier. If you struggle against the Wheel it will crush you. So just go with the flow!\n\nThe Wheel of Fortune is about keeping optimistic and having faith in the Universe that it will take care of the situation in the best way possible. You need to remain optimistic yourself, thinking positively and keeping as upbeat as possible. Through meditation and visualisation, the Wheel of Fortune can assist and reinforce your intention to bring increased abundance, good fortune and prosperity into your life. This archetype allows your life to turn in more positive directions if you are willing to grow and expand. This is also a ‘lucky’ time in life when you are sensing the action of fate and destiny working in your favour. You may even be witnessing miracles or a very fortunate series of events.\n\nThe Wheel represents karma and reminds you that ‘what goes around comes around’. In the upright position, you are likely to be at the positive end but again, do not become complacent. You still need to act in ways that are fundamentally ‘good’ to ensure that luck or positivity stays on your side.\n\nThe Wheel of Fortune speaks of a pivotal point in your life, where new options become possible. The appearance of the Wheel of Fortune shows that change is not only likely to happen, it is certain to happen, and soon. Generally the change shown in the Wheel of Fortune is a dramatic change from the established order. These changes are distinctly personal and may require making a first step on a new and unfamiliar path. You may also need to alter your present course, move things in a different direction or turn things around to ensure that you are creating the right outcomes in your life.\n\nA great affirmation for the Wheel of Fortune is, “Through all the changes that the Universe brings, I feel the center of stability which is within me.”',
	         reversed: 'When the Wheel of Fortune is reversed, luck is not on your side. There has been a turn of events that are not in your favour sending you into a tail spin and changing your world significantly, seemingly for the worst. Oftentimes, the reversed Wheel of Fortune indicates that there are negative forces at play that are outside of your control, leaving you feeling helpless and powerless. However, while there have been some unfortunate circumstances that are outside of your control, the run of bad luck that you are experiencing may also be as a result of poor decisions you have made in the past. Think about what actions you have taken recently and whether these may have contributed to your present circumstances. What can you do to improve your luck and regain control of your destiny? Despite the setbacks, learn from the cycle of life and be prepared for such ups and downs in the future. Accept responsibility for your current and future situation, and look for ways that you can create more positive outcomes.\n\nThe reversed Wheel of Fortune can also reflect resistance to change, particularly if change is being forced upon you. The appearance of this card suggests that change has become a source of significant stress for you and you may be trying to consciously or subconsciously stop events from running their course.\n\nThis is also not a time to be taking risks as you may not come out a winner. You may need to be more cautious than before, taking more time to assess your options and to select the safest bet.'
	      }
	   }, {
	      name: 'Justice',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/11_Major_Justice.jpg',
	      keywords: {
	         upright: 'Justice, fairness, truth, cause and effect, law',
	         reversed: 'Unfairness, lack of accountability, dishonesty'
	      },
	      description: {
	         basic: 'Justice is ruled by Libra and the card number is 11. The figure of Justice sits in her chair, cloaked in red and holding a sword in her right hand and scales in her left. She wears a crown with a small square on it representing well-ordered thoughts. Notice the clasp holding the cloak together. The square is the law protecting the circle and the eternal state of oneness within us all. The sword is double-edged, cutting both ways, signifying impartiality. It is point-up, signifying victory. The sword in her right hand demonstrates the logical, well-ordered mindset necessary to dispense fair justice. The scales are in her left, intuitive hand, showing that logic must be balanced by the intuition. A little white shoe pops out from beneath her cloak, reminding us of the spiritual consequences of our actions. The purple cloth draped behind her signifies compassion and the grey pillars represent the constraints of the physical world.',
	         upright: 'Put simply, the Justice card represents justice, fairness, truth and the law. As an outcome, the Justice card indicates that the fairest decision will be made. You are being called to account for your actions and be judged accordingly. Notice that Justice’s scales are balanced, thus its appearance indicates that events have worked out as they were meant to work out and that what is happening to you comes from the decisions you have made and the actions you have taken in the past. You have what you deserve.\n\nJustice represents a conscious awareness that your decisions and actions have long-term consequences and your present and future circumstances are most likely a result of these decisions and actions. At the same time, Justice shows that your actions in the future can be changed by a lesson learned in the present situation. You cannot become honest without extending that honesty to yourself and others.\n\nJustice reflects the search for truth. You need to know and speak the truth and perceive it in the words and deeds of others. Be fair and just with all and you will soon be able to detect dishonesty in yourself and others. Learn the rules that govern what you are involved with. This is a time to remain objective and to base your judgement on fact and not on heresay.\n\nThere is a need to be fair and just when you see the Justice card in a reading. When everyone is ‘playing fair’ and adhering to the rules, a positive outcome will be achieved. However, you need everyone to be on the same page for this to occur. It is no good if there is someone who is going against the grain or trying to stir things up!\n\nThe Justice card also indicates a time when decision-making is required. Something in your life needs attention, mediation or a solution. Look to the two cards lying on either side of the Justice card to understand what it is that you are weighing up in your decision-making. As you contemplate your decision, are you the person to pass judgment, or is your role to accept the decision that is made? How can you remain as objective as possible, whilst searching for the truth of the matter? It is an important time for your ‘inner umpire’ (i.e. your conscience) to make the ‘right’ decision. Balanced judgement exists.\n\nJustice often refers to legal matters of all kinds. The courts are where judgments are made and decisions rendered. The legal system is the official arena in which the principles of Justice (fairness, impartiality and the quest for Truth) are explored. If you see the Justice card in a reading where there are legal matters at hand, expect the outcome to be just and fair. You are also likely to be dealing with legal contracts, such as a marriage license, divorce decree, business contract, financial arrangement or litigation. Where you are the person demanding justice, know that justice will be served and lawsuits won. Of course, if you have acted in a deceptive way or have not spoken the truth, be aware that justice will still prevail and you will need to take responsibility for your actions.',
	         reversed: 'Reversed, Justice indicates dishonesty to yourself and others. It shows an unwillingness to understand the deeper meaning of why an event has occurred and shows that you are missing some opportunity for a greater understanding of yourself in life. You are not actively accepting responsibility for your actions and may be trying to ‘dodge the bullet’ and blame others for your mistakes. The key here is to take responsibility for your own situation and realise that you are here through your own past choices, and therefore, whatever it takes to get out of the situation is fair and just according to Universal principles of karma and justice.\n\nIf, after a very hard look at yourself, you feel that you have done the best job possible, know that the Universe has a path laid out for you and while your situation may be frustrating right now, it is the right path for you. Over time you will begin to see that it does indeed have a reason for being this way.\n\nGiven that the Justice card can reflect a very judgemental, black-and-white view of the world, you may need to release all of your thoughts about what is right and wrong, and just accept what is. Stop judging yourself constantly about whether you are doing the right thing or whether it is working. You are where you are and you just need to accept your current situation. Just allow yourself to ‘be in the moment’ and withhold any immediate judgement. The reversed Justice card also suggests that you may be better off by bending the rules a little and being a bit more flexible with your current circumstances. Of course, you also need to act in a way that is fair and just, and not under-handed, otherwise karma will come back to you!\n\nIf you are engaged in a legal matter, you may be concerned about an unfair outcome. You may dispute the final judgement, calling into question the whole legal process. There may be legal complications or something that gets in the way of justice being served.\n\nYou may be biased or unfairly judging others, failing to seek out the truth or a balanced perspective. Your opinions are biased and have been swayed by others. Be mindful of how you judge or criticise others and ensure that you have a balanced view before you go swinging the sword of justice!'
	      }
	   }, {
	      name: 'The Hanged Man',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/12_Major_Hanged_Man.jpg',
	      keywords: {
	         upright: 'Suspension, restriction, letting go, sacrifice',
	         reversed: 'Martyrdom, indecision, delay'
	      },
	      description: {
	         basic: 'The Hanged Man shows a man suspended, upside-down, from the living World Tree, rooted in the underworld and supporting the heavens. Given the serene expression on his face, it is believed he is hanging on the tree of his own will. His right foot is bound to the tree but his left foot remains free, bent at the knee and tucked in behind his right leg. His arms are bent, with hands held behind his back, forming an inverted triangle. The man is wearing red pants representing human passion and the physical body, a blue coat for knowledge, and yellow shoes representing his high ideals. Around the Hanged Man’s head is a bright yellow halo showing spiritual attainment, with the grey background suggesting invisibility (a good reminder to not flaunt your spirituality). This is the card of ultimate surrender, of being suspended in time and of martyrdom and sacrifice to the greater good. This is the archetype to meditate on to help break old patterns of behaviour and bad habits that restrict you.\n\nThe Hanged Man’s number is 12 – a higher octave of the number 3, representing careful planning and orderly growth leading to spiritual development. 1 (beginning) + 2 (the reasoning force) = 3 (the product of rebirth). The ruling planet is Neptune, the planet of self-sacrifice and idealism.',
	         upright: 'The Hanged Man reflects a need to suspend action, and as a result, a period of indecision may be indicated. Decisions or actions that need to be implemented will be postponed, even if, at the time, there is a sense of urgency to act. In fact, you may be much better off if you can stall on any decision-making and action-taking at this time in order to provide yourself with more time to reflect on the situation at hand and to consider the greater good. If you can buy yourself some more time or hold off on any further activities for a short period, then you may actually create a different, and better, outcome. This is a card that is all about suspension and waiting, and suggests that this may be just what you need to do in order to allow new possibilities to arise. Sometimes not acting will help to shed more light on what other options are available to you and will allow more attractive opportunities to emerge.\n\nThe Hanged Man can sometimes reflect that you are feeling stuck or restricted in your life. You need to get in touch with why you are feeling this way, and work to release yourself from these restrictions. In this way, the Hanged Man is also about letting go. You need an emotional release from whatever it is that is leaving you feeling stuck. Accept and surrender to your present circumstances. You may need to become more vulnerable and open to different experiences but this will help you end the struggle and give up your need for control. It is when you can really let go of all the worries and concerns that you have, that you find these concerns suddenly disappear and a new reality is possible.\n\nThe reversed position of the man in the Hanged Man indicates the need to look at yourself from an entirely different perspective, while the hanging indicates that your life is simply suspended for a time in order for you to recognise what needs to be changed in your personality. The tree is also abundant with leaves and vines, which suggests the possibility that the situation will bear fruit. Thus, the Hanged Man represents a reversal of your usual way of life and seeing the world from a completely different angle. Try hanging upside-down yourself and look around you. Does it not all look so different?! Your perspective has changed completely, yet the physical surroundings are exactly the same as when you were looking at it from an upright position. The Hanged Man asks you to turn your world around and view your situation differently. When you do this, you will find something new that will prove to be of greater value to you on a much deeper level. It may be that you have to sacrifice your previous beliefs or even way of life but it is a time of renewal and your life will go forward.\n\nThe Hanged Man is a willing victim, someone who has chosen the path of sacrifice to accomplish a higher goal. The Hanged Man represents the willingness to forsake the temptations of instant gratification for a higher cause, and because of this willing sacrifice he accomplishes the goals he has in his heart. He is like the ultimate martyr, putting his self-interest aside and giving up his personal needs for the greater good. Consider areas in your own life where you need to act in a more selfless manner, either for the benefit of others or for the fulfilment of your own deeper needs. On the flipside, you may need to assess your life for areas in which you are giving up too much to others at the expense of your own mental and spiritual well-being. Sometimes martyrdom can go too far!\n\nSimilarly, the Hanged Man tells you that you should be willing to lose something lesser in order to fulfil a greater goal. This goal is likely to be spiritual and personal. An investment of time, energy, and/or money may have to be made in order to reach this higher level of attainment. You are devoted to the cause and are open and ready to take on the task in front of you but first you need time to pause and consider',
	         reversed: 'The Hanged Man reversed represents a period when you feel you are sacrificing a lot and getting nothing in return. You may have felt things were at an absolute standstill, with no movement or resolution. It is as though you are suspended in time and unable to make a move forward, backward or even sideways to get out of your current situation. Your own goals and dreams are put on hold because of external realities or internal issues. This is an energy that is passing out of your life and you can now expect things to start happening once again and major changes to occur. This period of suspension is like a catalyst for what is to come.\n\nYou may be putting off making a decision, in the hope that it will all sort itself out eventually. However, this is often just wishful thinking. What is happening is that you are simply stalling the inevitable and you will at some point be pushed to make a final decision and to make a sacrifice in the process. In a reading where a relationship has been put on hold, the Hanged Man reversed suggests that you are happy to wait around, to a point. You realise that this relationship will evolve over time and that, due to its complexities, it cannot be rushed. However, you also do not want to be ‘on hold’ forever and you acknowledge that there will come a time when you must make a decision about your current relationship.\n\nThe Hanged Man reversed suggests a loss of faith in your ability to surmount life’s obstacles. You may be refusing to go within for spiritual nourishment. It is very important at this time to look within through meditation and restore your faith in your ability to get over life’s challenges. Know that this difficult time will soon pass. Accept your circumstances and be at peace with yourself.\n\nAlternatively, you may be preoccupied with yourself and unwilling to make a necessary sacrifice or compromise for the greater good. You may be acting in a selfish or even arrogant manner, and significantly disengaging others who are trying to work cooperatively with you.'
	      }
	   }, {
	      name: 'Death',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/13_Major_Death.jpg',
	      keywords: {
	         upright: 'Endings, beginnings, change, transformation, transition',
	         reversed: 'Resistance to change, unable to move on'
	      },
	      description: {
	         basic: 'The Death card shows Death himself riding on a white horse, holding a black and white flag. Death is portrayed as a skeleton as the skeletal bones are the part of the body that survives death. The armour he is wearing indicates that he is invincible and unconquerable. Indeed, no-one has yet triumphed over death. The horse that Death rides is white, the colour of purity. Death is therefore the ultimate purifier. All things are reborn fresh, new and pure. Notice even the bishop paying homage to him. All sectors of the human race are represented here – men, women and children – showing that Death does not discern between age, race or gender.\n\nThe banner that Death carries has a black background, indicating an absence of light. The white rose, on the other hand, indicates beauty, purification and immortality. In the background of the card, there is a rising sun, a sign of immortality. The sun appears to ‘die’ each night but is reborn fresh and new every morning. The two pillars are guarding the gateway to the sun, symbolising the knowledge needed to gain immortality. The boat on the water in the background is the ferry that transports the souls across the River Styx. The background is a neutral grey, again showing Death’s impartiality.\n\nDeath is ruled by Scorpio (the sign of ‘sex, death and taxes’) and the number is 13, sacred to the Goddess as there are thirteen moons in a year.',
	         upright: 'The Death card is probably the most feared and misunderstood of all the cards in the Tarot deck. Just the mention of the card’s name has people shaking in their boots! In general, people tend to take the meaning of this card far too literally and fear that the indication is for the death of either themselves or others. Relax! The card of Death can be one of the most fruitful and positive cards in the deck.\n\nDeath is symbolic of the ending of a major phase or aspect of your life that may bring about the beginning of something far more valuable and important. You must close one door in order to open another. You need to put the past behind you and part ways, ready to embrace new opportunities and possibilities. It may be difficult to let go of the past at times but you will soon see how important it is so that you can bring renewal and transformation into your life. If you resist these necessary endings, you may experience pain, both emotionally and physically but if you exercise your creative imagination and visualise a new possibility, you allow more constructive patterns to emerge.\n\nSimilarly, Death indicates a time of significant transformation, change and transition. You need to profoundly transform yourself and clear away any of the old in order to bring in the new. Any change at this time should be welcomed as a positive, cleansing, transformative force in your life. The death and clearing away of limiting factors can open the door to a wider, more satisfying experience of life.\n\nThe Death card contains elements of a sudden and unexpected change. You may feel as though you are caught in the path of sweeping change and cannot escape its effects. Though the immediate thought is toward the negative, an end need not mean failure. The loss could be a series of unexpected surprises that bring an end to a period of turmoil or problems. You feel you can no longer go along with the status quo and want things to change radically. Many changes are going to take place to enable a new direction to emerge.\n\nFinally, Death is an indication that you need to learn to let go of unhealthy attachments in your life to pave the way to a fuller, more fulfilled life of deeper meaning and significance. Death teaches you to let go of outworn and outgrown ways of life and move forward. This is a perfect card to use to break a bad habit or pattern of behaviour. This is a time of eliminating excess and cutting out what is not necessary in your life. This may be a good time to purge old belongings, memories and ‘baggage’ that is getting in your way.',
	         reversed: 'Death is a card of transformation and new life, and typically shows a need to start completely over by letting go of the past. Death reversed typically reflects that you are on the verge of major change but for some reason, you are resisting making that change. You may be reluctant to let go of the past or you may not know how to make the change you need. You are still carrying harmful aspects from the past that may interfere with the opportunity you have for a new beginning. You are refusing to accept change and you are resisting any element of change that may arise in your life. As a result, life has stagnated and you are feeling ‘stuck’ in limbo.\n\nAssess the way in which you are approaching change. You may find that you are in fact halting the very change that will be to your benefit. You may fear the new but rest assured the time is right to accept the new. What is important, too, is that you address and resolve whatever issues are blocking your acceptance of change as soon as you can so that you are then free to start your new journey. Pursuing your new journey now, without having resolved the past, may actually lead to unintended outcomes, so best you deal with what is preventing you from changing first.'
	      }
	   }, {
	      name: 'Temperance',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/14_Major_Temperance.jpg',
	      keywords: {
	         upright: 'Balance, moderation, patience, purpose, meaning',
	         reversed: 'Imbalance, excess, lack of long-term vision'
	      },
	      description: {
	         basic: 'On the Temperance card stands a winged angel. The angel is actually a hermaphrodite (the child of Hermes and Aphrodite), showing a balance between the genders. The angel has one foot on dry land, representative of the material world, and one foot in the water, representative of the subconscious. In this position, she also represents the need to ‘test the waters’ before jumping headfirst into unknown circumstances. Here she tempers the whimsical flight of the Fool who jumps without giving a second thought. The triangle inside the square on her robe represents the female being protected by natural law. In her hands she holds two cups which she uses to mix water. The cups represent the sub- and super-conscious minds. One cup can be thought of as holding hot water and the other cold water. The water flowing between them is actually going from the lower cup to the higher one, signifying rising from a lower plane to a higher one. The temperate individual mixes the opposites and finds a balance in life by avoiding extremes. The astrological sign is Sagittarius, the teacher of truth, enthusiasm, tolerance and beauty.',
	         upright: 'Temperance indicates that you are learning to bring about balance, patience and moderation in your life. You have been able to take the middle road, avoiding extremes and maintaining a great sense of calm in your life. You have learned to keep calm in situations of great stress or anxiety, and you give the impression of being a swan, paddling madly underneath the water but appearing so graceful and elegant on the surface. You do not let things get to you, and you have found a place of peace where you can put things into perspective when things get hectic. Your respect for balance and tranquillity is what will help you to achieve and experience fulfilment in your life. Your temperament will be well balanced and you demonstrate good management and balance in your outlook on life.\n\nThe Temperance card reflects that you have a clear, long-term vision of what you want to achieve. You are not rushing things along; rather you are taking your time to ensure that you do the best job you can. This card also reflects a higher learning in what you are doing and demonstrates that you are learning a great deal on your journey. You are at peace with what you are doing and it is all coming together very well. Your inner voice is guiding you gently to the right outcome and you are patiently listening and following. You have a very balanced perspective on the situation at this time and you are in a very good position to make the right choices.\n\nIn relation to others, Temperance represents adaptation, coordination, and tempering external influences. You are able to work in harmony with others and there is a heightened level of co-operation in your activities with others. You are able to combine forces and join with others in order to bring it all together. There is a beautiful synergy at work that leverages the right mix of talents, experiences, abilities and skills.\n\nTemperance asks you to be patient so that you can act with timing and precision. Patience and moderation will result in good management of all things. Do not feel that you need to rush, just let the situation evolve at its natural pace.\n\nTemperance can also reflect a period of self-evaluation in order to re-examine your life priorities. You are now seeking a much greater balance between your inner and outer selves, searching for a higher meaning and purpose in life. Throughout this transition, you may also experience a clash between the old and the new you, sometimes feeling confused about which direction you ought to take and what is really important to you. You will evaluate seclusion, detachment and retreats as methods for accomplishing great things. You will avoid pain, conflict and distractions and lessen your stress and anxiety. Looking inward will re-charge you. There is nothing to fear, it is part of the process and without it change could not occur.',
	         reversed: 'Temperance reversed reflects a time when something is out of balance, in conflict or excessive, and is therefore creating stress and tension in your life. Look to the other cards in the reading to understand what is out of balance or contributing to this feeling. Temperance reversed can also be a lead indicator that, were you to follow a certain path, you would create imbalance in the situation. You may be acting impatiently or refusing to take the moderate, gentle approach. Be wary of hasty action as this will only lead to further imbalance.\n\nTemperance reversed can suggest that you lack a long-term vision and/or purpose and, as a result, you are feeling out of balance. This is a time when you need to reflect on what changes are necessary in your life to create greater purpose and fulfilment. Return to the energy of the Death card to understand what you need to leave behind you in the past and what changes you need to embrace in the future.\n\nPeople you are dealing with are proving to be uncooperative or you may feel as though your interests are in conflict or competition with each other. Getting the ‘flow’ right between you seems an impossible feat. You are both striving to express your individuality in very different ways. There is a lot of energy around now but none of it is being used positively. Unresolved conflicts in both of you have yet to be expressed clearly, indeed you may not be conscious of them, although you are aware that something is wrong. These conflicts may manifest themselves as role reversal. In the beginning one of you was dominant, now the other seeks to take control of the union. An old fashioned argument may be necessary to clear the air and establish new ground rules.'
	      }
	   }, {
	      name: 'The Devil',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/15_Major_Devil.jpg',
	      keywords: {
	         upright: 'Bondage, addiction, sexuality, materialism',
	         reversed: 'Detachment, breaking free, power reclaimed'
	      },
	      description: {
	         basic: 'The card of the Devil portrays a Satyr, a creature that is half man and half goat. In many myths, the goat was considered an unclean and lustful animal. However, the goat also symbolises the scapegoat, the person or thing upon which people project the inferior side of themselves in order to feel better about themselves. Thus the Devil is the scapegoat we blame for our troubles in life.\n\nThe Devil has the wings of a vampire bat, an animal that sucks the life blood out of its prey. This is symbolic of what happens when we give full reign to the realm of our raw desires. We lose our vitality and life energy. The Devil has an almost hypnotic stare, bringing those who come near him within his power. Above him is an inverted pentagram, signifying the darker side of magic and occultism.\n\nAt the foot of the Devil stands a man and a woman, both naked and chained to the podium on which the Devil sits. They appear to be held here, against their will, but only closer observation, the chains around their necks are loose and could be easily removed. This symbolises that bondage to the Devil is ultimately a voluntary matter which consciousness can release. The man and woman wear tiny horns like those of the Satyr – they are becoming more and more like the devil the longer they stay here. Both have tails – a further symbol of their animalistic or lower tendencies.\n\nThe dark and doorless cave implies that the Devil dwells in the most inaccessible realm of the unconscious and only crisis can break through the walls.\n\nThe number 15 in numerology equals 6, the number that corresponds to the Lovers, and here the lovers are shown chained, in bondage to the material, sensual side of their nature. This card is ruled by Capricorn, the goat.',
	         upright: 'The card of the Devil represents the hidden forces of negativity that constrain you and that trick you into thinking you are imprisoned by external forces ultimately out of your control. The Devil is an inner force within each of us. He represents our fears, addictions, and other harmful impulses. He is a master of deception and creates the illusion that you are involuntarily bound to him. However, the figures in this card are free to remove the chains from around their necks, indicating that they have freely given the Devil any power he has over them.\n\nWhen you see the Devil in a reading, ask yourself where you are feeling stuck or restricted in your life. You may be tricked into believing that you are being controlled by external forces when in fact you have created your own chains of imprisonment and powerlessness. A sense of hopelessness can accompany the Devil. You feel despair and have a pessimistic view of life because you feel that so much is outside of your control. You fear the worst, and this means that your fears have a hold over you and prevent you from leading a more fulfilling and optimistic life. What are the addictions or attachments restraining you from experiencing the freedom of the Fool? Are you giving yourself over to the illusion of helplessness and despair? Know that you have the power within to free yourself from the bondage of the Devil.\n\nThe Devil often reflects actual addictions and dependencies in your life, such as alcoholism, drug-taking, unhealthy relationships, over-spending and the like. You think you need something and you are willing to go against what you know to be right and true in order to obtain it. You need to break free of these negative patterns of behaviour by acknowledging the hold that they have over you and the negative impact they are having on your life. Often they are behaviours that are immediately gratifying but which cause longer-term damage to your inner fulfilment.\n\nMore generally, the Devil indicates that you are becoming obsessed and hell-bent on a particular idea, situation or endeavour. You are over-investing yourself in one area at the expense of other areas of your life. Often, the Devil card represents an over-dependence on material wealth. You may have become so fixated on becoming a millionaire or owning a fancy car that you have forgotten the importance of investing in your relationships or yourself. You have generated a belief that value lies in how much you earn or how much you own. You have created an unhealthy bond with these materialistic desires and you are now being controlled by this bondage.',
	         reversed: 'The Devil appears when you are feeling trapped by things such as unhealthy or co-dependent relationships, financial debt, unproductive careers, unhealthy lifestyles or addictions, or consumerism and materialism. When the Devil is reversed, it indicates a growing awareness that you are currently in this state and you desire freedom from these harmful bonds. You may now be more willing and able to accept changes in your life and you may be more open to taking on new perspectives. However, it is not going to be an easy journey. You will need to battle your inner fears and anxieties to free yourself from the chains that bind you to your unhealthy habits. You need to conduct an audit of your life and eliminate those things that you know are harmful to you and your inner psyche. It may be about creating a healthier diet, watching less television, quitting smoking, spending more time with your loved ones, or focusing more clearly on your goals. Take this opportunity to bring about positive change in your life by providing yourself with ongoing encouragement and motivation. You must remain faithful to your goal of freedom.\n\nIf you have not yet succumbed to bad habits or addictions, be cautious about opening yourself up to these temptations in the future. Look out for anything that might put you in debt or under the control of another person who may not have the best of intentions. Avoid anything that might harm your body physically, such as alcohol, drugs, or any other addictions because these will prove to be very difficult to shake off later. You may believe they are only a temporary and harmless release from your personal issues but they may turn into a significant problem that could cause you a lot of grief in the long-term.\n\nThe Devil reversed may also refer to the Buddhist principle of detachment. Detachment, also expressed as non-attachment, is a state in which you overcome your attachment to the desire for things, people or concepts of the world, thus attaining a heightened perspective. The detached person is the happiest, for to live without attachment is to live in true freedom. It is important to note, however, that the Buddhist principle of detachment does not mean that you no longer care for things or people but rather that you separate your own existence from them in such a way that means you can still care about them but that you are not dictated or defined by their existence.'
	      }
	   }, {
	      name: 'The Tower',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/16_Major_Tower.jpg',
	      keywords: {
	         upright: 'Disaster, upheaval, sudden change, revelation',
	         reversed: 'Avoidance of disaster, fear of change'
	      },
	      description: {
	         basic: 'The Tower shows a tall tower pitched atop a craggy mountain. Lightning strikes and flames burst from the building’s windows. People are seen to be leaping from the tower in desperation, wanting to flee such destruction and turmoil. The Tower signifies darkness and destruction on a physical scale, as opposed to a spiritual scale. The Tower itself represents ambitions built on false premises. The lightning bolt breaks down existing forms in order to make room for new ones. It represents a sudden, momentary glimpse of truth, a flash of inspiration that breaks down structures of ignorance and false reasoning. Notice the lightning bolt is oriented left to right (from the perspective of the card), from heaven to earth, and from Spirit to material. The falling figures correspond to the chained prisoners in the Devil card. They fall headfirst, because the sudden influx of spiritual consciousness represented by the lightning flash completely upsets all our old notions about the relations between subconsciousness and self-consciousness. The flames are actually the Hebrew yods. There are 22 flames, representing the 22 Major Arcana. The gray clouds are the clouds of misfortune that rain on everyone indiscriminately. The ruling planet of this card is Mars.',
	         upright: 'How many times have you sat safely within the narrow confines of your life, comfortable in your current thoughts, beliefs and expectations? Then, out of the blue, something ‘shocking’ happens that completely destroys your picture of peace and harmony. It blows your mind or throws you for a loop. There is a sudden realisation that your comfort was based on an inadequate foundation of false thought, belief and action. This is a humbling, frightening but necessary experience.\n\nWhen you see the Tower in a reading, you may feel afraid, shaken and insecure. It is a time of great turmoil and destruction as you seek to understand how you could have been so wrong, so naive, or so blind about a particularly situation. And now, what will you do and how will you manage in the face of this shocking truth? You may be experiencing sleepless nights, depression, grief, anger and confrontation. These are normal reactions to major changes in your outer and inner worlds.\n\nA Tower experience is any experience that shakes the foundation of your current sense of security and/or forces you to question your strongly-held beliefs, perceptions, attitudes and behaviours. It may be a divorce, death of a loved one, financial failure, health problems or job loss, or any event that penetrates to the core of your inner being, affecting you spiritually, mentally and physically. It is often descriptive of a major upheaval, disruption, emergency or crisis, and is likely to bring chaos in the aftermath of such an event.\n\nIf the Tower appears in your reading, ask yourself, “What structures in my life are breaking up?” No doubt you will already be very aware of where there is turmoil and destruction but sometimes it can be on a more subtle or subconscious level.\n\nThe most important aspect of the Tower is that with any destruction there comes creation. Thus, the Tower card represents an awakening and is about inspiration, freedom, reality and the release from bondage. It is a truth and honesty card that comes as a bolt of lightning to you through a shocking and impactful life event. It represents a necessary experience that forces you to get out of your comfort zone and to grow beyond your present level. The sudden destruction of the Tower represents the immediacy of change, and the often disorienting effects of that change. Once you hit rock bottom the choice is yours. You can revert to the self-defeating, restrictive Devil, or reach for the transformational and inspirational Star. When you begin to reach for the Star, you will come to realise that your true security and strength lies within yourself and your relationship with the Universe, and not in some false belief system or artificially-created world. Following a Tower experience, you can rest assured that you will grow stronger, wiser and more serene as you begin to develop a completely new perspective on life that you did not even know existed. These moments in time are necessary for spiritual growth and enlightenment. Truth and honesty will bring about a positive change, even if you must experience pain and anxiety throughout the process.\n\nThe Tower also represents the inner and outer structures that you have built. These structures represent your personal defences, defences that create a more socially acceptable ‘you’ by hiding your true, inner thoughts and feelings. It is like laughing politely when your boss tells a joke, or, on a deeper level, disguising your sexual feelings, particularly if you feel that they are socially inappropriate. In times of great pressure and stress, these structures will be tested and are at risk of shattering, finally revealing your true inner self to those around you. So, you need to be very careful how much of yourself you attempt to hide, knowing that one day, all will be revealed.\n\nThe Tower therefore asks you to break down the structures that you have surrounded yourself with. This can be a painful and difficult process if you resist against the external forces that are pushing you to reveal more of yourself. Breaking through this pretence can cause a great deal of anguish but remember that the Tower will fall, whether you like it or not, because you have reached your limits in this area and can no longer live with it.\n\nSimilarly, the Tower can signify your ego and the illusion of considering yourself to be superior to others. When the Tower of ego, deception and illusion is destroyed, you are free to face truth and reality without the trappings of false attachments. Are you undergoing a major shift in consciousness? Are you beginning to see things in a new way? Embrace the opportunity to accept change and move forward into a more positive psychological state, where personal freedom is the rule.',
	         reversed: 'Upright, the Tower indicates a time of great turmoil and destruction, which will eventually bring with it change and regeneration. Reversed, however, the Tower card indicates that you are simply delaying the necessary ‘destruction’. You need to go through this difficult time in order to learn an important lesson. Do not resist it. Even though it is shocking and hard to deal with, it is a very important part of your life journey.\n\nSimilarly, the Tower reversed suggests that, while you consciously want change and transformation, you seem to be afraid of these two things. You may feel that change and transformation may bring with it destruction and pain, and thus you are resisting this. You may be aware that in order to create the BIG change you are seeking, you need to go through a period of significant discomfort but you seem to be afraid of this discomfort. Now is the time to think BIG and to not be afraid of taking BIG leaps ahead of you. Sure, the stakes are high and it is risky territory but if you really want to achieve the scale of change you aspire to, then you need to take some risk.\n\nThe reversal of the Tower can also lessen the degree or impact of change that is about to enter your life. You may be forewarned or you may have an intuitive sense that something major is about to happen, and you can therefore plan in advance and avoid the destruction that lies ahead. You may be lucky enough to narrowly avert disaster.'
	      }
	   }, {
	      name: 'The Star',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/17_Major_Star.jpg',
	      keywords: {
	         upright: 'Hope, spirituality, renewal, inspiration, serenity',
	         reversed: 'Lack of faith, despair, discouragement'
	      },
	      description: {
	         basic: 'The Star card shows a naked woman kneeling at the edge of a small pool. The woman holds two containers of water. She pours the water out to nourish the earth and to continue the cycle of fertility, represented by the lush greenery around her. The other container pours the water onto dry land in five rivulets, representing the five senses. The woman has one foot on the ground, representing her practical abilities and good common sense, and the other foot in the water, representing her intuition and inner resources, and listening to her inner voice. Behind her, shines one large star and seven smaller stars, representing your chakras. This represents a need to open your chakras and cleanse your aura. Notice all the stars have eight points. The Star is associated with the number 17, which equals 8 (1+7=8). Eight is Strength, the quality needed to accept your faults and love yourself in spite of them. The bird in the tree in the background is the sacred ibis of thought, roosting in the tree of the mind. The astrological sign of the Star is Aquarius.',
	         upright: 'The Star Tarot card brings renewed hope and faith and a sense that you are truly blessed by the Universe at this time. Courage, fulfilment, and inspiration are in your life. You are entering a loving phase in your life, filled with calm energy, mental stability and deeper understanding of both yourself and others around you. This card is saying to you that, over the long-term, you should have faith and trust in the Universe. A better future is waiting for you but in order to reach it you must trust that it is indeed possible.\n\nAs it follows the Tower, the meaning of the Star Tarot card suggests that you have endured life’s challenges and have been through a difficult time but you are now open to healing and transformation. Your ability to let go of damaging memories has been strengthened by contact with your true self through these difficult times. Hatred, envy, bitterness, and revenge have burned themselves out and no longer shadow your life or get in the way of your potential for future happiness. You are now also able to forgive and forget so that you can embrace new opportunities.\n\nThe Star card is therefore an important card for personal transformation. When the Star appears in a Tarot reading, be open to new ideas and growth. Listen to the still small voice within. You have a strong desire now to find or rediscover a sense of meaning, inspiration, or purpose in your life. You are making some significant changes in your life, transforming yourself from the old you to the new you, and in doing this you are bringing about a fresh perspective on life. You may also be feeling that you are finally honouring the person who you truly are or want to be, rather than simply following a routine that has little meaning to you. There is a deeper spiritual journey that you are going through which is all about bringing greater meaning and purpose into your life and renewing your inner energy. You hope your future will be better than your past. This card is the call of destiny that motivates you or compels you to go on. Your desire is not in vain as you will ultimately find what you are yearning for.\n\nIn a Tarot reading, the Star brings renewed self-esteem and increased trust in yourself. You will become aware of how successful and respected you are. You may attain a goal that brings lasting happiness and your reputation may be enhanced. The Star Tarot card is particularly encouraging when you have come through a period of opposition, negative feedback or setbacks that have previously damaged your self-esteem. The Star encourages you to have faith in yourself and to believe in yourself.\n\nThe Star Tarot card also indicates a generous spirit. You want to give or share your wealth with others to help transform their own lives. You have an open heart and you now want to give back the blessings you have already received so that others may benefit.',
	         reversed: 'When the Star is reversed, it suggests that your spiritual mission is distorted. Instead of hope, you are feeling despair or discouragement. Instead of being filled with positive possibilities, you find yourself dwelling on negative issues. Negative thoughts will wear away at you to the point where you may give up control of the situation and concede defeat. To remedy this, the reversed Star suggests you identify what is making you feel discouraged or overwhelmed and work on moving past these issues. They can take on an importance far greater than they deserve and can hold you back.\n\nIn a Tarot reading, the reversed Star card also indicates that you are beginning to feel disengaged and uninspired with life or components of your life (for example, work, hobbies, relationships, personal projects, etc.). Perhaps you started out with great vision and enthusiasm but you are now finding yourself overwhelmed by day-to-day routines that are boring and dreary. You may find life a chore now, when it used to be such a pleasant experience. This Tarot card is particularly relevant for career readings, when you are feeling that you are no longer connected to the work you do and you feel that you need to move on or make a significant change to your career.\n\nThe Star reversed may reflect a loss of faith in a particular situation, resulting in you waiting for a sign or a ‘calling’ to proceed further. You may need reassurance that you are still on the right path, particularly if you have been experiencing setbacks or challenges along the journey. Remember the advice of the Tower, which is to see these setbacks as opportunities to change and grow. Know that even if you are feeling uncertain or fatalistic about whether you will ever achieve your goal, this is just a momentary setback and you will soon see that it was an important part of your journey forward. Oftentimes, the reversed Star card is more about a test of faith than it is an indication of a negative outcome. Sometimes you need to go through an incredibly trying time in order to come to a point of personal transformation and awakening. You need to keep believing in the Universe and know that it will do what is best for all. This is a test of your faith and you will no doubt come out of this a stronger person.'
	      }
	   }, {
	      name: 'The Moon',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/18_Major_Moon.jpg',
	      keywords: {
	         upright: 'Illusion, fear, anxiety, insecurity, subconscious',
	         reversed: 'Release of fear, unhappiness, confusion'
	      },
	      description: {
	         basic: 'The Moon is the card of intuition, dreams and the unconscious. The Moon provides light as a reflection of the Sun, yet this light is dim, uncertain, and only vaguely illuminates our path as we journey toward higher consciousness. The pool at the base of the card represents the subconscious mind and the crayfish that crawls out of the pool symbolises the early stages of consciousness unfolding. This creature also represents the often disturbing images that appear from our inner depths, just as the dog and wolf at the beginning of the path represent the tamed and the wild aspects of our minds. The path leads between two towers into the mountains in the distance, showing the way to the unconsciousness. The astrological sign associated with this card is Pisces – psychic, receptive and mysterious.',
	         upright: 'The Moon often represents your ‘shadow’ self. The shadow is a psychological term introduced by the late Swiss psychiatrist Dr. Carl G. Jung, and is a part of the unconscious mind consisting of repressed weaknesses, shortcomings and instincts. “Everyone carries a shadow,” Jung wrote, “and the less it is embodied in the individual’s conscious life, the blacker and denser it is”. According to Jung, the shadow, in being instinctive and irrational, is prone to projection, turning a personal inferiority into a perceived moral deficiency in someone else. Thus the Moon calls your attention to your shadow, becoming consciously aware of any tendencies to project fear and anxiety onto your external surroundings, and turning it around into more positive and constructive energy.\n\nThe Moon is a psychological card of projecting fear into your present and your future, based on past experiences. The images, thoughts and feelings that you have repressed over time cause inner disturbances that are becoming overwhelming. As a result, you are now experiencing negative blocks within your personality, causing fear and anxiety. To remedy this, you need to go through a purging process whereby deep memories are released. This is a time when you need to go deep into your soul and dredge up your anxieties, fears, psychic blocks and personality disturbances. Many invisible things are coming to the surface including secret motives, clandestine information and ancient hidden truths. These newly discovered resources may confuse you but once they are brought to your awareness, they will no longer haunt you.\n\nThe Moon is a card of illusion and deception, and therefore often suggests a time when something is not as it appears to be. Vigilance and clear perception will be necessary to find that which is hidden before it is too late. If other cards in the reading are negative, then the Moon shows that not all is as wonderful as you would think and there are still hidden forces at play that may unravel your success. You may be idealising the situation, and ignoring the fact that potential for failure exists among success. If the other cards are generally positive, then the Moon suggests that you are letting your imagination run away with you, and that things are not nearly as bad as they seem. In both cases you must open your eyes and see what it really going on. Guard against accepting illusions as they may cause an error in your judgement.\n\nOftentimes, the Moon appears in a reading when you are not sure of your destination, or even of the path you are travelling but you travel nonetheless. You may have lost your way and are now left to walk in the dark, guided only by your inner light and intuition. You need to go on without a clear picture of where you are, where you are going or where you have been. The Moon is a card of intuition and psychic forces, so let go of your conscious mental blocks or negative self-talk, and allow your intuition to guide you. Your dreams, intuitions, and inner promptings lead you forward toward higher levels of understanding if you listen carefully and use your judgement to help interpret the veiled messages of the unconscious. Not only will the way forward be revealed but in many cases you will learn lessons about yourself that will be valuable in later journeys.',
	         reversed: 'The Moon reversed indicates that you have recently experienced a time of self-deception, illusion, fears and anxiety but these negative energies are beginning to subside. You may have also been dealing with some deeper emotional issues that have previously been sitting beneath the surface. While this has created some discomfort and turmoil as you deal with these deeper issues, you are starting to feel as if a weight has been lifted and that you can be less fearful and anxious about your life situation. You are beginning to work through your inner fears and anxieties, understanding the impact that these have on your life and how you can eventually free yourself from these limiting beliefs. This can be a wonderfully liberating and transformational experience.\n\nA reversed Moon may indicate a fundamental unhappiness with your present situation but also confusion over what else you could do and what you really want to do. It may be that you believe that what you really want to do with your life is impractical or unrealistic, or your past experiences in life have convinced you that you are stuck with what you have and it is too late to change now. These emotional issues are preventing you from moving forward. To overcome this, it is essential to confront your innermost fears and assumptions to gain self-confidence and direction. You need to believe in yourself and know that it is possible to create balance in your life. You may also find that your dreams provide you with important clues as to what direction you need to take. Pay attention to the subtle, subconscious messages that come to you in this way.\n\nThe Moon reversed can highlight that you are in a more psychic and intuitive phase than usual, however the feelings that you are getting may be confusing and easily misinterpreted. It may be that when you draw Tarot cards for yourself and come up with one interpretation, you then draw them again, only to see something completely different! Nonetheless, do not ignore the messages you are getting. Take note of them and perhaps come back to them later when you are feeling clearer about your situation.'
	      }
	   }, {
	      name: 'The Sun',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/19_Major_Sun.jpg',
	      keywords: {
	         upright: 'Fun, warmth, success, positivity, vitality',
	         reversed: 'Temporary depression, lack of success'
	      },
	      description: {
	         basic: 'The Sun is an image of optimism and fulfilment, the dawn that follows the darkest night. As the source of all life on earth, the Sun represents the source of life itself. The child playing joyfully in the foreground represents the happiness of our inner spirit when we are in tune with our truest Self. He is naked, having nothing to hide. He has all the innocence and purity of childhood. The white horse upon which the child rides represents strength and purity of spirit. The horse is without a saddle and is controlled without the use of the hands. This is a symbol of perfect control between the conscious and subconscious. The child holds an orange banner in his left hand, showing that control has passed from the conscious to the subconscious. The orange banner represents action and vibration, and the rays of the sun represent the same thing. The straight rays are action while the wavy rays represent vibration. The sunflowers in the background represent life and the fruitfulness of the spirit under the nourishment of the Sun. There are four sunflowers, representing the four suits of the Minor Arcana, as well as the four elements. The astrological correspondence to this card is the Sun, of course.',
	         upright: 'The Sun represents success, radiance and abundance. The Sun gives you strength and tells you that no matter where you go or what you do, your positive and radiant energy will follow you and will bring you happiness and joy. People are drawn to you because you can always see the bright side and you bring such warmth into other people’s lives. This beautiful, warm energy is what will get you through the tough times and will help you succeed. You are also in a position where you can share your highest qualities and achievements with others. Radiate who you are and what you stand for. Shine love on those you care about.\n\nYou have an innate sense of confidence right now. Life is good, the sun is shining and you are on your way to achieving your goals. The Sun represents that feeling of getting up on Saturday morning, with the whole weekend ahead of you, and you open the curtains with the sun shining on your face. Having struggled through the shadow sides you now know yourself and know where you are heading, and the sun illuminates your path.\n\nThe Sun is a ‘yes’ to life! It brings with it luck, wellness, positive consciousness, enthusiasm, attainment and success. It is about embracing your destiny and giving it everything you have got. If you have been having a difficult time, the Sun brings you the message you have been waiting for – that things are going to get better – a lot better! You know that the rain clouds will soon give way to the rays of the sun and you will feel warmed to the soul once again. The Sun is also an energetic card. It reflects a time when you can expect to experience an increase in physical energy, vitality and general positivity. You are bursting with enthusiasm, feeling invigorated and enjoying a wonderful sense of good health.\n\nThe Sun reflects the value of simplicity. No elaborate scheming is required but instead, plain and simple is the best option. Experience the freedom and liberation associated with living the simple life and doing what you enjoy most. Get back to the simple pleasures such as spending time with loved ones, getting back to nature, or simply reading a book in your garden! Expect a boost in the right direction and trust that work can and will be done, with relative little effort.\n\nThis is a time when you will feel enlightened. You can finally see the path ahead of you and through the hardship you have endured, you have attained a new level of insight and understanding. You may have even had a personal or intellectual breakthrough where you have finally unlocked the key to your fundamental ‘being’.\n\nOn a very literal level, the Sun can indicate travel to a warm or tropical climate where you can finally bask in the sun and enjoy the warm rays!',
	         reversed: 'The Sun reversed indicates that finding the positive aspects to a particular situation may prove to be difficult. The clouds may be blocking out the warmth, and preventing you from feeling as though everything is on track. You may have experienced setbacks that have damaged your enthusiasm and optimism and have perhaps led you to question whether you can really achieve what you have set out to achieve. You may be feeling depressed, sad or left out. You may be reluctant to proceed and you are no longer enjoying what you are doing. Your direction and path ahead may have become clouded or distorted in some way. Nonetheless, the Sun is never a negative card, so this is only temporary. The obstacles you see can be easily removed if you put your mind to it. It may just take a little more effort than usual.\n\nOn the other hand, you may be being too positive. That is, your perception of a particular situation is overly optimistic and unrealistic. You do not have a good sense of yourself and what you are and are not capable of. You may have become egotistical and out of touch with whom you really are. You may not be being truthful to yourself and to others, instead trying to talk yourself up when you know you cannot deliver. If this feels like you, then ask others for feedback and to give you a ‘reality check’. Are you being unrealistic? Is what you have set out to achieve actually achievable? Are you really as good as you think you are?'
	      }
	   }, {
	      name: 'Judgement',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/20_Major_Judgement.jpg',
	      keywords: {
	         upright: 'Judgement, rebirth, inner calling, absolution',
	         reversed: 'Self-doubt, refusal of self-examination'
	      },
	      description: {
	         basic: 'The Judgement card shows a number of naked men, women and children rising up from their graves, arms outspread and responding to the trumpet call of the archangel, Gabriel, who hovers high above them. The people are appealing to the angel, ready to be judged by the power of the Universe. In the background, there are huge mountains, or even tidal waves, which signify insurmountable obstacles and the impossibility of avoiding judgment. The ocean represents the end of the river that flows through the Major Arcana, starting with the Empress. Gabriel’s banner is red on white, the same as the Magician’s clothing. As with everything in life, the beginning is woven irrevocably into the end and the end eventually leads to a new beginning. The planetary ruler of this card is Pluto, the ruler of the underworld.',
	         upright: 'The Judgement card calls for a period of reflection and self-evaluation. Through meditation or quiet reflection, you may come to a point of deep understanding about the common themes throughout your life and what you can do or change to avoid these situations in the future. Judgement tells you that you are close to reaching a significant stage in your own journey.\n\nThe Judgement card suggests that you have had a recent epiphany or an ‘awakening’ where you have come to a realisation that you need to live your life in a different way and you need to be true to yourself and your needs. You have opened yourself up to a new possibility – to lead a fulfilling life that serves your higher needs and that offers inspiration and hope to others. You feel as though you have had a ‘calling’ in life, and you are getting much closer to the point where you need to take action. Something that was lying dormant within you, some unconscious knowledge or truth is finally being awakened and brought into the light.\n\nWith its theme of awakening to new life, the Judgement card suggests that you have reviewed and evaluated your past experiences and have learned from them. All the pieces of the puzzle of your life are finally coming together to form one, integrated picture of your life story. This integration has healed any deep wounds and you are now in a position to put the past behind you. Your memories no longer haunt you, and you are able to understand and value what has happened to you and what it has taught you about life. Now, you are ready to confront any unfinished business in your life, clear up any misunderstandings and view the future with peace and deep ‘knowingness’ in your heart.\n\nJudgement is about finding absolution. Through a period of self-evaluation, you will feel cleansed of your ‘sins’, wrongdoings and mistakes, and you will finally be released of your guilt and sorrow about the past. This represents a wonderful purging process and will leave you feeling refreshed and ready to take on any new challenges.\n\nThe Judgement card often indicates that life-changing decisions are required but unlike those associated with the logical Justice card, these decisions require a delicate blend of intuition and intellect. You may be at a crossroads, aware that any decision that you make will bring about significant change. The choice can be an obvious one, or perhaps the only viable one. You know that this choice must be made and you are facing it with maturity and level-headedness. Your own judgement is impeccable at this time; you can trust it completely and know that you are on the right path. If you still require clarity on the situation, look to your past experiences and life lessons which will guide you on the right path.\n\nIf you have endured challenges in recent times, then the Judgement card suggests that you may have some respite from these challenges. In fact, you may find comfort in sharing your experiences with others and healing within a group environment. The key here is that there will be others who have experienced something similar to you and who can show you the way to freedom from your troubles. Let them guide you and help you.',
	         reversed: 'Reversed, the Judgement card suggests that you may be indulging yourself in doubt and self-judgement. Your deliberation is causing you to miss the new opportunities that await. A certain amount of momentum has accumulated behind what you have achieved, which could propel you further. If actions are taken now, such momentum will not be lost. Therefore now is not the time for being cautious or introverted, rather it is time to move onwards with confidence and pride.\n\nOn the other hand, the Judgement card asks you to take a moment out of your usual routine and busy lifestyle to stop and think about your life so far and what you can learn from your life. In its reversed position, it may indicate that you are not allowing yourself sufficient time and space to really get to the heart of the matter and draw from your lessons of the past. Additionally, this card suggests that you may be overly hard or critical of yourself and not allowing yourself to truly learn from your mistakes. You may have made some mistakes in the past but see these as learning experiences rather than failures or faults.\n\nJudgment reversed serves as a reminder that in every decision that you face, you have at least some element of control. While you may not be able to control the initial events that happen to you, it is important to remember that what is within your control is how you react to these events, and what you create and build out of them. So, while you may be feeling as though you are at the mercy of other people’s judgement, remember that you, too, can choose your own destiny and respond in a way that serves your own higher needs. This is an important time for you to make your own decisions, based on your own judgement of the situation. Do not let others push you around or dictate what should happen to you!\n\nYou may be experiencing unhappiness, isolation and difficulties in overcoming obstacles. You may be forced to deal with the consequences of your past decisions in order to learn valuable lessons from them. You may also find that you are fearful about making important decisions. Change is inevitable. If you are unwilling to accept changes, stagnation will replace growth. Unwanted changes could make you feel out of control and helpless. Perhaps you are reluctant to let go of a relationship, job, or circumstance that is no longer working for you.'
	      }
	   }, {
	      name: 'The World',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/21_Major_World.jpg',
	      keywords: {
	         upright: 'Completion, integration, accomplishment, travel',
	         reversed: 'Lack of completion, lack of closure'
	      },
	      description: {
	         basic: 'In the center of the World is a dancing figure, rejoicing in the completion of the journey and celebrating not only this completion but also the new beginnings it promises. The dancer has one leg crossed over the other, just like the Hanged man. She is, in a sense, his opposite (i.e. the Hanged Man upright). As the Hanged Man looks infinitely inward, the dancer in the World card looks infinitely outward. In each of her hands she holds a wand or baton, representative of evolution and balance. She is surrounded by a thick, green wreath, symbolic of success, victory, achievement and accomplishment, and tied with the red ribbons of eternity. The red ribbons form the infinity symbol, representing the infinite rewards of positive effort in improving both ourselves and those around us. Within the laurel wreath are stars of light indicating attainment of enlightenment or cosmic consciousness.\n\nThe figures in each of the four corners of the World card are the same figures that appear on the Wheel of Fortune. Interestingly, the World card is very much associated with the Wheel of Fortune, reflecting the cyclical progression of time and the human experience. The four figures (a lion, bull, cherub and eagle) represent the four fixed signs of the zodiac – Leo, Taurus, Aquarius and Scorpio. These are symbolic of the four elements, four suits of the Tarot, four compass points, four seasons, and the four corners of the universe. And all are within the dancer’s sight and power. The planetary ruler is Saturn, the symbol of time.',
	         upright: 'The World signifies completion, achievement and fulfilment. All of your efforts are finally paying off and you have reached the end of a journey or have completed a major life cycle. You have endured hardships and challenges along the way but these have only made you stronger and significantly wiser and more experienced than when you first started on your journey.\n\nA long-term project, period of study, relationship, or career has come full circle and you are now feeling a sense of closure as well as achievement and accomplishment. It could represent a graduation, a marriage, the birth of a child (representing the end of a pregnancy), or the attainment of a long held dream or aspiration. You have finally accomplished your goal or purpose. Everything has come together, and you are in the right place, doing the right thing, achieving what you have envisioned, and feeling fulfilled and complete. In this sense, the World card also heralds new beginnings that naturally emerge out of the completion cycle.\n\nThere will also be well-earned praise, celebration and success for your achievements, and if there is not, then you had better organise something because you have worked incredibly hard to get here! All of your hard work, devotion, and planning has finally paid off and it is well worth celebrating!If you have not quite reached this point of completion, you are very close! You need to attain a degree of understanding that enables you to graduate to a higher level and enjoy real success. This rare time of culmination must be identified and honoured. Look at the past month / six months / year and think about how far you have come and what you have achieved. You may be quite surprised at your progress and how much you have worked towards completing the cycle of success. You may also see the projects you are currently working on have even better results than expected.\n\nThe World also represents a period where you can see the entire process or system for what it is and you understand your place within that system. This card is about a deeper understanding of your role and your impact within a certain environment and where you truly ‘fit’. This card can also point to a strong feeling of unity and wholeness with the world or in a particular situation. Everything is starting to fall into place and you can be ‘one’ with the situation.\n\nYou will be more involved in your community or interests. You have a strong desire to contribute, to ‘give back’, or to use a special gift or talent to help make the world a better place. You are coming from a good place now of love, knowledge and experience and you are ready to share this with others.\n\nFrom a more literal perspective, the World can indicate world travel, particularly on a large scale. You may be lucky enough to be embarking on a six month overseas trip, or are working/studying/living overseas for an extended period of time. Similarly, this card reinforces universal understanding and global awareness. Wherever you will go, you will encounter new experiences and welcoming hosts who will embrace you and invite you into their worlds.',
	         reversed: 'Upright, the World represents completion. When reversed, however, the World suggests that you are trying to achieve completion in your life but you may not be taking all the steps necessary to achieve your goals. There is a tendency to take the easiest or quickest path to attain your goal but often this does not lead to the outcome you had originally intended. Instead, through facing up to the challenges along the way, you will learn and grow exponentially and will feel such an amazing sense of achievement when you finally make it to your goal. So, do not be afraid to set yourself ‘stretch’ goals, even if it means enduring hardships or challenges along the way. This will make victory even sweeter.\n\nThe reversed World can also indicate a time when you are close to reaching completion but for whatever reason, you lose focus and slack off right at the end. You only have a short way to go, so why lose focus now? Re-energise yourself and remind yourself how wonderful life will be when you have finally reached your goal.\n\nYou may also be experiencing a lack of closure in your life, preventing you from embarking on the next journey or challenge. I often see this reversed card when a relationship suddenly comes to an end without explanation. The partner cannot make sense of what has happened and is struggling to come to terms with the end of the relationship. Things are left unsaid and people are left hanging, not knowing what to expect or where they stand. If you see the reversed World in a reading, look to the other cards in the reading to identify what needs closure and how you can finally reach your point of completion.\n\nSometimes, the reversed World can indicate that desired change will be delayed and that more time and energy must be devoted to your project or life transition before you can experience the promised completion. This may feel very frustrating but patience and perseverance will pay off in the end. You may feel stifled, even trapped but do not give up. Keep on a steady course for now.'
	      }
	   }, {
	      name: 'Ace Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/22_Wands01.jpg',
	      keywords: {
	         upright: 'Inspiration, power, creation, beginnings, potential',
	         reversed: 'Delays, lack of motivation, weighed down'
	      },
	      description: {
	         basic: 'In the Ace of Wands, a hand reaches out from a cloud, as if a spiritual opportunity or offering is being made, to grasp a wand that is still flowering, growing and developing. The leaves floating down with the wind signify material and spiritual progress and balance. In the distance on the left, there is a castle that represents the promise of what opportunities may come.',
	         upright: 'The Ace of Wands is a sign to just ‘go for it’. This highly action-oriented card sees you feeling incredibly inspired and enthusiastic about pursuing a new idea or project that you have in mind. You are all revved up and raring to go. Use your creative energy and passion to take the first steps and get this project underway. Even if you like to have everything planned out before you begin down a certain path, the Ace of Wands is encouraging you to listen to your instincts and follow your gut. If it feels like a good idea, it probably is. So, start with a few basic actions to get things underway, and then continue to grow and develop your ideas through more complex actions later on. The important thing is that you act now, rather than spending more time planning or researching.\n\nThe Ace of Wands is also indicative of a time in your life where you have a ‘breakthrough moment’ and feel very inspired and motivated about a particular idea or passion. Your eyes have been opened to a whole new world and you are now very excited about the possibilities and the opportunities that are available to you.\n\nYou are showing huge potential at this time and are driven by a strong, creative force. It is as if there is a latent talent within that is just bursting to get out and be fully utilised. This is also a perfect time to draw upon your imagination and to make your dreams reality.\n\nSomething to keep in mind with the Ace of Wands, and any Ace for that matter, is that it is but a seed that is yet to grow into something more solid or sustainable. You are being offered an opportunity here that shows great promise but it will be up to you to make the most of it and to maximise the potential for the longer-term. It is almost like the spark that is needed to fuel a huge fire but you must work hard to build the fire up as the spark itself is not enough to make such a large fire.\n\nThe energy of the Ace of Wands can also signify a restlessness or uncertainty as to how to proceed. You may have energy and passion but not yet have a clear outlet for its expression. All of these wonderful ideas are beginning to build up from within and you are just bursting with energy but now you must find a way to effectively express this energy in a way that will set you up in the longer-term.',
	         reversed: 'The reversed Ace of Wands suggests that you are finding it difficult to clearly define what it is that you want. This lack of direction may be sapping your energy levels and leaving you feeling incredibly unmotivated and uninspired. As a result, you are often asking yourself if this is what you really want in life and whether there would be something better elsewhere. However, when you think about what other opportunities might appeal, you may struggle to really know what you want. To remedy this, you need to first focus on where your true passions lie. There is no point working towards a goal if you are not motivated or excited about reaching that goal. So, take some time to contemplate what it is you really aspire to and what you want to achieve out of this situation.\n\nThe Ace of Wands reversed can also indicate that you are weighed down by existing responsibilities and commitments and therefore cannot pursue the new ideas that you have. You need to revisit the Ten of Wands and release yourself of some of those burdensome responsibilities so that you can free up your time to pursue your newfound passions. Alternatively, you may take a break from your usual routine in order to allow your new ideas to flourish and grow.\n\nThe reversed Ace of Wands can indicate frustrating delays are getting in the way of you being able to progress with your projects and ideas. You are likely to feel very impatient at this time, particularly if you are highly action-oriented and you have just started to gain momentum in your activities. You might also be in a position where you have an amazing idea but you have not yet found the right outlet for that idea. Again, you are beginning to become increasingly impatient that you have not been able to manifest that idea just yet but perhaps that is for the best. Timing is essential, so be patient and wait for the best opportunity.'
	      }
	   }, {
	      name: 'Two Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/23_Wands02.jpg',
	      keywords: {
	         upright: 'Future planning, progress, decisions, discovery',
	         reversed: 'Fear of unknown, lack of planning'
	      },
	      description: {
	         basic: 'The man in the Two of Wands is holding a small globe and stands on the roof of a castle, looking out over a vast terrain to the right and an ocean to the left. The globe in his hands represents that the world is his oyster and there is huge potential if he can expand his horizons to encompass broader life experiences. He understands his ambition and knows what must be done. He is wearing an orange tunic, which symbolises an enthusiastic approach to life, and a red hat, symbolising a passion for adventure.',
	         upright: 'The Two of Wands takes the spark of inspiration from the Ace of Wands and matures it into an actual path forward. Thus, the Two of Wands is all about planning and progressing. You have been able to take your idea and turn it into a feasible plan that you know will lead to your success. It is no longer just an idea but you now have a plan in place to ensure that your idea is carried out as you had intended.\n\nThe Two of Wands is also about discovery, particularly as you step outside of your comfort zone and explore new worlds and new experiences. It may take some courage to take the first step but this card gives you the confidence of self-knowledge. You know what your goal is, what your creative process is directing for you, and you are confident in its eventual fulfilment.\n\nThe Two of Wands indicates that you will begin to consider your longer-term goals and aspirations and will plan ahead for what you need to do to achieve these goals. You have already come so far but now you feel it is ready for a change, this time with your long-term future in mind. You may be considering overseas travel, further education or a major career change at this point in order to expand your learning and development, and to grow your horizons beyond your immediate environment. With careful planning, and a moderated approach, you will set yourself up for success in the future.\n\nThe Twos in Tarot often represent decisions of some sort. In the case of the Two of Wands, you are making a decision between sticking with what you know, or expanding your horizons and taking a risk. You know that the world has to offer you something ‘bigger’ or more meaningful, yet you are also aware that in order to maximise on this opportunity, you must leave your familiar grounds. Even though you have already invested a lot into your current circumstances, for you to be able to grow and to maximise your potential, it is imperative that you step out into a new world and explore your options.\n\nThis card shows the patience and focus of your intent. You have got the ball rolling and have started out on your journey, so now it is time to patiently wait for your rewards and watch as your ideas begin to materialise.',
	         reversed: 'The Two of Wands reversed suggests that you need to start organising your long-term goals and prioritising what is important to you and what you really want to achieve. At the moment, it may seem that you want so many things but you have not thought these through enough to make them a reality. Start at the beginning again and meditate on what is important to you and what motivates and drives you. Look at where your passions are, and then start planning how you will achieve these goals.\n\nYou may also be afraid to step out into unknown territories, despite the huge growth potential, instead preferring to stay with what is familiar to you. The trouble is your growth is current being stunted in your present environment and your world has become too small for you. It is time to bring your attention back to your original goal and understand the beneficial impact of taking a risk and stepping out into the bigger world around you.\n\nThe reversed Two of Wands can also indicate that you have overlooked some important details related to your plan for the future. You may have been moving full steam ahead but have recently hit a roadblock due to lack of planning. You may also be over-confident about your success, overlooking the things that matter most. Or, you may be losing your passion associated with your goal and are becoming easily bored and demotivated. It is essential that you re-ignite that passion, or start again with something you feel more inspired about.'
	      }
	   }, {
	      name: 'Three Of Wands',
	      src: 'https://preview.ibb.co/bv1rBF/24_Wands03.jpg',
	      keywords: {
	         upright: 'Preparation, foresight, enterprise, expansion',
	         reversed: 'Lack of foresight, delays, obstacles to long-term goals'
	      },
	      description: {
	         basic: 'On the Three of Wands, a man stands on a cliff, with his back turned, looking out over the sea to distant mountains. From this height, he can see all that lies ahead and is aware of the impending challenges and opportunities. The three Wands surrounding him are firmly planted in the ground, reflecting his commitment to his future plans.',
	         upright: 'The Three of Wands indicates that your plans are now well underway and you are starting to consider even more opportunities to expand your current plans and maximise on the potential of your future. Everything is progressing steadily and as expected, thanks to your solid planning and ongoing motivation to persist.\n\nThe Three of Wands indicates opportunities to expand your horizons, through study, travel, business enterprise and learning. You need to become more aware of the opportunities that exist for you right now as there may be more than you are aware of. To best see and take advantage of them you must concentrate, cooperate and remain open-minded. You may be more aware that your best opportunities lie outside of your current environment, so it is time to think BIG. Consider what you can do to open doors for yourself and create more development and self-exploration opportunities. It also signifies the changes and challenges that are up ahead and that are associated with expanding your horizons and entering new territories. Given the man in this card can see far ahead of himself, then you are likely to already be aware of the upcoming changes and challenges and can prepare for them ahead of time.\n\nSimilarly, this card is also about embracing change and adopting a longer-term view. It indicates you are in a position of strength as you control what happens around you. Thus, this is a card of vision and foresight and looking for greater possibilities. You are being encouraged to become a visionary and to dream beyond your current limitations. Now is the time to accept your vision and be confident that you will achieve it. Move fearlessly into new areas.\n\nGiven the expanse of the water in the card, the Three of Wands often depicts travel. This card encourages you to think big in terms of where you want to travel to and what you will discover along the way. This card sees you travelling over water to a far-away country, where you will then have the opportunity to fully develop yourself and learn many new things. I see this as a wonderful card of opportunity that encourages you to be bold and take this leap of faith to truly develop who you are.',
	         reversed: 'The Three of Wands reversed suggests that you have attempted to embark on your own journey of personal development but you have been unable to accomplish the goals that you had hoped for. There may have been some unexpected delays and creative blockages to your path. There is disappointment and frustration, and a general feeling that you may have just wasted your time by even starting on this journey. What you may not realise, however, is that these setbacks are in fact an important part of your bigger life journey and will have contributed to your personal development anyway.\n\nYou may also be struggling to put your plans into action and you are now feeling worried that you have gotten in over your head and tasks appear overwhelming. You may have had a lack of foresight and were unable to detect the challenges as they arose, or you may have been unrealistic about the risks associated with your plans. Break down your plans into smaller tasks to make them more manageable and more realistic. Conduct a risk assessment ahead of time to understand what challenges you may potentially face, and then create mitigation plans to avoid or minimise those risks.\n\nIn a business reading, the Three of Wands reversed may indicate a lack of cooperation, wasted efforts, delays, or bad luck or obstacles from outside in commercial ventures. You may be dealing with a business partner or another business that is only out for their own material gain, and as such, you are at risk of being betrayed in your business pursuits. You may also find that there are shipping delays or product manufacturing delays, particularly if you rely on an overseas source as part of your business. You know that you need to be open to receiving help but you are also concerned about others exploiting you for their own gain.\n\nIn a relationship reading, the reversed Three of Wands can indicate that there is a fundamental issue of not being able to pursue your longer-term goals together. Your partner may want to travel or to expand their horizons by moving interstate or internationally but you may be reluctant to do so, putting an obstacle in your partner’s course. This is becoming a major issue for the relationship. For the relationship to work in the long-term, you need to work this out together and come to a compromise.\n\nSimilarly, in the context of relationships, the reversed Three of Wands can act as an indicator that you are better off not engaging in any long distance relationships. Perhaps this is something you have tried in the past and you now realise that this is something that really does not work for you. You are wary of all the drawbacks and negative consequences associated with such a relationship, and instead you feel you would be suited to someone who was actually physically available and located nearby. You also know that you do not want someone who travels a lot, particularly for work, because again it means that they are not fully accessible or available to you.'
	      }
	   }, {
	      name: 'Four Of Wands',
	      src: 'https://preview.ibb.co/gqXL5a/25_Wands04.jpg',
	      keywords: {
	         upright: 'Celebration, harmony, marriage, home, community',
	         reversed: 'Breakdown in communication, transition'
	      },
	      description: {
	         basic: 'In the Four of Wands, a couple dances beneath a welcome wreath, tied between four crystal tipped wands. The canopy of flowers on the four wands is also similar to the wedding canopy or chuppah of the traditional Jewish ceremony and thus represents a time of fulfilment and satisfaction at the attainment of a goal. In the background stand another group of people, just in front of a large castle, also decorated in flowers. It appears as if a celebration is being held, perhaps as a homecoming or a celebration from within the castle.',
	         upright: 'The Four of Wands heralds celebration, good times, a happy and harmonious home environment and good news. In numerology, four symbolises stability and firm foundations, and in the case of the Four of Wands, you are now enjoying a period of happiness and stability. This card indicates a sense of harmony and balance as well as completion, and thus symbolises a time of peace and joy in life that come as the result of often difficult and challenging effort. The Four of Wands is one of the most positive cards in the Tarot deck and indicates general good fortune, satisfaction, and fulfilment.\n\nWith the Four of Wands, it is the perfect time to get together with your family and friends and to celebrate all the wonderful times that you have had together. Often, this card reflects the holiday period where you get together with the extended family and join in a celebration. Alternatively, it may be as simple as inviting your closest friends over for an intimate dinner and a few glasses of nice wine. The Four of Wands often points to a marriage, engagement, birth of a child, a birthday, graduation or other type of celebration that marks a special milestone.\n\nIf you have been working on a project, you will reach an important milestone and will have cause to celebrate. You have completed a significant phase of the project and can feel very proud of what you have accomplished so far. This card augurs a time of joy and satisfaction in life and represents the personal gratification of a job well done, a goal attained, and a vision beginning to be realised.\n\nGiven the Four of Wands is closely associated with the home environment, you may be working on improving or renovating your home. You may have recently purchased a new home or are very close to finding a new home and getting ready to settle down in your new environment.\n\nThe Four of Wands indicates peace, harmony and tranquillity. You may find a refuge from the turmoils of life, perhaps by meeting someone new in a romantic setting, or by finding a new place to live that is ‘away from it all’. If you have been experiencing any disagreements with others, now will be the time to make a peace offering and instead focus on creating harmony in the relationship.\n\nThe Four of Wands provides encouragement when things seem too daunting. The card serves as a reminder that most things in life do not come easily, and so when you do accomplish a major milestone, you should be proud of everything that you have achieved. The Four of Wands is also representative of move from one stage to another, and moving past mistakes and challenges to a place of peace, acceptance and happiness.',
	         reversed: 'The Four of Wands reversed suggests there is a lack of harmony or a breakdown in communication in your family or home. There may be tension between family members or loved ones and you are finding yourself getting caught up in other people’s concerns and relationship problems. This may leave you feeling uncertain about your own relationships and what you can and cannot depend on. You may also be going through a period of transition in your family and home life and feeling some tension as a result.\n\nSimilarly, you may find your home situation becomes increasingly unstable. There may be an external threat to the peace and happiness you once had in your home. You may be placed into a temporary situation which appeases your immediate concerns but does not yet solve the longer-term issues. Depending on your living arrangements, it may be better to move home for the time being to allow things to settle.\n\nGiven the upright Four of Wands reflects stability, the reversal of this card can indicate that you are going through a period of transition where there is little stability and security. You may be experiencing multiple changes in your life, such as changing jobs, moving house and/or leaving a relationship. While you know that this is an important transition that you need to make, it can be quite unsettling, leaving you feeling out of balance and uncertain about your future.\n\nIn a relationship reading, the Four of Wands reversed reflects someone who may not be looking for a particularly long-term relationship but is willing to invest in it for the time being. There is a lack of commitment, or even a fear of commitment, which is preventing them from wanting a long-term relationship.'
	      }
	   }, {
	      name: 'Five Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/26_Wands05.jpg',
	      keywords: {
	         upright: 'Disagreement, competition, strife, tension, conflict',
	         reversed: 'Conflict avoidance, increased focus on goals'
	      },
	      description: {
	         basic: 'In the Five of Wands, five men wave around their wands chaotically without any regard for each other and appear to be in direct competition with each other and engaged in conflict. However, on closer observation, their wands are only raised and are not striking anyone. It is possible that they are actually enjoying themselves in this chaos with no real intent to harm anyone. The men wear different coloured clothes to symbolise the various backgrounds and belief systems that are held by the world’s populations.',
	         upright: 'In the Tarot, the Fives typically represent conflict and change, and this is no different for the Five of Wands. This card indicates that you are in the midst of conflict, tension and competition and it is impacting your ability to move forward with your goals. Rather than being able to work together with others, you are coming up against it and are constantly being challenged on your point of view. The trouble is that everyone is trying to express their point of view and opinions but no-one is listening, and so there is little progress. There is only conflict, and there is little or no value in the discussions that are occurring. Similarly, this card is representative of a group of people who are committed to an end but they cannot fully agree on how to implement this goal, as each has their individual agenda as to how to bring this to fruition. Aim to turn this into constructive conflict by allowing each person to openly share their thoughts but then listen to other people’s thoughts. Once everyone has been heard and all opinions have been considered, determine the best path forward.\n\nSometimes, this type of conflict and discussion can be very positive, such as in the case of group brainstorming and problem-solving. You need a positive environment where you can test your ideas and have them challenged, and improved, by others. You may benefit by establishing a working group, committee, or ‘mastermind’ group with other individuals who bring varying perspectives and experiences. Be open to this type of conflict and discussion as a positive contribution to improving the quality of your ideas and actions.\n\nThe Five of Wands often points to competition where you are up against a number of people of similar quality or experience as you. You may not be used to having to compete with others just yet, as you have built your success on your own but now it is time to truly experience what competition really means and requires. It is like the top student who excels at university, only to enter the workforce with a number of other high-performing individuals and is forced to compete for the top spot. Where there is competition, respect your opponent but stand up for your point of view. Fight the tendency towards frustration, anger, hate and prejudice.\n\nThe Five of Wands also encourages diversity and differences of opinion. You may be in a situation where you are dealing with people from different cultures and backgrounds, and may be struggling with accepting their way of living. Know that each person has something unique to bring to the table and that you will actually benefit by learning more about them and what they have to offer.\n\nThe Five of Wands encourages an enthusiastic approach to change. Change is coming, whether you like it or not, however your challenge will be in ensuring that everyone is on the same page and is focused on dealing with this change constructively and positively. Currently, there is scattered energy resulting from misdirected enthusiasm. Everyone has many ideas but no-one is there to bring them into one consistent path forward. Your role may be in identifying a clear strategy and purpose that can be implemented by all involved.\n\nSometimes, the Five of Wands indicates a personal struggle and conflict, either about external or internal issues that are causing a lot of tension and confusion for you. You have different opinions of your own about how you should approach your current circumstances and you have not really worked out in your own mind what your final stance is going to be. You may be trying to work through your personal point of view on a number of external contentious issues such as abortion, immigration, globalisation, or the environment, or you may be working through personal issues such as whether you stay or leave a particular relationship or job. At the same time, you have others around you who have strong views about what you should do and this, in total, is creating a huge amount of conflict, tension and disagreement. Just when you think you have a clear point of view, you are challenged on that view or you discover new information, and you change your standpoint again. This process is actually highly beneficial and will help you to come to a well-researched and well-thought out perspective. Know, too, that there is no ‘right’ answer, and whichever path you do choose, someone is not going to agree with it. So, you have to find the most comfortable option possible that sits best with you. It may not be 100% right for you but you need to choose whatever is closest.',
	         reversed: 'The Five of Wands reversed can suggest that you have tendency to avoid conflict wherever possible. You may find that any sort of tension or conflict makes you feel quite uneasy and you wish it would just go away. So, you deflect a lot of that energy and just ignore the problem, if there is one. The trouble, however, is that in doing this, you may just be pushing some of your own concerns to the side, without really dealing with them or being assertive about them. Some conflict can be good, particularly if it is constructive and teases out the underlying issues in a way that then generates a better solution. Consider whether always avoiding conflict is the best way to go, or if you are finding yourself just compromising on what is important to you.\n\nThe Five of Wands reversed is like a sigh of relief after conflict and struggle. You are no longer up against so much competition and can just ‘be’. On more personal level, you have worked through your anger and hostility and you feel more secure in your relationships. You do not have to constantly prove yourself anymore.\n\nThe reversed Five of Wands can also indicate a realisation that you do indeed need focus to achieve your goals. You have come through a period of scattered thought and random ideas only to find yourself in the same place you were when you started. You now acknowledge that if you are to progress your goals further, you must focus your attention on your key priorities and stay committed to your goal without considering even more possibilities or opportunities.'
	      }
	   }, {
	      name: 'Six Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/27_Wands06.jpg',
	      keywords: {
	         upright: 'Public recognition, victory, progress, self-confidence',
	         reversed: 'Egotism, disrepute, lack of confidence, fall from grace'
	      },
	      description: {
	         basic: 'The Six of Wands depicts a man wearing a victory wreath around his head, riding a white horse through a crowd of cheering people. The white horse represents strength, purity, and the success of an adventure, and the crowd of people demonstrates public recognition for the man’s achievements. The wand held by the rider also has a wreath tied to it, further emphasising success and achievement. He is not afraid to show off to others what he has accomplished in his life so far, and even better, the people around him cheer him along.',
	         upright: 'The Six of Wands is all about success, victory and public recognition. Not only have you succeeded in achieving your goals, you are now being publicly acknowledged for your efforts and your results. You may have recently received an award, public acclaim or acknowledgement from your peers for the work that you have done. It may even be just a pat on the back or getting praise or recognition for your work. This instils a high level of confidence within yourself and gives you the strength to continue your efforts.\n\nThis card indicates that you have harnessed your strengths and talents in order to bring about a successful outcome in your endeavours. You have managed to get through the confusion of the Five of Wands, minimising your distractions, focusing on the task at hand. You have overcome the challenges along the way, and now you are focusing your energies on the one goal that will lead to your success. This is your time to shine and to come out on top.\n\nThe Six of Wands is such positive encouragement to believe in who you are and your accomplishments so far. Have faith in what you have personally achieved and how this will be received by others. Do not let fear or guilt stand in the way of your success. You ought to feel proud of what you have achieved and not afraid to hold your head up high and feel worthy of others’ attention.\n\nThe Six of Wands focused on creating success and building your personal brand and reputation. You want to be successful at what you do but at the same time, you want to ensure that others know about it and give you the recognition you deserve. You may need to promote yourself more frequently by sharing your success stories with others and encouraging them to follow a similar journey. If you do not already, you will soon have some great success stories to share within your personal networks. You may even be interested in applying for awards or scholarships in order to build your brand and receive public recognition.\n\nThe downside to the Six of Wands is that it can also bring self-importance, arrogance and egotistical behaviours. With victory you may come to think that nobody can be better than you and you end up with an inflated ego and a big head. If you take on this attitude, someone is likely to want to take you down and criticise you, bringing disappointment and potential disrepute later on. If empowered by the energy of the Six of Wands, keep in mind how you would feel if someone made you feel inferior or put you down. Reign in your ego and make your victory all the sweeter.',
	         reversed: 'With the Six of Wands reversed, you may find yourself doubting your abilities and your potential for success. You may feel negatively about yourself and as if you have failed both yourself and others. You are lacking confidence, and need the support and recognition of others to pick you up and give you strength again.\n\nThe reversed Six of Wands may suggest that you have had a fall from grace and have not received the public recognition you were seeking. You have either received no feedback for your efforts, or negative feedback. You may have expected things would have worked well but instead you are being punished in some way or you are being neglected for your efforts thus far. Now, your confidence has taken a hit, as has your professional reputation or at least your perception of your reputation. If a particular project has not been as successful as you had hoped, you may be better off moving to a new environment so that you can rebuild your personal reputation and brand, rather than trying to fix something that has already broken.\n\nThe Six of Wands reversed suggests that you may be trying to achieve too many things at once and may not be doing a good job at juggling all of these commitments. It may be best to focus on only a few things and do them well. This will help you feel more inspired and motivated about the activities you do commit to.\n\nThis Six of Wands reversed can reflect the transitory nature of success. One moment, you are on top of the world because you have achieved great things but then the expectation has been set that you will continue to perform to this level and when you do not, then you are suddenly knocked down and criticised. While victory and triumph feel great at the time, recognise that it is only temporary and you will have to continue sustaining a high level of performance to be acknowledged.'
	      }
	   }, {
	      name: 'Seven Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/28_Wands07.jpg',
	      keywords: {
	         upright: 'Challenge, competition, perseverance',
	         reversed: 'Giving up, overwhelmed, overly protective'
	      },
	      description: {
	         basic: 'In the Seven of Wands, a man stands on top of a hill and is challenged below by opponents that want what he has, success and status. The man appears to be in a defensive position, fiercely retaliating against those who attack him and defending his position as ‘king of the hill’. Interestingly, the man is wearing two different shoes, suggesting that he may have uneven footing or may be unclear of his own stance.',
	         upright: 'Similar to the Five of Wands, the Seven of Wands indicates a struggle after initial satisfaction and fulfilment. This time, however, the struggle is about maintaining your position at the top while others compete and fight to achieve the same success and status that you have already achieved. Thus, competition is rife and you must continually prove yourself with the Seven of Wands. If your vision and creative effort is fulfilled to the point where there is public acclaim or acceptance of your success then you must expect competition and challenge, as other people will no doubt also desire the same things as you.\n\nThe Seven of Wands can also indicate a challenge to the continued success of a venture or creative project from an external source. While it appears to block your path forward, you can overcome this challenge or obstacle by drawing upon your strong self-confidence, self-belief and continual self-improvement. It can also be overcome with effort and clarity of purpose.\n\nThe Seven of Wands is about holding your ground, despite ongoing challenges to your position and authority. You need to take a stand and defend your position at all costs. This will take courage and persistence but you have the strength and determination to do it. You see yourself as a battler and no matter what the challenge, you still have it in you to stand up for yourself and fight to the end. So, although you are experiencing a number of setbacks at the moment, you need to continue fighting for what you believe in and confronting others who may oppose or threaten you.\n\nThere needs to be acceptance with this card that you are not always going to be able to win everyone over. There will always be challengers and opposition to your point of view and you cannot keep everyone happy all of the time. Thus, now is the time to draw your line in the sand, and say, “This is who I am and this is what I need right now.” There cannot be any compromise or negotiation at this time, just hold your ground with determination and courage.\n\nFrom quite a literal perspective, this card can indicate that you will be required to give a speech or write a paper on a contentious or highly debated issue. You will need to be ready to defend your argument and present hard facts that support your point of view. Expect to be challenged but enjoy this challenge as it will help you to create an even more robust argument.',
	         reversed: 'The reversed Seven of Wands reflects that you are feeling overwhelmed by the challenges and responsibilities in your life, finding yourself quickly snowed under and unable to look at the bigger picture. You may have taken on too many commitments and are now looking for an opportunity to focus your attention on only one or two things and do those things well. You may also feel as though you are having to compete against or are constantly comparing yourself to others, leaving you feeling somewhat inadequate and vulnerable. There is a need to return to the Six of Wands, which is all about building your own self-esteem and confidence, and having faith that you can achieve what you set out to.\n\nThe Seven of Wands reversed can also indicate that you feel as though you are constantly being judged or criticised by others. Your family or friends are questioning you on why you are doing certain things, such as staying in a challenging relationship or an unfulfilling job. You would prefer if they could just keep their mouths shut and let you be!\n\nThis card can suggest that you are trying to avoid conflict wherever possible, and as a result, you are backing down on your point of view too easily. As soon as someone challenges you or opposes you, instead of standing up for yourself, you compromise or give in. It appears that being accepted and liked by others is more important than standing your ground and fighting for what you believe in. Alternatively, you may have tried everything possible and have given it your best shot but you are now starting to realise it is not worth the struggle. Even though you may not have made any progress yet wanted to, it is time to let this one go and move on. It may feel like giving up but in the long run, it will be for the best.\n\nOn the other hand, the reversed Seven of Wands can indicate that you are taking things too far and you are being overly aggressive about protecting your turf. This is to the detriment of your personal relationships.\n\nFinally, the Seven of Wands reversed can suggest that you are at risk of being caught unprepared. You are feeling shaken and vulnerable at the threat of a challenge to your position. You have the feelings of falling behind, and not being up to the challenge. Perhaps you want to cave in and give up the fight. This card shows a lack of confidence, courage, and conviction. You are feeling threatened, and have become easily manipulated and taken advantage of.'
	      }
	   }, {
	      name: 'Eight Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/29_Wands08.jpg',
	      keywords: {
	         upright: 'Speed, action, air travel, movement, swift change',
	         reversed: 'Delays, frustration, holding off'
	      },
	      description: {
	         basic: 'The Eight of Wands shows eight blossoming wands hurtling through the air at a great pace. The flight of the wands suggests change, movement and travel. The background is clear, indicating that there is now little that stands in your way, and there is a beautiful river flowing freely and giving life to the landscape around it.',
	         upright: 'The Eight of Wands indicates that the struggles of the Seven of Wands have now all but cleared and you have the freedom and space to move forward with your plans and activities once again. The Eight of Wands contains a high level of energy and movement that propels you forward to reach your goals at a much faster pace than ever before. You can expect to be very busy but this is one of those ‘good busy’ periods where you are enthusiastic and energetic about the progress you are making.\n\nThe Eight of Wands represents a very focused kind of motion and activity. The Eights are all about structure while the Wands are about raw energy. Thus, the structure of the Eight creates a channel through which the raw energy can flow. You are so sure about your goal that all distractions have been removed and you can devote yourself to the task with complete concentration, determination, and will. This experience can be very productive, allowing you to accomplish a lot in short time.\n\nWith the Eight of Wands, you can look forward to the rapid completion of a project that is currently underway but you can also expect to be occupied by something new and even more exciting and inspiring very soon. There really is no stopping you right now as you are just bursting with energy and ideas, and cannot wait to achieve one task in order to start another. To maximise this energy, it is important to ensure that your activities are focused on your broader goals and that you are investing in the right things at the right time. Also, make sure that before you move to the next task, your previous task is complete.\n\nThis card is a sign to ‘strike while the iron is hot’. It is most definitely an action-oriented card that encourages you to move quickly to pursue the best opportunities available right now. There is no waiting around while the Eight of Wands is present so determine where your energy will be directed and get on with it!\n\nOften, the Eight of Wands suggests air travel. It is more likely to be a short-term or whirlwind trip, such as a business trip or holiday. You may even enjoy being part of a tour group that visits ten countries in as many days!\n\nOn the downside, the Eight of Wands denotes haste and rapid advancement of a situation which may result in the wrong decisions being made. It will be important to have all your resources available to be used in your best interests. Be mindful not to rush into things without having a clear plan of where you are heading.',
	         reversed: 'The Eight of Wands reversed can indicate significant delays, particularly with regard to travel or fast-moving plans. Despite having a lot of energy and enthusiasm to progress things forward, you are now being faced with multiple obstacles in your course. This is incredibly frustrating and you may be growing increasingly impatient by the day. Keep looking for alternative ways around the obstacles presented so that you can carry out your plans.\n\nOn the flipside, the reversed Eight of Wands suggests that you are charging ahead with an idea or plan but you need to slow down and consider your next steps before continuing. You may be missing something in your haste and prone to making mistakes. Similarly, this card can be a sign to hold off your activities for a short amount of time until the situation becomes more stable and predictable.\n\nYou may also be prone to having many, many ideas at the one time and not knowing which to pursue and when. Just as you get started on implementing one idea, another one comes to mind and you quickly switch your focus. The trouble is that with this approach, you never actually accomplish anything because you are jumping from one idea to the next without finishing any of them.'
	      }
	   }, {
	      name: 'Nine Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/30_Wands09.jpg',
	      keywords: {
	         upright: 'Courage, persistence, test of faith, resilience',
	         reversed: 'On edge, defensive, hesitant, paranoia'
	      },
	      description: {
	         basic: 'The Nine of Wands shows a weary, injured man who holds a staff as though in a posture of final defence. He has fought the battle and won. He is protected by a number of wands behind him that appear like a wall around him. He appears drained and exhausted as he leans on his wand but he is ready to go to battle again. He has the look of determination in his eye to overcome this final challenge and reach a point of accomplishment and victory. He stands up for what he believes in and holds firm in those beliefs.',
	         upright: 'The Nine of Wands suggests that you are so close to completing a particular project or task but at the last minute, you are faced with yet another challenge or setback. Know that you have the inner resources necessary to overcome any difficulty you encounter, even though it may seem impossible at the time. You are so close to finally achieving success, do not give up now! The Nine of Wands is a sign of hope and encouragement that if you stand firm and strong against your challenges, you will achieve your goal. The challenges before you now are only the last bit of darkness before the break of a wonderful dawn.\n\nThe Nine of Wands is like the one last test or challenge before you can reach ultimate success. You feel as if you have come to the end of your fighting powers but you have the skill and determination in reserve. You are in a position of strength and by drawing upon all of your courage and abilities, you will prevail. Once the last obstacle is overcome, you are home free.\n\nThe Nine of Wands encourages you to be resilient. You will continue to be opposed by hidden enemies and your interests will be questioned. Even in the face of such adversity, when you are feeling battled and bruised, you need to be patient and vigilant. Be assured that you will eventually prosper if you maintain your position. And remember, if you do not succeed at first, then try again.\n\nYou may have experienced setbacks that now leave you feeling distrustful of others or even yourself. The turning point will come when you are able to leave the past behind you and to cultivate a more open mind about the future. While you have experienced losses in the past, it does not mean that you have to experience further losses in the future. Turn a new leaf and push on.\n\nSometimes, the Nine of Wands encourages a risk-averse approach. You need to expect the worst and therefore take extra precautions to avoid any negative consequences to your plans. You need to be on guard and wary of any potential obstacles or opponents who may stand in your way.',
	         reversed: 'The Nine of Wands reversed suggests that you may be hesitant to make a long-term commitment. You may be feeling as if life is all work and no play, and you may feel overcome by responsibilities or a lack of support from those around you. You may also be lacking the necessary resources, such as finances, skills or time, in order to deal with the challenges head on. As such, you are hesitant to make any commitments in fear that your responsibilities will become all too much.\n\nYou may also be more inclined to be a little ‘on edge’ and on the defensive. The boundaries you have set around yourself are now becoming your cage, locking you into your old habits and behaviours. Be careful of dwelling on past frustrations and grievances. Just try to let go.\n\nThe Nine of Wands reversed asks you to be mindful not to make assumptions or hasty judgements. Lighten up a little and return to the Eight of Wands where you take life as it comes in all its various forms. Go with the flow and release yourself of the pressures you are feeling. A holiday or a break might do you some good where you can re-energise and rejuvenate yourself.\n\nSometimes, the reversed Nine of Wands can indicate extreme paranoia or even schizophrenia. You may feel as though you are constantly under attack or are being watched. Oftentimes, this is indicative of a fear from within, rather than an actual external threat. Counselling or psychological help is advised.'
	      }
	   }, {
	      name: 'Ten Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/31_Wands10.jpg',
	      keywords: {
	         upright: 'Burden, responsibility, hard work, stress, achievement',
	         reversed: 'Taking on too much, avoiding responsibility'
	      },
	      description: {
	         basic: 'The Ten of Wands shows a man carrying a very heavy bundle of wands or sticks. He appears to be over-burdened with the weight, yet he knows he is not far away from the town he is walking towards. This card appears to indicate someone who has just finished a harvest and is struggling to bring the fruits of his labours to the local market.',
	         upright: 'The Tens in Tarot represent the completion of a cycle, and thus with the Ten of Wands, you have reached the end of a cycle after a period of struggle. You are finally reaping your rewards after investing a lot of hard work and effort. You have fulfilled a creative venture, realised a dream or accomplished a major goal, and now must deal with the consequences of that fulfilment.\n\nHowever, the Ten of Wands suggests that even with the achievement of your goal, there comes with it great responsibilities and commitments. While you have reached a point of completion, you are becoming starkly aware that you must now carry on with the responsibilities you have laid out for yourself, in order to ensure ongoing success. The trouble is, however, that these responsibilities may become too much to bear and you are struggling to let go. It is a bit like the business owner who creates a flourishing business but who is unprepared to delegate some of his/her responsibilities to the staff, and ends up working 70-80 hours a week. The inspiration and creativity that was associated with the initial goal or vision rapidly disappears, and everything becomes hard work all too quickly. Thus, it is incredibly important to let go of or delegate some of your responsibilities in order to free you up to still enjoy life.\n\nThe Ten of Wands serves as a reminder of how much we take on in our lives and all the extra burdens and responsibilities we weigh ourselves down with. We take on so much, trying to do all the things that need to be done. Thus, this card asks you to stop and examine your current lifestyle or work. Assess which activities or tasks are really urgent or really important, particularly in relation to your broader goals. You may need to employ various time management or prioritisation methods in order to determine where best to spend your time and which tasks you can drop. Your goal needs to be greater efficiency, whilst also freeing yourself up for rest and relaxation when you need it.\n\nThis card can also mean that you are being oppressed by outside sources. You are over-worked, over-tired and over-stimulated. You have more on your plate than you can possibly handle and you have taken on too much at this point in time. In an effort to get to the finish line, you have found yourself overwhelmed with the extra responsibility and activity. You need to stop working so hard. If you cannot stop, then conserve your energy and pace yourself. When you are over-committed everything becomes a strain.',
	         reversed: 'Upright, the Ten of Wands reflects that you have taken on a heavy burden. Reversed, the Ten of Wands indicates that you are unnecessarily holding on to this burden when you do not need to. If you are feeling weighed down by your present circumstances, look at different ways you can lighten the load. Can you delegate certain tasks and responsibilities? Are you worrying about matters that do not concern you or cannot be changed? Do not become a martyr and take on more than you can realistically handle.\n\nIf you are going through a challenging time, then the Ten of Wands reversed indicates that this time will soon pass and you will feel less of a burden weighing on your shoulders.\n\nYou may be actively identifying those activities that do not bring you any value in your life and you are starting to release yourself from these unnecessary responsibilities. You may even be going through a purging process, clearing out old clothes and selling old furniture, in order to de-clutter and simplify your life. You will benefit from better organisation and prioritisation at this time.\n\nSometimes, the reversed Ten of Wands indicates that you are avoiding responsibility and making it even more difficult for others who must take on your share. Thus, the saying, “You have made your bed, now lie in it,” is very appropriate for this card.'
	      }
	   }, {
	      name: 'Page Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/32_Wands11.jpg',
	      keywords: {
	         upright: 'Enthusiasm, exploration, discovery, free spirit',
	         reversed: 'Setbacks to new ideas, pessimism, lack of direction'
	      },
	      description: {
	         basic: 'The Page of Wands is a well-dressed young man who stands alone in the midst of a barren wilderness, talking out loud of his dreams and desires. This scene indicates that much of the Page’s creative energy is still very much only a potential or, at best, only an idea. He holds his staff upwards and looks to it with confidence. His shirt is covered with the design of salamanders, a mythical creature that is associated with fire and transformation.',
	         upright: 'The Page of Wands is similar to the Fool in that he is a free spirit who represents change and new beginnings. He has a true passion for life, despite his understanding of this world is not yet fully developed. He has not yet been weighed down by the burdens of the material world, coming and going as he pleases, and usually encouraging change wherever he goes. He is like the catalyst that inspires changes that might be impossible in any other situation.\n\nThe appearance of the Page of Wands indicates that you are experiencing a creative restlessness within you that is just waiting for some sort of expression, or, you may be on the verge of some sort of discovery or new phase of life. The Page of Wands represents the sudden creative spark that comes to you, suddenly and unexpectedly, and that starts you down the road of a new creative vision. Thus, he encourages you to express yourself and your individuality with light-hearted abandon. Listen to your unconscious mind and follow your creative urges, even if you are worried about being the lonely voice crying out in the wilderness. With persistence and a balanced perspective even the immature desires of the Page of Wands can be transformed into a beautiful creative vision that can change the world.\n\nSimilarly, the Page of Wands indicates that you need to be positive and spontaneous but not overly impulsive. Your enthusiasm impresses others but if you become impatient or quick to anger or lose interest, you will put others off-side and you will waste time in your creative projects.\n\nWith the Page of Wands, you are inclined to give anything and everything a go. If you are enthusiastic or passionate enough, you embrace the opportunity to start out on a new journey or project and see where it takes you. You do not necessarily have a solid plan in place, nor do you really know where you are headed but you do know that you are excited about the possibilities.\n\nYou are enjoying being busy and involved in various activities and projects. You like the freedom of being able to choose what you will work on today, and hopefully it is different from what you worked on the day before.\n\nOftentimes, the Page of Wands is a messenger, bringing you inspiring or unexpected news, new information or a welcome surprise. It may be the birth of a child, a new and inspiring idea that a friend has, or a new opportunity for you to be involved in to ‘change the world’ such as a community project. His news is nearly always positive and welcomed because it is often associated with change and creation.\n\nThe Page of Wands may also represent someone you know or who is about to enter your life. He is a trusted friend who is devoted to your interests and will do everything he can to help you. His intentions will be honourable and genuine. He is here in your life to spark change, to help you see the world from a new perspective and to guide you towards a new approach. While you may look to this Page as an immature or child-like presence, he actually has a lot to offer you if you open yourself up to the possibilities that he shares with you.',
	         reversed: 'The Page of Wands reversed suggests that you have tried a few new ventures or projects but these have not been particularly successful. You may have had a vision to start a new hobby or project, with the view that it would lead to bigger and better things but you soon realised that you had taken the wrong approach and it wasn’t leading to the growth and development you had expected. You may have started to realise that you had not really focused enough on what your goals and objectives were and that is why you were not reaching the outcomes you wanted. Luckily, you had not progressed too far along and were able to easily retreat from those projects with limited impact. Sometimes, too, these setbacks can be helpful in testing out new territories and exploring what will and will not work for you.\n\nYou may also find that your eagerness to start something new has been negatively impacted by complexities, obstacles and opposition, which has resulted in a lack of motivation and indecisiveness about your path forward. You may also be fearful of whether you can really get your project or idea up and running, or if you are just going to be weighed down by more responsibility and troubles.\n\nThe Page of Wands reversed can depict a person who is immature with a self-image problem. It could be someone who is mean-spirited and aggressive, or someone who is helpless and always a victim. This is someone who never has anything good to say, is always pessimistic, and always brings everyone down. This person undercuts your enthusiasm and your self-confidence. Often, this is a superficial, lazy and arrogant person, one who is unwilling to make an effort, and is uncooperative and impatient.'
	      }
	   }, {
	      name: 'Knight Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/33_Wands12.jpg',
	      keywords: {
	         upright: 'Energy, passion, lust, action, adventure, impulsiveness',
	         reversed: 'Haste, scattered energy, delays, frustration'
	      },
	      description: {
	         basic: 'The Knight of Wands is seen riding upon his horse, which rears up in the intensity of the Knight’s quest for success. The Knight’s face bears the determination of one bound to succeed. The plumes from the Knight of Wands’ helmet and the decorative tassels hanging from his back and arms are the colour of flame and he, like the Page, wears a shirt covered with the symbol of the fiery salamander.',
	         upright: 'Whereas the Page of Wands indicated the initial spark of a new idea, the Knight of Wands indicates the actual pursuit of that idea. There is significantly more action associated with this Knight and he has a true commitment and energy to make sure his ideas are put into action. His courage is incredibly strong and he has no fear of anything. He simply charges forth with his ideas and visions to make things happen. Thus, the Knight of Wands suggests that your confidence levels will rapidly increase and you will feel ready to take on the world with your vision. Tackle any challenges that stand in your way and always be ready to help others who lack your determination and exuberance but who desperately need it.\n\nThe Knight of Wands is an ‘act first, think later’ type of guy. He is impatient and impulsive, with a love for action. The downside to the Knight of Wands is that while he is bursting with energy and enthusiasm, he has a tendency to rush into things without much consideration for the consequences of his actions. He sets off on his journey in haste and often fails to have a clear plan of attack and this may negatively impact his chances of longer-term success. He is so focused on being the best and of fame and glory that he almost forgets to plan ahead and to keep sight of reality. The Knight of Wands can also come across as aggressive and overly ambitious. He is highly insistent even if others stand in his way, criticise him or challenge him.\n\nWhen you encounter the Knight of Wands in a reading, it is important that you start your creative projects with great enthusiasm and energy but you also temper this with a well-rounded, realistic and balanced view along with a well-considered plan that takes into account any future consequences of your actions. You need to show ambition and move from where you are now to where you know you should be to increase your effectiveness in the world. There is nothing wrong with ambition if it is channelled in the right way. Be a pioneer and take calculated risks.\n\nThe Knight of Wands may indicate an event that enters your life quickly and unexpectedly. Coupled with the Eight of Wands, you can expect to see a lot of change and action occurring around you, and you will no doubt be swept up by the restless, ‘busy’ energy whether you like it or not! An important matter is likely to enter your life and demand your attention until it passes. Rather than resisting it, make the time to give it your full attention. Oftentimes, the Knight of Wands can indicate a hasty change of residence, job or other living arrangement. You need to be ready to react quickly and go with the flow as resistance is useless.',
	         reversed: 'The Knight of Wands reversed indicates delays and frustration, getting nowhere, and feeling anger at obstacles and at being denied what you want to have. This card, in the reversed position, represents a loss of personal power or the negative use of power. It can indicate that you are trying to camouflage or compensate for your inability to control this situation. Accompanying emotions may involve a loss of self-esteem and pessimism.\n\nThis Knight, when reversed, is impulsive, restless, impatient and lacking in foresight. He is so keen to just pursue his own interests or hurry things along that he fails to really understand whether he will be successful or what the consequences of his actions will be. If this is you, you need to be very careful of not rushing into things without thinking it through first. Even if you are starting to get frustrated with a lack of action, you need to consider the consequences before doing something. If this is someone in your life, then it is best to steer clear of them for the time being. They need to make these mistakes in their life to learn and improve, and cannot necessarily be controlled or held back at this point.\n\nThe Knight of Wands reversed suggests that you are at risk of acting impulsively, doing or saying things that you may later regret. You want everything to be ‘fixed’ straight away and have everything working out just as it should but you do not seem to be allowing yourself the time to really think through what is best for you. Be careful, too, that you are not reacting instantly to everything that happens but that you give your circumstances some space and time before you take action. You may also find yourself feeling frustrated that there are certain factors impacting your situation that you feel you cannot control. Again, remind yourself that there WILL be things that you can control and change as you want to.'
	      }
	   }, {
	      name: 'Queen Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/34_Wands13.jpg',
	      keywords: {
	         upright: 'Exuberance, warmth, vibrancy, determination',
	         reversed: 'Shrinking violet, aggressive, demanding'
	      },
	      description: {
	         basic: 'The Queen sits upon her throne that is decorated with lions facing opposing direction, a symbol of fire and strength. In her left hand and behind her are sunflowers, symbolising life, fertility, joy and satisfaction. In her right hand is a wand which is beginning to blossom with life. In these positive aspects, the Queen of Wands represents fidelity, warmth, and sustenance. However, at her feet is a black cat, a symbol of the darker, lesser known side of this Queen. Black cats are typically associated with magic and occultism. The cat expresses the independent nature of this Queen and her interest in occult powers and the energy of magic. There are other theories on what the cat symbolises, but as with all symbolism, the true meaning is up to the observer.',
	         upright: 'The Queen of Wands is the dominant feminine energy of the element of Fire. She is not afraid to demonstrate her power to others nor does she shy away from a challenge. She is therefore a strong leader who is focused on her desires, intending to get what she wants. Thus, the Queen of Wands indicates that you are strong, independent and able to take care of yourself and sustain your own creative vision, even in the face of adversity. You know what you want and how to get it, and you are masterful at engaging with others to achieve your goals. You are talented at staying fiercely determined and focused on your own goals whilst being friendly and optimistic with those around you.\n\nThe Queen of Wands is highly energetic and leads a busy and active life. She radiates health and vitality and has an inner vibrancy that fills her with ongoing energy and inspiration. This Queen is a natural-born, intelligent leader who actively inspires others. She can be quite the ‘mover and shaker,’ influencing others through her vision, courage and determination. She instils confidence within you and gives you the power and self-assurance that you can achieve anything that you set your mind to.\n\nThe Queen of Wands asks you to be bold and courageous in your undertakings and actions. Your creative energies are high and you have a good sense of your life direction. You are highly optimistic, confident and full of ideas that you are ready to implement and share with others. You have an ability to express your passions with great authenticity and courage.\n\nThe Queen of Wands is a natural extrovert and enjoys being the center of attention. She creates a powerful first impression and is a likeable individual who makes friends easily by being sweet, warm and charming. She wants to be ‘known’, to be ‘someone’. She has bountiful social and professional networks and she draws people to her with her charisma and positive energy. She may have dreams of being a celebrity one day, whether it be within the entertainment industry, her chosen professional industry or her circle of friends.\n\nThe downside to the Queen of Wands is that she can sometimes be stubborn, particularly if she pursues an ambition or goal for too long and burns herself out in the process. Even the Queen of Wands is not invincible, even if she thinks she is! At times, she may also be deceptive, overbearing, irritable, righteous and even tyrannical, particularly if you get on her bad side. She also has a fiery, passionate personality with a quick temper. She may be known to get all worked up, yell and scream, and then give you a hug, all within the space of an hour.',
	         reversed: 'The Queen of Wands reversed card describes a situation in which someone is behaving in a manipulative, pushy or selfish way. One of you seems to be in a chronically bad mood, and is angry, resentful and jealous. You may find yourself being attacked or bullied, or behaving this way yourself. Perceptions are skewed and information is being twisted into lies. Someone is demanding, controlling, petty and narrow-minded.\n\nThe reversed Queen of Wands can also indicate that you have recently lost your confidence in yourself and have become a shrinking violet. You shy away from being in the limelight as you worry that others may think you are not the real deal anymore. You may have even had a recent fall from grace and are now slightly embarrassed about your reputation. What you need to do is restore faith and belief in yourself. Draw from that positive energy that usually lies within and know that you can combat anything once you set your mind to it.'
	      }
	   }, {
	      name: 'King Of Wands',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/35_Wands14.jpg',
	      keywords: {
	         upright: 'Natural-born leader, vision, entrepreneur, honour',
	         reversed: 'Impulsiveness, haste, ruthless, high expectations'
	      },
	      description: {
	         basic: 'The King of Wands holds a blossoming wand in his hand, representing life and creativity. His throne and cape are decorated with the lion and the salamander, symbols of fire and strength. The salamanders biting their own tails represent infinity and the ongoing drive to move forward against all obstacles. His robe is bright orange like a flame, and his crown has the shape of tongues of fire.',
	         upright: 'The King of Wands represents pure fire energy. Unlike the other Wands court cards, he is not so interesting in actual creation and creativity, or in dreaming up ideas and implementing them himself. Instead, he is more inclined to take an idea and change the world to match his vision. As such he is a natural-born leader of all kinds of people, and he is very visionary. Once he sets himself a goal, he sticks to it and ensures that he can make it happen with the support of those around him. People naturally gravitate towards this King as they know he will get things done and will do it very well. He is a master, too, at being able to get other people to do his work for him, and keep them on-side throughout the process.\n\nThe King of Wands looks forward to challenges because he enjoys the natural rush of adrenalin associated with solving a difficult problem and coming to a solution that will benefit not just one person but many people. In the process, he not only rids himself of his own fear but that of others, by reassuring them that they shall all succeed. He is not all talk, either, and when the going gets tough, he is prepared to do the hard yards to see something through to the end. The King of Wands has a deep and innate respect for other people, and his compassion extends far. He knows how to bring out the best in others and to empower them to deliver his visions and goals, which he knows will be of benefit to the greater population.\n\nThe King of Wands is an indication that you are someone who is very visionary and goal-oriented. You achieve a lot because you are very clear about your future direction and how you will get there. You do not waste your time on activities or relationships that you believe will lead no-where. You never just go with the flow, instead you prefer to embark on a strong and direct course of action.\n\nThe King of Wands reminds you to lead your life with intent, vision and a long-term view. Know that even though you are experiencing challenges now this is just a part of your journey to something much more positive. Eventually, you will see this time as just a little blip on the radar and it will have simply served to make you stronger. Stay focused on your long-term goals.\n\nThe appearance of the King of Wands also suggests that an opportunity is presenting itself to you, and you now have the power to accept the opportunity and take on the challenge. You are the determining factor in this situation, and circumstances will navigate in the direction you steer them. Indecision or doubt will not be appropriate responses when clarity and confidence are required. However, as you progress in this new role, it will begin to feel more comfortable.\n\nThe negative aspect of the King of Wands is that he can be arrogant and even aggressive in his pursuit of his goals. He may be conscious or unconscious of this. For example, most of the time he does not show enough restraint to know when assistance is not needed or wanted, and he can sometimes make things worse by doing what he thinks is the right thing. Furthermore, once successful, he may become easily carried away with his newfound status and grandeur. He shows determination and vision to accomplish his goals at any cost, and while he is often a respected leader, there can be instances where he is prepared to go above the heads of others in order to fulfil his own dreams and agendas, potentially putting others off-side. This King can also become easily distracted by bigger and better things and he can become so accustomed to attention that he can take other people for granted.',
	         reversed: 'The King of Wands reversed personality type can make rash, hasty, and impulsive decisions. This person can be dominating, pushy, and overbearing at times. This is rarely done with malice or an intention to make someone else submissive, it is just a strong tendency that sometimes takes control. The King of Wands type usually does not even realise when he or she crosses the line between being assertive and aggressive.\n\nAt worse, the reversed King of Wands typifies the most selfish, ruthless qualities of fire. He can denote a manipulative business contact who will use you as long as it serves his purpose. He may be a rival, competitor or unscrupulous opponent. In love, he represents a delightful flirtation that could wreak emotional havoc. He is only suitable for limited liaisons, holiday romances or brief, passionate encounters. His flames are bright and warm but soon die down.\n\nAs an aspect of yourself, the reversed King of Wands can suggest that you have set your expectations of yourself too high and may struggle to achieve those expectations. As such, you may end up feeling like a failure because you have not been able to achieve what you want in both areas of your life. Set more realistic goals for yourself and know that you cannot do everything nor please everyone. There may also be times when you become frustrated with the lack of progress in your endeavours, particularly if this is being influenced by your dependence on others. You may find that there are some people who are holding you back and preventing you from fully realising your dreams and goals. If this is the case, it is best to cut them loose as no amount of energy will change their perspective. You may also need to be a bit more lenient on others and accept that not everyone has as much energy and drive as you to achieve results. Accept what they have to offer and do not expect anything more.'
	      }
	   }, {
	      name: 'Ace Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/36_Pents01.jpg',
	      keywords: {
	         upright: 'Manifestation, new financial opportunity, prosperity',
	         reversed: 'Lost opportunity, lack of planning and foresight'
	      },
	      description: {
	         basic: 'The Ace of Pentacles depicts a single hand with a pentacle coming out of the clouds, much like the Aces of the other suits. And, again like the other Aces, the landscape below the ‘hand of heaven’ represents the primary element of the suit. In the Ace of Pentacles, the landscape is a rich garden with flowers, shrubs, a flowing creek and mountains in the distance, indicating prosperity, growth and wealth.',
	         upright: 'The Ace of Pentacles, like the Aces of the other suits, is representative of new beginnings, fresh energy, and inspiration. In this case, the Pentacles are equivalent to the alchemical element of Earth, and therefore symbolise the material world and things associated with matter and the body. Pentacles also represent money and the financial concerns that you may have at the time of your reading. Thus, the Ace of Pentacles indicates the beginning of new energy and revitalised interest in the material or financial areas of your life. This card may represent the beginning of new investments or the willingness to undertake a new business venture. There is also the possible indication of a legacy or influx of money from an unexpected source. The Ace of Pentacles heralds a feeling of prosperity and abundance and should be accepted joyfully. It is a very positive card in general.\n\nThe Ace of Pentacles is symbolic of wealth, not just in the financial sense but also in a more holistic sense. You may see new opportunities come your way to generate a new source of income, or you may be lucky enough to receive a financial gift or windfall. On a broader level, this Ace indicates abundance in all areas of your life and a general feeling that you are indeed blessed and deserving of everything that comes your way. Operate by the Law of Attraction, and send out positive energy into the Universe so that you may receive abundance in return.\n\nThe Ace of Pentacles is about manifestation of your goals, and that you are moving into a more positive state of mind about what you are capable of achieving. Your ideas are ready to be turned into something tangible. Figure out what will work and make it a reality. Thus, the Ace of Pentacles sees you starting to map out how exactly you will achieve your goals, by creating targeted action plans and getting those actions underway. There are opportunities that are becoming available to you that will help you to manifest your goals and realise your inner potential, whilst at the same time generate some level of income and financial support. You are beginning to see that the world is indeed your oyster and that through careful planning, you can manifest your true goals and desires.\n\nThe Ace of Pentacles can suggest that we need to introduce something new into the equation. Rather than let things remain as they are, and hope they work themselves out, the Ace of Pentacles suggests you throw something new into the mix. Consider something that is out-of-character or something you might not ordinarily do, or get around to doing. For instance, you might consider joining a club, taking a class to learn new skills or maybe even picking up a couple of books to learn how to build a new business.',
	         reversed: 'The Ace of Pentacles reversed suggests that a financial opportunity may fall through. The opportunity may be a pay rise, a new job, a loan, etc. Additionally, the Ace of Pentacles reversed indicates that you need to be very careful about what you can and cannot afford. Do not get in over your head and take on a mortgage that requires huge monthly repayments. Do not rely on the promise of a financial opportunity in the future (e.g. a pay rise or a gift). Allow some ‘fat’ in your budgeting in case you are without employment at any time or have a large and unexpected financial outlay.\n\nSimilarly, the reversed Ace of Pentacles indicates a time when you try to manifest your goals but you do not get very far along due to delays and other impediments to your plans. If your success is limited, then you may need to re-evaluate and modify your plans and proposed approach. Your goals may also need to be re-aligned to something more realistic. Financial or other professional advice may be needed to help you get back on track.\n\nThe reversed Ace of Pentacles can indicate corruption, greed and taking what one has not earned. Be careful that you are not being overly opportunistic and exploiting others as you strive towards higher profits and earnings. You may also be blinded by an obsession for greater financial accumulation and wealth, at the expense of other areas of your life.\n\nIf you are considering starting a new business or taking up a new job offer, the reversed Ace of Pentacles warns that there is a significant risk to success due to lack of planning and foresight. You may overlook the financial details of your business plan, and head into a new idea blindly, without an indication of whether or not there is indeed a market for your services. You may also rush into creating a business, without doing the planning that needs to sit behind it. You need to plan more and have more foresight and consideration into the financial aspects that align to your passions and career interests.'
	      }
	   }, {
	      name: 'Two Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/37_Pents02.jpg',
	      keywords: {
	         upright: 'Balance, adaptability, time management, prioritisation',
	         reversed: 'Disorganisation, financial disarray'
	      },
	      description: {
	         basic: 'On the Two of Pentacles, a young man dances as he juggles his worldly concerns. The infinity sign loops around the two Pentacles suggesting that he can handle unlimited problems. In the background, two ships ride the waves easily, cruising the ups and downs of life. The man seems to have a somewhat concerned look on his face, yet he dances with apparent abandon despite the turbulence of the sea behind him.',
	         upright: 'In the Two of Pentacles is an individual whose consciousness, represented by the waters, is tossed by seemingly conflicting interests. While the Ace of Pentacles represents the beginnings of a new business or financial venture, the Two represents the need to balance that venture with other important areas of life such as family, friends, and even our own physical, mental, and spiritual well-being. This card indicates the necessity for balance between opposing desires and interests. Life will always be uncertain, yet if you can produce balance and harmony among all the demands upon you, you will ultimately live happily and in prosperity.\n\nThus, the Two of Pentacles serves as a reminder to remain alert, agile and patient as you attempt to juggle your family, your friends, work, finances, health and new challenges. You need to be very clear on your priorities and where you want to invest your time and energy. There is a tendency to be distracted by day-to-day affairs and general busy-ness, so prioritising your activities and carefully managing your time is essential.\n\nThe Two of Pentacles brings you back down to earth and reminds you to not only focus on your broader life goals but to also make sure your day-to-day affairs are in order. This is a card of good time management and financial management, ensuring that your bills are paid on time, that you keep a record of all your appointments and daily commitments, etc. It may sound tedious having to focus your attention on these more mundane issues but this card reminds you that sometimes getting on top of your daily affairs is as important as pursuing your broader life goals.\n\nSometimes, the Two of Pentacles can indicate that there are problems and difficulties in the future. There may be obstacles erected which hinder the attainment of what you wish to pursue or obtain in life. The situation may cause undue worry and again, you will be required to juggle your priorities and manage your time effectively to stay on top of the situation.\n\nSimilarly, the Two of Pentacles predicts change. You need to be able to cope with change, remaining flexible and adaptable in your approach. Rather than putting all your eggs in one basket, you may be better to keep two or more things going at once so you have the luxury of choice, should one option fall through. You must stay centerd while you stay flexible and keep informed. Look for new possibilities, be open to change and go with the flow as best you can.',
	         reversed: 'In your day-to-day life, the reversed Two of Pentacles suggests that you are very busy and at times you struggle to manage your activities and commitments. You may also be struggling to manage your finances and to stay on top of paying bills and keeping abridge of other financial commitments. The stress is getting to you and you are becoming easily overwhelmed by your responsibilities. Therefore, this card encourages you to become more organised and more planned in your approach. You may need to bring a little more structure to your day-to-day affairs, through budgets, ‘to do’ lists, forward planning or diary and effective time management. Life is certainly a juggling act, so make sure you are on top of everything you need to be!\n\nThe reversed Two of Pentacles can be a clear indicator that you are not managing your work and family commitments. It is more than likely you are investing most of your time in work, neglecting your family or your partner. While you may be able to get away with a couple of late nights at work, there will come a time when enough is enough and you will need to make a choice. Something has got to give!\n\nAdditionally, the Two of Pentacles reversed indicates that you are finding it hard to manage your finances and your cash flow may be quite unpredictable. Now is the time to start a budget and stick to it.\n\nIn a relationship reading, the reversed Two of Pentacles advises you not to over-commit, particularly on a more physical / logistical / material plane. Do not commit to too many plans as a couple at this stage or make any financial commitments together. Watch your spending and also how you manage your time. You may find that you get caught up with work or other commitments at this time which distracts your attention from your relationship. It will all come down to where your priorities lie and whether you want to let other commitments interfere with your relationship, or vice versa.'
	      }
	   }, {
	      name: 'Three Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/38_Pents03.jpg',
	      keywords: {
	         upright: 'Teamwork, initial fulfilment, collaboration, learning',
	         reversed: 'Lack of teamwork, disregard for skills'
	      },
	      description: {
	         basic: 'The Three of Pentacles shows a young apprentice working in a cathedral. In front of him stand two architects who are holding the plans for the cathedral. The apprentice appears to be discussing his progress so far with two architects and even though he is less experienced, the architects listen carefully as they value his opinion and his specialist knowledge. There is also an acknowledgement that this young man is an essential contributor to the completion of the cathedral and the architects want to make sure that everyone is on the same page.',
	         upright: 'The Three of Pentacles, like the Threes in the other suits, represents the initial completion of a goal or plan. In this case, the Three implies the fulfilment and manifestation of a creative venture, business, or building project. The inspiration of the individual (i.e. the mason) is beginning to be concreted in the material world, and the decisions of the two (i.e. the two monks) have been made successfully. An initial satisfaction is now being enjoyed and the project is well underway. You have all of the skills necessary to accomplish your goals in life, thus you have the ability to succeed in all your ventures. You are keen to improve the quality of your life or your work.\n\nThe message of the Three of Pentacles is one of encouragement. If you continue to work toward the fulfilment of your dreams and do not allow disillusionment to dampen your enthusiasm, ultimately you will experience prosperity and success in your goals. You need to do work that is satisfying to you and that you can be truly proud of. What new beginnings are you experiencing in the material realm? Is there some project or creative venture you have been putting off because of fear of failure? The Three of Pentacles indicates that dreams can be made real with persistence, determination, and effort.\n\nThe Three of Pentacles may also suggest that you need help to complete your work and can draw on the knowledge and experience of others. It may be beneficial to share your work with a partner but only if they are as conscientious as you.\n\nAt the core of the Three of Pentacles is the notion of teamwork and collaboration. In the card, we see a young mason working hard on building part of the cathedral. The two monks enter, with their worldly knowledge and spiritual understanding to bring a new perspective to the mason’s work. Even though their backgrounds, experience levels and knowledge is very different, they are able to come together to share their expertise in a way that creates synergy and improved results. There is no ‘us and them’ or any sense of superiority. Rather, each person has something unique to offer and is willing to learn from others involved in the project. Everyone is getting the job done together and is contributing to the group through effective listening and sharing. This is a positive card to see when teamwork, collaboration and cooperation are required between parties with different levels of experience.\n\nThe Three of Pentacles also points to the importance of feedback. The mason is open to listening to the monks and taking on their feedback on his progress so far. His primary goal is to do a great job, and he knows that the monks will be able to help him get there. He does not take it personally but uses their feedback and input to continually improve in his work.\n\nEffective planning, management and organisation are also key components of the Three of Pentacles. In order to accomplish significant goals, such as building a monumental cathedral, it is imperative that detailed planning occurs to ensure that all the components are progressing well. This card therefore reflects a time when it is essential to create a detailed plan and to follow a schedule. This is when good project management will pay off.',
	         reversed: 'The reversed Three of Pentacles can indicate a lack of teamwork, whereby people are acting in competition with each other and trying to appear the most knowledgeable. You may be trying to work collaboratively with others but there is an increasing level of tension as each individual tries to exert power or control over the group, thus negatively impacting the harmony of the people involved.\n\nIf you rely on the cooperation of others, now may be a good time to break free of your current group or network and join forces with another group. The lack of harmony and teamwork is having a negative impact on your performance and there may be a lack of a common goal. It may be best to just move on at this stage.\n\nThe Three of Pentacles reversed signifies that you are seeking more respect in the workplace. You have had to be polite and listen to the opinions and feedback of your superiors but now you seem to be growing restless with always taking the advice, rather than giving it. You want to work in an environment where you have the chance to voice your own opinion and be heard, where you are seen as the expert or the leader. You may also be seeking new colleagues who bring with them new knowledge, so as to create a more synergistic team environment.\n\nThe Three of Pentacles reversed can also indicate that you are working in a fairly mundane job, in which your contributions and experience are not really appreciated or valued. There is not much opportunity for growth and advancement, and you feel as if your skills and capabilities are not being effectively utilised. It may be a good time to make a career move and find somewhere where your skills are more valued.\n\nGiven the upright Three of Pentacles is about good planning and organisation, the reversal of this card can suggest that you are need to bring more of this energy into your work. If you do not have a clear view of how you will accomplish your goals, then it will be beneficial to stop work momentarily and plan out your next steps at a detailed level.'
	      }
	   }, {
	      name: 'Four Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/39_Pents04.jpg',
	      keywords: {
	         upright: 'Control, stability, security, possession, conservatism',
	         reversed: 'Greed, materialism, self-protection'
	      },
	      description: {
	         basic: 'The Four of Pentacles shows a man sitting on stool, away from his home town. He tightly holds onto his pentacles or coins in a very defensive posture as though he were hoarding them for fear of loss. One pentacle is balanced on his head, one clutched between his hands, and two are securely placed underneath his feet. He is making sure that no-one touches his coins! And, he cannot go anywhere because his feet are busy holding the coins down. In other words, this man is so tied up with his possessions, that he cannot do anything else. His eyes appear darkened from hard work but his mouth betrays the hint of a smile, which comes from the self-satisfaction of his accomplishments.',
	         upright: 'The Four of Pentacles generates both positive and negative perceptions. On the one hand, this card signifies that you have accomplished many of your goals and have attained great material wealth in the process. However, on the other hand, there is a risk that you will come to value only material wealth, thus becoming possessive and/or greedy in ensuring that no-one else takes away your wealth.\n\nThe Four of Pentacles indicates that you are in a position where you are financially stable and secure with solid investments. You are very conservative about money and are not inclined to gamble in financial matters. You are very protective of what you have accumulated over time, and slowly and steadily you increase your net worth through saving money and safe investments. You are self-sufficient both financially and emotionally, as you often equate money with emotional security.\n\nAlthough this card shows a practical and financially stable person, it often indicates possessiveness, greed and an overly cautious approach to life. You may be afraid to take risks, both financially and emotionally for fear of losing everything that you have attained so far. As a result, you may be vaguely unhappy and unfulfilled. Deep down you are starting to realise that you have sold out for a conservative and overly ‘safe’ approach to life.\n\nThus, the Four of Pentacles indicates one of the dangers of prosperity, the temptation to value money far above its real worth. If wealth and financial success lead to a miserly or penny-pinching attitude, then you have found yourself in a narrow-minded state where nothing is perceived to have any significant value other than money. This attitude is an expression of extreme attachment to the material ‘things’ of the world and is unhealthy in the long-term. Sadly, possessions have become your life and you now assess your self-worth based on how expensive your car is, how many bedrooms and flat-screen TVs your house has, etc. What this also means is that you must continually work hard to generate an income to sustain this standard of living and to sustain your ongoing obsession with material possession.\n\nSometimes, the Four of Pentacles can indicate an inflexible attitude that is resistant to change. You have already established a way of living that now works for you, so why change? Change appears to be a threat to your certainty, safety and security, and may place you at risk of losing all that is important to you. Any suggestion of doing things differently is therefore going to be met with resistance for fear of how it will impact your personal sense of security. Thus, you are more likely to favour tradition and tried-and-tested ways of doing things, rather than taking any risks at this point.\n\nThe Four of Pentacles can also indicate a need to control your environment. You want to be in charge to ensure that your world does not get altered or changed, and as a result, you demand compliance and you insist on having things your way. You want to create order amidst the chaos, to bring a state of calm and stability back into your life. However, the downside is that you cannot always have things your way and you may prove to be too much for some, isolating yourself from friends or family.',
	         reversed: 'Reversed, the conservatism of the Four of Pentacles has turned to greed and stinginess. You are haunted by a fear of poverty that compels you to be materialistic. You are extremely defensive and self-protective materially and emotionally, fearful of opening up and trusting other people. You are very reluctant to spend money and you are keeping a very tight rein on your cash. On the flipside, you may be spending too much money and need to get a better hold of your financial resources.\n\nIn relationship reading, the Four of Pentacles reversed suggests that you have spent your time recently focused on career-building and material acquisitions, rather than your relationships. This approach to life has been quite successful financially but is very limiting when it comes to connecting authentically with others. You have created a prison for your time and your energy by building up this solid wall of work and financial responsibilities, and will need to release and escape from this to some extent if you want to focus on more personal issues. The important thing to realise is that success in your career is beneficial but only to a point. You may need to examine your life and determine what you can give up, particularly in terms of effort and time put towards work and other similar activities, so that you can have more energy available for developing personal relationships.\n\nThe Four of Pentacles reversed asks you to loosen your hold on your need for security and stability and step outside your comfort zone. While it will feel a bit shaky at the start, this is an important step in your personal development.'
	      }
	   }, {
	      name: 'Five Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/40_Pents05.jpg',
	      keywords: {
	         upright: 'Isolation, insecurity, worry, financial loss, poverty',
	         reversed: 'Recovery from financial loss, spiritual poverty'
	      },
	      description: {
	         basic: 'The Five of Pentacles, like the fives in the other suits, portrays a situation of adversity. In this card, a destitute couple walk through the snow outside the stained glass of a brightly lit church window. The church is symbolic of providing spiritual comfort while helping those who cannot help themselves. The man uses a crutch because of his crippled leg and the woman attempts to cover herself with her threadbare shawl. Both appear to be living in poverty and with little or no possessions.',
	         upright: 'The Five of Pentacles typically points to a time of financial strife, poverty and adversity and indicates that you have suffered a significant financial loss or failure. This card shows the many faces of material misfortune and lack, including loss of funds, general poverty, illness, unemployment, and solitude. If you have suffered a loss, know that there are people around you who are willing to help. There is always a solution and always a way out, so either open your eyes and go to it, or close your eyes and let the inner light guide you.\n\nOften, what has caused these financial problems is a matter of your own emotions – greed will lead to loss, anxiety will lead to error, possessiveness will lead to solitude. By focusing on the material, you lose sight of your spiritual development. You may be rich for a while but all will be lost if you learn nothing.\n\nOn a psychological level, the Five of Pentacles may indicate difficulty with your relationship to money and material things. If money becomes the primary motivating force in life and the gauge by which you judge your worth, the lack of it may produce anxiety and a sense of being excluded from the good things money can provide. For example, if you are unfortunate enough to encounter financial difficulties such as the loss of employment or an investment gone belly-up, you may fall into the trap of losing faith in your ability to recreate a positive financial situation for yourself. Therefore, you should not only consider your actual financial circumstances but also your attitudes toward money. What fears do you have around money and wealth? Are you anxious about never having enough, or do you have faith in your ability to manifest what you need to live a prosperous, fulfilled life no matter what your circumstances? Often wealth is based as much on your psychological state as your actual financial state.\n\nIn a world that often equates success with financial wealth, the loss shown on the Five of Pentacles can be a humbling blow to your self-esteem and sense of self-worth. This loss can occur in any number of ways but even though an external event may seem to be the cause, this card often reflects that the loss is something you have bought upon yourself. There is a spiritual loss that often precedes or accompanies loss of material wealth.\n\nThe Five of Pentacles can also point to a time of being alone, feeling abandoned, ignored and unwanted. You may be excluded from group events or you are being ostracised by others. You are in desperate need of support and comfort from those who actually care.',
	         reversed: 'The Five of Pentacles reversed indicates an end to difficult times, particularly if you have recently suffered a major financial loss or job loss. You may find new sources of income, a new job, or someone has offered to help you out while you get back on your feet. You may be starting to feel as if life is worth living again and starting to regain your self-confidence. Finally you can see a way out of your financial difficulties and your hope is being renewed.\n\nThe reversed Five of Pentacles can sometimes indicate the persistence of inner, spiritual poverty. It reflects a time when you feel isolated and alone, even if surrounded by many people. You may feel as though something is just completely out of place and you are struggling to place your finger on what it is. Return to the Four of Pentacles and you may come to realise that you have placed too much emphasis on your material wealth and have neglected your spiritual well-being.'
	      }
	   }, {
	      name: 'Six Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/41_Pents06.jpg',
	      keywords: {
	         upright: 'Generosity, charity, giving, prosperity, sharing wealth',
	         reversed: 'Debt, selfishness, one-sided charity'
	      },
	      description: {
	         basic: 'The Six of Pentacles shows a man dressed in a purple robe, symbolic of his wealth and status. In one hand, he holds a balanced scale, representing fairness and equality, and with the other hand, he feeds two beggars who kneel at his feet. Not only does this card reflect the state of being materially secure, it also suggests that you are able to use the abundance in your life for the benefit of others. The wealthy man shares his abundance so that stability is preserved.',
	         upright: 'The Six of Pentacles is a card representing being in harmony with your money. The amount that comes in and the amount that flows out are in balance, and you are thankful for what you have without being grasping of it, and happy to share with others in need. This card is also about charity. You may either be the wealthy man in this card, giving away his wealth, or the beggars, gratefully receiving what the man has to offer.\n\nIf you are the wealthy man, then you have accumulated great wealth and are now in a position where you can offer financial assistance to those in need. Now that you have lived through the darkness long enough to see the inner light, it is time to help others who are not so fortunate. Consider giving to charity or reaching out a helping hand to someone who needs your support. The generosity of the Six does not limit itself to money and material things. Giving of your time or your wisdom is often just as spiritually fulfilling as giving away money or gifts, and the intangible gift of your presence is received just as well, if not better.\n\nYou may also be inclined to make a loan to someone, on the premise that they will eventually pay you back once they are back on their feet. This is a loan built on trust and good faith, knowing that if you give something away, it will come back to you. Remember, though, that this is more about a short-term fix and not a sustainable solution towards self-sufficiency. So, think about how you can financially support your family or friends in a way that encourages them to stand on their own two feet eventually.\n\nIf you are the beggars in the Six of Pentacles, then you may be the recipient of someone else’s charitable activities. This will help you to get back on your feet and to eventually repay the charitable organisation or individual, either with your time or your restored wealth. You will also need to identify ways in which you can become more self-sufficient in the long run. The risk of accepting charity is that you become dependent on it and cannot look after yourself. Be mindful that you are not becoming submissive or noticeably ‘desperate’ as a result of the charity that someone else is providing you.',
	         reversed: 'The Six of Pentacles reversed suggests a one-way street in terms of charity. You may have lent money to a friend or given someone a favour but, in this instance, do not expect the money to be repaid or the favour to be returned. Or, you may expect it to be repaid but it never is. With this in mind, be careful about who you lend your money to, especially if you yourself are in financial trouble. While a generous spirit is a wonderful quality, you need to ensure that you are able to support yourself whilst helping others. You may have a tendency to spend or give away more than you can afford to.\n\nBe careful with the amount of debt that you get into. It is possible with the reversed Six of Pentacles that you are getting in over your head and it will soon come back to bite you in excessive interest rates or personal threats if you are unable to pay it back in time. Be wary, too, of ‘get rich quick’ schemes that are more likely to leave you with a hole in your pocket than a pile of cash.\n\nThe Six of Pentacles reversed sometimes reflects the selfish side of charity. In some cases, people give to others not for the benefit of the other but for the benefit of themselves. Be careful that you are not trying to prove to others that you are generous because you can give to the poor or the needy. Aim to give selflessly rather than selfishly.\n\nIn a relationship reading, the reversed Six of Pentacles suggests that one partner is doing a lot of the taking but not a lot of the giving, thus creating an inequality in the relationship. You need to be careful that your generous spirit is not being taken advantage of and that you are not always the one making compromises for your partner’s benefit.'
	      }
	   }, {
	      name: 'Seven Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/42_Pents07.jpg',
	      keywords: {
	         upright: 'Vision, perseverance, profit, reward, investment',
	         reversed: 'Lack of long-term vision, limited success or reward'
	      },
	      description: {
	         basic: 'The Seven of Pentacles portrays a young man taking a rest from the difficult work of harvesting his abundant crop. He has been labouring long and hard in his garden. The foliage is full and the blossoms are out. It seems that his work has paid off. He gazes meditatively at the pentacles hanging from the rich greenery of the thicket in which he works and seems to be contemplating the value of his efforts. He is finally taking a break to admire his handiwork and the benefits of his labour.',
	         upright: 'The Seven of Pentacles shows that you have a strong desire to invest in those things that will provide long-term benefit. You understand the value of putting in time and energy now for longer-term rewards, and you are not necessarily looking for ‘quick wins’ as such. You also want to make sure that you are focusing your attention on the right areas that will give you the biggest ‘bang for your buck’, instead of wasting time on areas that will not deliver any value. You have a long-term view and you are focused on sustainability of results.\n\nSimilarly, if you are planning for the future, the Seven of Pentacles shows that you are taking a long-term view and you are assessing where you can best invest your time and energy for the maximum output. You do not want to keep putting your heart and soul into something if you are not getting the rewards for it, and no doubt, you have started to see that there are some areas in your life that are just become energy-sappers but without the reward.\n\nThe Seven of Pentacles indicates that if you have been working extra hard or putting in extra effort into something, it will finally pay off. Your effort will definitely be worth it and you will see the results and rewards for your labour. You may have been working on something quite challenging and important for the last few months, and this is likely to come to a culmination. You are likely to see financial or other tangible rewards for all of your hard work.\n\nSometimes, however, the Seven of Pentacles can denote frustration. You have been labouring away at something important and you may be starting to feel concerned that you will never be rewarded for your efforts. Be patient and appreciate the progress you have made so far. If your hard work has not yet paid off as planned, remember that your expectations may be unreasonable. There are no guarantees. Be grateful, focus on the present and do what you can with what you have.\n\nThis card follows the Six of Pentacles which indicated the ending of a difficult period of financial or material difficulty. In the Seven of Pentacles, the situation is reversed and you are now experiencing the rewards of hard work and effort. However, the question at hand is whether the rewards of hard work are in fact worth the effort to acquire them. It is often at the time of greatest success that you realise what you desired so much is in fact somewhat disappointing and perhaps not worth all of the effort. A bit like postgraduate study...\n\nThe Seven of Pentacles may therefore represent fear of failure, delays and frustration. However, the positive side to it is that you are more likely to be learning from these setbacks and evaluating how you can better invest your time to create the most value. In order to avoid feelings of frustration, ensure that you review your progress to date at regular intervals, particularly when engaged in long-term or enduring work, so that you can review what is working well and what is not and where you can make adjustments. Make sure that you are on course and that you are on track to achieve your goals.',
	         reversed: 'The reversed Seven of Pentacles suggests that your efforts may be scattered at this time and you are starting to question whether or not you are investing in the right areas. You may be outlaying some initial money on things that will not actually deliver results. So, the opportunity here is to examine your current and planned investments (both financial and time), and make sure that you are going to see a return on those investments. Use a prioritisation system to ensure that you do not waste time and money on areas that will not deliver results.\n\nSimilarly, the Seven of Pentacles reversed indicates that even though you may continue to invest a lot of energy into a specific situation, you may not reap the rewards you are looking for. As such, this card calls on you to prioritise your activities very carefully. You need to do a cost-benefit analysis on the major tasks involved to bring your project to fruition as there are certainly a number of tasks that are currently taking a lot of your time and energy but are not bearing the rewards you are seeking. Take stock of what you still need to do and focus only on those things that will get you to where you want to be. You may find that there are a lot of things that you get involved in that are just not value-add. For example, email and meetings are huge time wasters if not used effectively. Try to get down to the 20% of tasks that deliver 80% of the value, and focus on these, rather than investing your time in tasks that do not deliver any results.\n\nAs a key strength, the reversed Seven of Pentacles can indicate that you know when to stop investing in something when you are seeing little return. Some people are inclined to keep persevering at something, even if it is not working out, just because they have already invested a lot of time, energy or money into it. However, you are very good at identifying when a situation is no longer delivering you any value and knowing when to pack it in and try something else.\n\nIn a relationship reading, the reversed Seven of Pentacles indicates that you have been working very hard on laying the foundations for your relationship but now, for some reason, you are concerned that you are going to lose all of that. You may also be feeling frustrated that the relationship is not progressing or growing as quickly as you had hoped, particularly given that you have put in so much time and energy. Sometimes you can pour your heart and soul into something but it does not always mean that there will be results. You may come to the realisation that it just is not worth your time and no matter how much you try, the relationship is going to continue to hit roadblocks.'
	      }
	   }, {
	      name: 'Eight Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/43_Pents08.jpg',
	      keywords: {
	         upright: 'Apprenticeship, education, quality, engagement',
	         reversed: 'Perfectionism, lacking ambition or focus'
	      },
	      description: {
	         basic: 'The Eight of Pentacles shows a young man labouring over eight coins, carefully etching out a pentacle shape into each coin. He has already successfully completed six coins, and has two more to go. It is clear that he is in the middle of a project that absorbs all his attention. He has isolated himself from others (the town in the background) in order to concentrate on the task at hand. This card reflects a time when you are focusing all of your energy on something and making sure it is as perfect as it can be. You are very engaged in what you are doing and determined to do a good job.',
	         upright: 'The Eight of Pentacles is the card of apprenticeship. An apprenticeship, whether actual or metaphoric, is a time of learning new skills and a time of beginning something that one has not previously done. In this sense, the Eight of Pentacles indicates that you are experiencing or about to experience a change or a new beginning in terms of your work, education or financial circumstances. However, unlike many of the other cards indicating change or renewal, the Eight of Pentacles symbolises a concentrated determination to master the new skill being learned and the single-minded effort of someone who has consciously chosen a new career path or creative undertaking. This card shows a diligent and hard-working attitude, and indicates that you are applying yourself fully to whatever is at the center of your attention. This card creates success through perseverance and individual initiative as opposed to luck or the generosity of others.\n\nThe Eight of Pentacles suggests you are working away at the finer details of the various aspects of your life, in an effort to continuously improve your situation. You may be unhappy with your current state and you know you need to make some important changes in your life to increase your overall satisfaction. This card is a really positive sign that you are committed to making those changes and to ensuring that you give yourself the best possible chance. Overall, this is a very hard-working and conscientious energy that is present in your life.\n\nThe Eight of Pentacles is encouragement to keep doing what you are doing as it will eventually lead to success. Yes, it requires a lot of dedication, focus and patience but as each day passes and as you stay true to your values and beliefs, you get a little closer to your goal. It may not be as apparent as you may like but events are unfolding that will lead you to the right path. Continue working on yourself, too, and making ongoing improvements and adjustments to ensure that you are the best person you can be.\n\nThe Eight of Pentacles may indicate further education or study in order to hone your skills. You may already be proficient in a particular skill set but you are now seeking to master those skills. For example, you may be a great home cook but now you are starting to focus your attention on fine French cuisine. Or perhaps you have learnt the basics of Tarot reading but now you want to become a Tarot expert! You know that it will require a lot of focus and dedication in your studies but you are willing to work hard and to pay attention to the details. You know that you will not learn these advanced skills overnight but you are prepared for the journey towards becoming a ‘master’ at your chosen expertise.\n\nIf you encounter this card in a reading and are not currently engaged in the active pursuit of your goals, ask yourself what you could learn or create to better yourself or your circumstances. If you are already engaged in the pursuit of new learning, the Eight of Pentacles may be a card of encouragement and reassurance that the energy you invest in your development will be worth your while.\n\nThe downside of the Eight of Pentacles is that by focusing on the details of your work or study, you may become a perfectionist. While it is important to get the details right, be aware of any tendency towards perfectionism where you may lose sight of the bigger picture.',
	         reversed: 'Reversed, the Eight of Pentacles can reflect that your attention to detail is actually getting in the way of innovation and change. The Eight of Pentacles is perfection in a self-contained world, a world that needs nothing but perfect pentacles, one after another. But what if the rules change? What if you are called upon to do something completely different to the task at hand or you need to change your focus? This may send you into a tailspin! If you need to take a risk, or to shift gears, the reversed Eight of Pentacles shows that your perfectionism has become a barrier to your success. You will have to let go of the smoothness and predictability of doing what you have mastered, and be willing to make a Fool of yourself all over again.\n\nOften, the reversed Eight of Pentacles reversed suggests that you are working very hard on something but it is not leading to the desired outcome, leading to frustration and disappointment with the lack of success and progress. Sometimes, we can focus in on improving a part of ourselves or trying to fix something, only to find that all that effort is just going on the wrong things. You may be honing in on minute details that are not important to the overall workings of your life. Instead, you need to look at the bigger picture and ask yourself whether this is the right direction for you at this time. How can you bring your attention out of the detail and to the overall picture here? Are you working on the right things, or is there a major part that you are missing? Return to the energy of the Seven of Pentacles and re-prioritise and invest in those activities that will lead to the greatest return.\n\nIn a work-related reading, the reversed Eight of Pentacles can indicate a time when you are lacking the ambition, engagement or dedication to see your work through. You are too wrapped up in everyday concerns and worries to take the time out to gain more long-term security. Instead most of your energies are wasted pursuing short-term gains and rewards. Continuing to toil at the same work is not going to get you where you want to be. This might be fine for some people but for you to get anywhere in your current profession, you might actually have to go back and get some additional skills and possibly even take a pay cut while doing so. Rather than trying to look for minor improvements in what you are already doing, this card suggests completely thinking out of the box. Look for something unrelated to what you have been doing, for example, starting your own business or entering an entirely new field of work. Look for something new. The time is right for you to change directions.'
	      }
	   }, {
	      name: 'Nine Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/44_Pents09.jpg',
	      keywords: {
	         upright: 'Gratitude, luxury, self-sufficiency, culmination',
	         reversed: 'Over-investment in work, financial setbacks'
	      },
	      description: {
	         basic: 'The Nine of Pentacles shows a mature woman walking in the midst of a vineyard. The vines are heavy with grapes and golden coins representing the fruitful accomplishment of all her desires. A falcon sits calmly on her left hand, symbolising her own intellectual and spiritual self-control. Far in the background is a large house, presumably belonging to the woman herself. There is a general sense of peace, satisfaction, and the fulfilment of a creative venture or personal investment in the image of the Nine of Pentacles that offers a more permanent, lasting achievement as the result of one’s own efforts.',
	         upright: 'The Nine of Pentacles indicates that you have reached a point in your life where you are feeling self-confident, self-sufficient, independent and free. By acting on your own accord, you have attained well-deserved success and may now enjoy money, leisure time, pleasure, material comfort and rest. You appreciate what is now available to you, knowing that the difficulties are over. You also know that you can complete any work necessary through confidence, self-discipline and patience.\n\nThe Nine of Pentacles is about enjoying the good life and the fruits of your labour. You have worked hard to get here, so now, sit back and relax and enjoy some of life’s luxuries. You deserve it! Do not be afraid to splurge, indulge or pamper yourself, particularly if it is as a reward for all of your hard work. Treat yourself to a special occasion, to simply celebrate the journey you have been on to achieve your goals and to re-energise yourself for the next phase. You are close to reaching completion, so acknowledge this and then prepare for what will come after.\n\nSometimes, however, the Nine of Pentacles can indicate that you are close to reaching your goal but you have not yet made it. So, as a result, you may want to stick to your program and continue sacrificing until you have reached that goal. You are showing great self-discipline and self-control to ensure you get to where you want to be.\n\nWhilst the suit of Pentacles typically focuses on material wealth and gain, the Nine of Pentacles also suggests that you are in harmony with the nature that is around you. You have an appreciation for the beauty and abundance found in nature and you are able to harness this energy to bring pleasure into your life. You may enjoy gardening or floristry, or you may simply like to pass your time in the beauty of nature with picnics or walks in the park.\n\nThe Nine of Pentacles can indicate a time of restraint, poise and grace. The figure in the card is very lady-like and refined. She lives a comfortable, luxurious lifestyle and is able to keep herself looking ‘nice’. This is a time when you need to carry yourself with grace and refinement, and to be tactful and diplomatic in your dealings with others.',
	         reversed: 'In its reversed position, the Nine of Pentacles suggests that you may be suffering from financial setbacks or you have experienced a loss due to unwise decisions or foolish actions. Your foundations may be about to give way. If they do, learn from your mistakes and build a more solid and secure foundation next time.\n\nThe Nine of Pentacles reversed can also indicate an over-investment in work. You are working long hours at the detriment of your personal life. This is a good time to return to a natural setting (e.g. a forest, beach, mountain or lake) to restore your energies and rejuvenate yourself.\n\nSimilarly, the reversed Nine of Pentacles suggests that you may need to release some of your focus on needing to sustain particular income and a particular standard of living, especially if this is coming in the way of other life priorities such as family or relationships. You may think you need the best of everything but really, all you need is your family and loved ones around you. Do not be afraid to take a cut to your income for a short time or to reduce your hours at work, even if this means that you have to eat rice and beans each night for a week to make up for it! It is important that you are focused on what is most important to you. Finances may need to come second and while you need to at least have food on the table, there may be some areas where you can cut back and reduce your dependence on material wealth.\n\nOn the other hand, the Nine of Pentacles reversed shows that you want to be able to lead a luxurious life but there is something getting in the way. For example, part of you knows you deserve a beautiful home but another part of you doubts yourself and whether or not you can truly afford it or whether you are going too far and splurging. You want to be surrounded by beauty but you also do not want to be dependent on material possessions for your satisfaction and fulfilment. You do not want to be seen as spending your money frivolously, and so you are reluctant to invest in ‘luxury’.'
	      }
	   }, {
	      name: 'Ten Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/45_Pents10.jpg',
	      keywords: {
	         upright: 'Wealth, inheritance, family, establishment, retirement',
	         reversed: 'Financial failure, loneliness, loss'
	      },
	      description: {
	         basic: 'The Ten of Pentacles is a card of culmination and final fulfilment. The card shows an aged, wise man sitting comfortably just outside an archway leading into a town. He is surrounded by his family and his dogs and wears a rich robe decorated with images of grapevines, crescent moons, and other symbols. Behind the laughing couple under the arch, a young boy reaches playfully to pet one of the dogs. This card is a symbol of financial security, accomplishment, and comfort. The patriarch is able to rest and enjoy the fruits of his labours in retirement while he looks on at the lives of his children and grandchildren. This is a man who has accomplished a great deal during his life and is now able to rest in the satisfaction of knowing that what he has created will provide value and joy to others, even when he is gone.',
	         upright: 'As a Ten, the Ten of Pentacles is such a great sign that despite challenges and setbacks along the way, you will finally reach a point of completion and accomplishment in your journey. This sense of accomplishment is likely to be as a result of an improved career path, more solid financial reserves, a stable home environment and a possible committed and long-term relationship. This is one of those cards that shows that everything will eventually come together in a wonderful way and you will feel highly successful and proud of everything you have achieved. You will also feel compelled to share this success with others to ensure that they are also well cared for.\n\nThis card reminds me of the wealthy retired father figure who can now finally relax and enjoy his family and his home. He has worked incredibly hard over his lifetime in order to build up wealth, prosperity and security. He now has the financial reserves to share with his family to ensure that they are well supported now and in the future, which in turn leaves him feeling happy and content with his ability to ‘provide’.\n\nWith the focus on the family, you may be more inclined to direct a lot of your energy into ensuring that your family has everything that they need, from finances, to security and a good home life. You want to ensure that your children and family will always have everything they need.\n\nThe Ten of Pentacles shows how family, or even extended family, is incredibly important. It represents tradition, being a part of something bigger and realising that the blood of your ancestors runs through your veins. It signifies that you are part of a long chain of individuals who subsequently creates a family, a ‘tribe’ and a society. It provides structure where you can sit safely and comfortably, knowing that you are a part of history and heritage.\n\nThe Ten of Pentacles is also a card of affluence and wealth. You are blessed with material abundance and are now free from any sort of money troubles. You feel financially secure and you are fortunate enough to have luck and success on your side to ensure your financial reserves are high.\n\nThis card reflects permanence and creating a lasting foundation for future success. It is a card of commitment to a sustainable future, taking into consideration not just the short-term benefits of a particular venture but also the long-term benefits. It is about investing in the long-term and knowing that you need a consistent approach in order to achieve success that will last the test of time.',
	         reversed: 'Upright, the Ten of Pentacles shows a beautiful picture of a family within a huge castle. The ‘man of the house’ looks so happy to have finally accomplished everything that he has in life and is glad that he can now provide for his family for many years to come. This is one of those ultimate commitment cards often associated with marriage, financial success and established families. Reversed, however, it suggests that there is something getting in the way of this picture. The stability and security of the family unit, the marriage or the financials has been undermined and there is no longer that feeling of stability. In some cases, it can mean that a marriage has come to an end very recently and it is now going through a process of divestment. In other cases, it can mean that this is a temporary state of flux and there is still the possibility that it can get back on track.\n\nReversed, the Ten of Pentacles is about failure on a financial level. This card indicates financial loss, problems with investments, and lack of resources. Despite a lot of time and effort, there seems to be many limitations to future success as a result of a poor foundation. In some cases, this card represents the problems of money, such as fears about finances and quarrels over property, as finances become an impediment to the enjoyment of life. It could indicate that you are beset with financial burdens and responsibilities.\n\nIn a relationship reading where the relationship is relatively new, the reversed Ten of Pentacles suggests that while you are keen to progress this relationship further, you are still not 100% sure that it has potential for the long-term and you may be questioning whether your partner is truly husband/wife material or not. You may be looking for a long-term relationship but you are unsure that your partner is going to be the one who will provide that long-term commitment.\n\nSimilarly, if you are single, the reversed Ten of Pentacles suggests that you are looking for a fun relationship at this stage, not anything more committed than that. You would prefer something that is just casual but still secure enough to know that you are a couple.'
	      }
	   }, {
	      name: 'Page Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/46_Pents11.jpg',
	      keywords: {
	         upright: 'Manifestation, financial opportunity, new job',
	         reversed: 'Lack of progress and planning, short-term focus'
	      },
	      description: {
	         basic: 'The Page of Pentacles shows a young man who stands alone in a field full of freshly blossoming flowers. Behind him in the distance to his right is a grove of lush trees, probably fruit-bearing trees of some sort, and to his left lies a newly furrowed field which promises an abundant harvest. The Page walks slowly as though he were unaware of anything around him other than the golden coin in his hands, which he closely examines. The bright sky above him suggests that all is well in his world and that this is a tranquil moment spent planning his path towards future success.\n\nThe Page of Pentacles, like the pages of all the suits, is a card of new beginnings, of inspiration and the initial stages of a creative project or venture. Pentacles correspond to the alchemical element of earth, and in this sense the coin that the Page holds may symbolise the beginnings of sensual awareness not only in terms of money and its value but also in terms of a growing awareness of the importance of health and other material needs.',
	         upright: 'The Page of Pentacles is a card of dreams and the desire to manifest those dreams in the material world. You may be in the midst of a new project such as a hobby, business venture, or the beginning of a new educational experience. In any case, the Page is a sign of enthusiasm and desire, focused around a goal or a ‘dream’. The card does not indicate the fulfilment of dreams as much as the initial motivation and energy to begin the process of creating those dreams in reality. Therefore, this card encourages you to begin to put in place clear plans and actions that will ultimately lead you to achieve your dreams and goals. This is a time when you need to be able to apply careful planning in order to manifest your dreams and achieve your goals. You need to remain focused on the practical and tangible elements, keeping your feet firmly planted on the ground and not getting carried away with more ideas and concepts but rather being focused on what is realistic and achievable. This is when your common sense and pragmatic approach will lead you to success and to finding a solution that actually works.\n\nNow is the time to start acting on all of those grand ideas and concepts that have been brewing in your imagination. Now is the time to make them real!\n\nThe Page of Pentacles also asks you to grow and expand in a way that generates prosperity and wealth for the future. You are just at the beginning of a new project or venture that will require you to remain focused on tangible outcomes and results. Be clear on what skills and resources you will require in order to draw wealth and abundance to you.\n\nThe Page of Pentacles has the desire to learn all things. He is dedicated to knowledge and the attainment of wisdom and new skills. He is devoted to all in which he is engaged and he has great concentration in his interests and pursuits. Thus, the appearance of this card suggests that success will come to you after you have mastered new skills and have set your mind to achieving specific, tangible goals. You may need to consider further study, expanding your skill sets at work, or learning completely new ways of doing things. Do not be afraid to be the apprentice again, even if you are a master of another domain. Think of those 70-year-olds who enthusiastically start a University degree! The more skills you bring to your portfolio, the more goals and dreams you can achieve.\n\nSometimes, the Page of Pentacles can represent a young person who has an entrepreneurial spirit. This person may be eager to attain wealth by pursuing a new business idea, by learning new skills or by applying themselves to a new situation. This Page might be young but there is also great enthusiasm, commitment, dedication and a strong sense of responsibility to see the project through.',
	         reversed: 'Upright, the Page of Pentacles is about manifesting your dreams and goals. When this card is reversed, it can indicate that there are current blockages standing in the way of you achieving those goals. It may be that you have not planned sufficiently, or that you have become lazy and complacent and have lost sight of your goal. You may also be too busy daydreaming about new dreams and goals, without having taken any action on your original dreams and goals. So, you need to review your goals and think again about why you were originally motivated to achieve them. Think about what it will be like once you achieve that goal, and become re-committed to your objectives and the actions required to make your dreams a reality.\n\nThe reversed Page of Pentacles can also indicate that you are focusing on short-term pleasures and desires rather than sustainable and long-term goals. You will need to move beyond material satisfaction and towards what will bring you sustainable happiness and fulfilment.\n\nSimilarly, you may be finding it difficult to get a specific project or idea off the ground. Each time you try, it seems to amount to nothing, or it takes you even further away from where you want to be. There is a lack of success here and a mounting frustration that perhaps you will never be able to achieve what you want. You may be losing faith in your talents and abilities. If this is the case, relax, lighten up and give yourself some space and ‘down time’ for a short period. Take a holiday or a break from your usual routine, and you will find that this helps you to re-energise and re-focus.'
	      }
	   }, {
	      name: 'Knight Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/47_Pents12.jpg',
	      keywords: {
	         upright: 'Efficiency, routine, conservatism, methodical',
	         reversed: 'Laziness, boredom, feeling stuck'
	      },
	      description: {
	         basic: 'The Knight of Pentacles, like the Knights of the other suits, represents work, effort, and the responsibility that follows upon the dreams of the Page. The Knight of Pentacles sits upon a heavy plough horse in the midst of a field. In his hands he carries a single gold coin. His eyes reflect careful thought and consideration. The Knight is engaged in the often toilsome, routine efforts required to realise the dreams of his heart. He is building the foundations to support his dreams and his goals.',
	         upright: 'The Knight of Pentacles works in a very methodical and rigorous manner. Though his visions may not be earth-shattering, and his methods are certainly not original, the Knight of Pentacles sees that everything he undertakes will meet with nothing but success. He has the patience to accomplish all his tasks and he is incredibly reliable due to his sense of responsibility and commitment. As a court card, the Knight of Pentacles may represent a part of yourself, someone in your life or an event.\n\nAs a part of yourself, the Knight of Pentacles suggests that you need to be trustworthy, reliable and a good provider. You need to follow a routine to ensure that an important task or job is completed from start to finish at the standard expected. You are in ‘implementation mode’ and are committed to getting the job done, even if it requires hard work along the way. You are also fiercely loyal and prepared to do whatever it takes to ensure the job gets done.\n\nThere is a certain element of perfectionism associated with the Knight of Pentacles. You are meticulous in your approach and you make sure that everything is planned and executed down to the finest detail to create overall success. You will never leave a job half done. It is essential to you that you complete all assigned tasks and projects to a certain standard and that you follow through on your promises.\n\nIf you are dependent on the efforts of someone else to help you accomplish a goal in life, they will prove trustworthy and reliable. They are as committed to your goal as you are and they are very conscientious and committed in their work. For example, you may have employed the help of a house cleaner who consistently does a great job, or a virtual assistant who is dedicated to assisting you with every task you throw their way. This is someone who wants to do a great job and is not afraid of hard work in order to meet your expectations.\n\nAs an event, the Knight of Pentacles often shows a time when you will have to assume responsibility and take charge of a situation. You may be assigned a project or given a task to do, and you will have to commit your time to see that project through to the end successfully. With the Knight of Pentacles, you will be required to accept responsibility without any complaints or grudges.\n\nSometimes, the Knight of Pentacles points to the more mundane elements of life. It represents routine, day-to-day activities, and general hard work that can sometimes be a ‘slog’. It indicates a conservative approach that is risk averse and very ‘safe’. This card also asks you to continue doing what you are doing, plodding along and making gradual progress. There is also no need to change your approach, just ‘more of the same’. Go with the flow, stick with your usual routines, and over time, you will reach your goals.\n\nSimilarly, the Knight of Pentacles suggests that you are taking a very moderated and conservative approach to life right now, and while you may be feeling that change is imminent, you are sticking to your tried and tested ways of doing things. You have established that you need routine and careful planning if you are to achieve your goals. It may not necessarily be a very interesting or exciting period but at least you know you are on the right path to achieving your goals. Even if you are growing weary and tempted to quit, this Knight beckons you to keep at it, keep grinding away at it and you will eventually see success. Keep your promises and stay true to your commitments.\n\nConversely, if a situation has been stagnant for some time, you might see this Knight as a suggestion that you are being a bit stubborn and could do with a compromise. At times, this Knight can become too narrow-minded when he is fixated on his own ‘stuff’ and is hard-headed, obstinate and resistant to change.',
	         reversed: 'The Knight of Pentacles reversed is about feeling stuck in a routine and a repetitive pattern of behaviour. Life is becoming mundane and boring, and you are beginning to crave change or any sort of spontaneity. To free yourself from this repetition, aim to do things differently each time and bring some spontaneity into your life.\n\nIn a relationship, the reversed Knight of Pentacles can reflect boredom and restlessness. One partner may be happy with routine and ‘more of the same’ but for the other partner, it is torture! You may also find that your relationship has lost its romantic side and now you are just focused on day-to-day activities such as grocery shopping, school runs, cooking dinner and the like. Try to find time in your day to spend some quality time together, otherwise you risk losing the attention of your partner.\n\nThe Knight of Pentacles reversed can also suggest there are practical matters in your life that you have chosen to ignore recently. Mundane activities such as home upkeep, money matters, business relationships, and moving forward in your career have been left by the wayside as you focus on more exciting or important opportunities. Depending on what is on your plate currently, you may want to make more time to get your life in order, or you may continue to focus on more pressing or important priorities.\n\nAs a person, the reversed Knight of Pentacles can reflect someone who is unadventurous, overly conservative and resistant to change. This person may prefer to just stay at home while others are out having fun and taking risks. If this is you, you may be isolating yourself from others or losing the interest of your friends. Try to get out a bit more and be open to new experiences.\n\nThe reversed Knight of Pentacles can also indicate that you are becoming a perfectionist in how you approach your work. You may be critical of others who do not share the same attention to detail as you, and you may become quickly frustrated when their work is not at the same standard as yours. While your hard work is appreciated, you do not want to lose the support of others along the way and may need to be more flexible in your approach.'
	      }
	   }, {
	      name: 'Queen Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/48_Pents13.jpg',
	      keywords: {
	         upright: 'Practical, homely, motherly, down-to-earth, security',
	         reversed: 'Imbalance in work/ family commitments'
	      },
	      description: {
	         basic: 'The Queen of Pentacles depicts a solitary woman who sits upon a throne decorated with carvings of fruit trees, goats, angels, and other symbols of material success and sensual pleasure. The tree above her and the ground beneath her feet are rich with flowers and ripe plants of all sorts and she holds in her hand a single golden pentacle, which represents her material richness. At the very lower right-hand corner of the card a rabbit, the symbol of reproduction and fertility, leaps out from behind some bushes. The rabbit also hops into our awareness, symbolising that it is a good time to look before we leap and exercise good judgement as the Queen of Pentacles does.',
	         upright: 'The Queen of Pentacles is a very ‘motherly’ card, expressing practical energy. She is the original Earth Mother. She shows her love for others by cooking, cleaning, keeping a warm and inviting home and bringing in a decent income to support the family financially. She is also able to work a full-time job, take care of the children, keep the house clean, and still have time to read the business section of the newspaper. She probably has her very own bank account or investment portfolio that nobody else knows about. She strives to create a warm and secure environment for her family and loved ones, and gives love and support freely.\n\nThe Queen of Pentacles may represent a mother figure in your life who can provide you with loving support and nurturing to help you get through the influences of your past. She may be a teacher, a counsellor, a mentor, or someone who you are very close to. Alternatively, she may represent a part of yourself, particularly if you are investing a lot of yourself into nurturing and caring for others and creating an established and comfortable lifestyle.\n\nThe Queen of Pentacles suggests that it is important to you that you are able to live independently, with a stable income and with enough time and space to also nurture your family and loved ones. You may be trying to create a better balance between your home and work lives, giving it your all in both domains and trying not to compensate one for the other. At the same time, you are also able to find time to invest in yourself and ensure that you have enough ‘me’ time in between all of your other commitments.\n\nThe Queen of Pentacles represents prosperity and security. She suggests that you have worked hard to generate a level of financial or physical security which, in turn, gives you the ability to be generous with others and to share your wealth and prosperity with those you love. You have used your financial prosperity to build a comfortable home environment and you are focused on investing in your family, as well as your personal wealth.\n\nThis Queen asks you to maintain a compassionate, nurturing, practical and down-to-earth attitude when it comes to dealing with others and your present circumstances. You need to focus on creating a calm and balanced life for yourself. You need to be resourceful and practical, dealing with issues as they arise and coming up with realistic and simple solutions that fix the problem with minimal fuss. The Queen of Pentacles is also able to find a use for everything in the home, and is very handy and versatile.',
	         reversed: 'The Queen of Pentacles reversed sees you becoming very consumed in your work. You may be placing your career before your family or your relationships, and this is having a detrimental impact. Of course, this may be ok on a temporary basis but you need to assess its long-term impact. To rebalance your life, you may find a release by returning to a favourite nature spot (a forest, beach or mountain) and allowing yourself to take in this fresh, natural energy.\n\nSimilarly, the Queen of Pentacles reversed can suggest that you are feeling worried about whether you can be financially independent, while also still maintaining your family connections. You may be concerned that if you invest in your career or financial well-being, you might not have enough energy to invest in your family. Sometimes, you just cannot do everything and you will need to make some choices.\n\nYou may also find that you become a bit of a homebody and somewhat isolated from others. If so, you need to fight this urge and keep in touch with your friends and family as they will be a great help and support to you.\n\nAt times, the reversed Queen of Pentacles may suggest that your tendency to ‘mother’ those you care about is actually becoming more like smothering. Your intentions are good in that you love to cook, clean, nurture and care for those around you but there may be a point at which you need to let others be accountable for their own upkeep. You cannot always be the one doing the laundry or cooking the dinner. Sometimes you need to step back and let others take on the load. Similarly, you may reach a point where you are investing so much time looking after others that you find you are neglecting yourself. Again, step back and let others take on some of the household responsibilities.'
	      }
	   }, {
	      name: 'King Of Pentacles',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/49_Pents14.jpg',
	      keywords: {
	         upright: 'Security, control, power, discipline, abundance',
	         reversed: 'Authoritative, domineering, controlling'
	      },
	      description: {
	         basic: 'The King of Pentacles is a card of worldly success, ultimate fulfilment, material satisfaction, and high ambition. The King sits upon a throne decorated with carvings of bulls and vines and his robe is covered with embroidered grapevines rich with fruit. He appears very regal and sophisticated. At his feet and all around him are vines, flowers, and plants of all sorts, representing the highest attainment of material success. In his right hand, he holds the sceptre of his power and in his left he holds a golden coin, symbolic of his material influence. Behind him is his castle, a symbol of all he has built through his efforts and determination. This King is therefore very serious about financial security and has made the accumulation of funds his main preoccupation in life. He is very proud of his achievements and willing to show others his prized possessions.',
	         upright: 'The King of Pentacles represents abundance, security, ambition, power, stability, discipline, trustworthiness and control. He is a fatherly figure who likes to take care of others through providing advice, guidance and wisdom, as well as more material aspects such as financial support and wealth. He is a true provider and generates a lot of his self-worth from what he has accumulated and what he can share with others.\n\nThe King of Pentacles is a lot like King Midas. Everything he touches turns to gold. He is a shining example of financial stability, with wealth and experience coming easily to him and to share with everyone around him. This is a man who has reached the pinnacle of his financial power and influence and is able to rest assured of his continued prosperity. He is no longer required to struggle to achieve what he desires, like the Page and the Knight, and is able to accomplish anything he wants because he has already proven himself.\n\nThus, the King of Pentacles often indicates the final fulfilment of a creative task, business venture, or investment. Through diligence, responsibility and attention to detail you have achieved great things and can finally say that you have completed your task or attained your goal. You can now enjoy all that you have accomplished and the successes you have created. You have created a richness of life, not just financially but also spiritually, which will set you up very well for the future.\n\nWhenever you need the skills to manage your day-to-day affairs competently and efficiently, you can call upon the King of Pentacles. Work hard, methodically and conscientiously. Give generously of your time and resources, because by giving you often receive more, and making more money is something that all Kings of Pentacles love to do!\n\nThis King is business-oriented and highly enterprising. He becomes thoroughly engaged in any activity that provides the ability to generate more wealth or more business. He is able to make any venture successful and can find a business opportunity almost anywhere! He can take an idea and make it work financially. He is a natural-born manager (as opposed to a leader, which is more representative in the King of Wands) and business person.\n\nThe King of Pentacles indicates that a methodical, planned and well thought-out approach will lead you to success. Many consider the King of Pentacles to be dull and unimaginative but this is a likely consequence of his preference to do things in the most ‘tried and tested’ way. You have experimented in the past with what works best and have landed on your own methods and practices that you know will continue to work for you in the future. So, you continue down this path rather than trying new ways of doing things. You know that you have reached the height of achievement and you do not need to take any more risks.\n\nThe King of Pentacles also calls on you to be pragmatic and to stay informed on practical matters. You need to get down to the basics and use your problem-solving ability to get to a solution. You also need to be able to leverage your various skills and resources in order to create success. This King can also play the political game well, interacting comfortably with everyone, no matter what his or her status.\n\nThe King of Pentacles reminds you to remember that appreciating the sensual, luxurious side to life often makes life more pleasurable. As such, this King is about quality over quantity, and learning to enjoy a full and joyful life. He is not afraid to spend money when appropriate so that he can generate much joy and benefit from life.',
	         reversed: 'The King of Pentacles reversed may show some possible downsides or character traits to be aware of. He can show an excessive interest in material things, including good food, wine or sex. These can be fun but can also be taken to an extreme. He can also be very stubborn and traditional about some things, which could be exasperating. He also expects to be King of his castle, and is possessive about his home and things.\n\nThe King of Pentacles reversed is a man who will do anything for money. He is impressed by other people’s status and social position and will readily say ‘yes’ to any requests from those above him. At the same time, he dismisses those who do not hold the same level of authority and status, and may come across as a ‘snob’ to others. He is constantly name-dropping and trying to prove himself by bragging about the people he knows. This reversed King can be either a workaholic or an extremely lazy man who expects others to look after him financially. He may care only for his possessions, and uses other people to gain them. He may be someone who marries for money, leaving the person only when he has gone through all of their resources.\n\nThe reversed King of Pentacles can be highly rigid in his approach, so when this King shows up in a reading, look at your life. Are you feeling ‘stuck in a rut’? Having your feet on the ground is a good thing but everybody needs to lighten up once in awhile and stick their heads in the clouds, even if it is just for a breath of fresh air.\n\nAs the upright King of Pentacles reflects a committed and devoted partner, the reversal of this card may indicate fear of commitment or a strong desire NOT to be committed to anyone. You may have thought you met the ‘man of your dreams’ or your ‘future husband’ in this person but you have quickly come to realise that he is not what you are looking for. He may not be as reliable or dependable as initially thought, and instead he has become overly controlling, authoritative and possessive in your relationship with him.\n\nSimilarly, your partner, who is normally there to provide for you and protect you, may recently be going through a difficult period and now the tables have turned. Up until now, you have seen him as your rock, someone who is incredibly well-established, accomplished, sturdy, stoic, proud and successful. However, now you must be the ‘rock’ and the firm foundation, supporting your partner while he regains his strength and courage. There may be increased instability and uncertainty over the coming months.\n\nIn a family relationship, the reversed King of Pentacles can indicate the possibility of familial abuse, particularly through misuse of power, authority and control. He may be highly disciplinary, rigid and inflexible, failing to show his love through positive means and only suppressing the spirit of others.'
	      }
	   }, {
	      name: 'Ace Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/50_Cups01.jpg',
	      keywords: {
	         upright: 'Love, compassion, creativity, overwhelming emotion',
	         reversed: 'Blocked or repressed emotions'
	      },
	      description: {
	         basic: 'The Ace of Cups shows a hand holding a cup or chalice that is overflowing with five streams of water. The hand that appears from the clouds represents our consciousness of spiritual energy and influence. Radiating from the hand are rays which symbolises that you must always trust your inner feelings and your heart to lead the way. This is your intuition and inner power talking to you. The five streams represent the abundance and power of the spirit and the effect of spiritual energy upon our five senses. A dove holding a wafer or small disc in its mouth descends from above, signifying the incarnation and appearance of the spirit in the material world. Below the hand is a great sea covered with lotus blossoms, symbolising the awakening of the human spirit. The cup has an upside down M or a W inscribed on it.',
	         upright: 'In the Ace of Cups, a huge cup is being offered to you and you are being invited to reach out and drink from it. This is a symbol of fulfilment, not just emotionally but also spiritually. The opportunity for fulfilment is there – will you take it? Whether you are going to reach out now and take up this opportunity will depend on how much you need emotional and spiritual fulfilment in your life right now.\n\nThe Ace of Cups represents the beginning of love, happiness and compassion. It can indicate the start of a new relationship, be it a friendship or a romance. This is one of those relationships where you feel butterflies in your stomach and you are so pleased to have met someone with whom you can share a special connection. The water in the card reflects the flow of emotion and thus the Ace of Cups suggests that positive emotion and energy will be created between two people in a way that leaves you feeling good about yourself and life in general. You need to experience the feeling of new love or of giving and receiving unconditional love. Give and accept love on a new level and open your heart to what is around you. Your loving ways will magnetise love to you.\n\nThis card often means that love is the essence of the situation. It may or may not be romantic love. Look for ways in which you can begin to connect with others. Do you have someone to forgive, or do you want to ask for forgiveness? Can you set aside your anger and find peace? Would you like to drop your reserve and let your feelings show? This is a peaceful time in your life so use it and make peace with friends or yourself.\n\nThe Ace of Cups is also about creative expression, particularly where there is an opportunity to allow your emotions to shine through. You are very open to experiencing your inner feelings and sharing them with others. You may be inspired to start a new creative project, take up an art class or two, or even engage in interpretative dance. You are at that point in your life where you feel comfortable with who you are and what you feel and you are not afraid to express that part of yourself to others. You see new potential in allowing your creative juices to flow and as such, you are open to new possibilities and stimulating your imagination to allow your talent to unfold.\n\nThere is certainly a generous, compassionate component to the Ace of Cups. This is a time of giving, not taking, and offering yourself to a new opportunity to help others. You have the power to bring great happiness to others and to share your contentment and positive energy. You will also find that the more you give, the more you receive on multiple levels.\n\nThe Ace of Cups often points to fertility. From a very literal point of view, this means that the Ace of Cups can indicate conception, pregnancy or birth. Look to other cards in the reading to confirm that there is indeed a chance of new life (typically the Empress and Page of Cups). On a more metaphorical level, there may be the ‘birth’ of a new idea or a spark of new inspiration. It can represent the beginning of a project in which a great deal of loving and creative energy is invested.',
	         reversed: 'The reversed Ace of Cups may call on you to curb your emotions somewhat for your greater benefit. For example, ending a relationship may spur you on to wanting to cry and cry for days on end but what the Ace of Cups reversed tells us is that in order to heal, you really need to push back the tears and fight on in order to retain a balance. Try not to let your emotions get the better of you or take an unhealthy hold of your life. Sometimes it is possible to express ourselves TOO much, and in doing so, share our vulnerabilities or worse, attack the vulnerabilities of others. Find ways to constructively express what you feel so that you can continue through life with a more balanced perspective.\n\nAlternatively, the reversed Ace of Cups could suggest that you have repressed your feelings too long and it is now the time to release them. You may have bottled up so many emotions that you have become almost void of feeling true emotions and instead feel a general ‘numbness’ inside. In a relationship reading, the reversed Ace of Cups can indicate that you are withholding your emotions, for fear of getting hurt. You know that in order for the relationship to move forward and flow freely you must eventually trust in your partner but for the time being, you are holding back.\n\nYou may also be experiencing a roller-coaster ride when it comes to your emotional well-being. There are so many ups and downs in your life that sometimes you do not know if you are coming or going. Life has become emotionally exhausting and now your energy is running out. You need to look after your emotional health. Be conscious about how you are feeling and how this may be impacting your responses and reactions.'
	      }
	   }, {
	      name: 'Two Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/51_Cups02.jpg',
	      keywords: {
	         upright: 'Unified love, partnership, attraction, relationships',
	         reversed: 'Break-up, imbalance in a relationship, lack of harmony'
	      },
	      description: {
	         basic: 'The Two of Cups depicts a man and a woman exchanging cups in what appears to be a wedding ceremony with the caduceus of Hermes between them. The two-snake caduceus design has ancient and consistent associations with trade, negotiation, balance, duality (union of opposites), proper moral conduct, protection and cosmic energy. On the Two of Cups, the caduceus sends a positive message for new partnerships, and suggests that with honour, respect and balance, new relationships shall be rewarding. At the top of the caduceus is a lion’s head, a symbol of passion and fire energy suggesting that there may be a lot of sexual attraction between the people, although that may or may not be allowed to express itself. The two snakes that wind up the caduceus represent dark and light and their coexistence within us.',
	         upright: 'The Two of Cups shows the beauty and power that is created when two become one. The card reflects balance, mutual respect and harmony in relations with one another. There is no ‘I’, just ‘we’, and both parties are focused on a mutually beneficial outcome or win-win situation.\n\nThe Two of Cups typically points towards a relationship that is based on mutual attraction and romantic inclinations. It reflects the clear, nurturing, supportive and heartfelt exchange of emotions that is the gift of a romantic relationship. The Two of Cups represents love that is nurturing, creative, clearly focused, inspirational and equally fulfilling. In a reading, this is often a beautiful start to a new romance in which you will experience understanding, harmony and deep love between two souls. The seed has blossomed into a tree of appreciation. Kindness and thoughtfulness will bind your two hearts together with the feeling of being simultaneously very special to one another.\n\nIn some cases, the Two of Cups can refer to marriage, proposals and engagements, particularly as this card portrays what looks like a wedding or hand-fasting. It is a reflection of commitment between two individuals, to say that they will go through life together, always considerate of each other’s needs and wishes.\n\nOutside of love, the Two of Cups reflects a partnership of sorts, be it a business partnership, friendship or even a relationship between a person and their pet.\n\nOn first glance, the Two of Cups shares a similar message to the Lovers. However, the energy of the Two of Cups is slightly weaker than the Lovers card. Whereas the Lovers is the reunion of two complete beings, the Two of Cups is a less mature union that, stable as it may seem, does have the potential to come undone over a longer period of time. So, while the union is strong now, it is not clear whether the relationship shown by the Two of Cups can stand the test of time. Only the two people involved can decide that.\n\nDespite the focus on the two beings shown on this card, the Two of Cups also points to what is happening within the individual. To be truly loved, deeply treasured and valued highly by others, you must first and foremost strive to create those feelings for yourself. That is, when you work toward loving yourself, you hold your inner spirit in high regard, treating it with deference and deep respect. When you see yourself in this positive light, other people cannot help but respond to your personal sense of value in an equally positive manner.',
	         reversed: 'With the Two of Cups reversed, you may be struggling to form new partnerships and relationships due to a lack of trust or unfinished business from the past. You may also be reluctant to open yourself and expose your true feelings, resulting in disconnectedness from those around you or awkwardness. Your behaviour has become guarded and constrained.\n\nThe Two of Cups reversed may indicate a break-up or a lack of harmony within a relationship or partnership. You may not be seeing eye-to-eye and there is tension in your relations with each other. Each partner is finding it quite hard to be truly honest with each other and therefore the flow of communication is broken. There is a lack of mutual respect and understanding. Upright, the Two of Cups is a beautiful card to have because it shows balance and emotional connection. But reversed, it suggests that you are not on an even playing field and this is a fundamental issue. It is as if your partner thinks he or she is better than you or that his or her opinion matters more than yours.\n\nEven if a relationship is going great guns, the reversed Two of Cups may be a sign that the relationship is more physical than heart-felt. It may be a fleeting affair rather than something more meaningful.'
	      }
	   }, {
	      name: 'Three Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/52_Cups03.jpg',
	      keywords: {
	         upright: 'Celebration, friendship, creativity, community',
	         reversed: 'An affair, “three’s a crowd”, stifled creativity'
	      },
	      description: {
	         basic: 'The Three of Cups is a card of celebration and accomplishment. Three young maidens dance in a circle with their golden goblets upraised in a toast of joy. Their arms reach out to each other and they connect through their emotions and their friendship with one another. The ground is covered with fruit and there is a general sense of abundance and happiness. Each woman in the Three of Cups has a wreath of laurel on her head. Wreaths of this type have long been a symbol of victory and success. A sweet smelling laurel wreath is also a symbol of protection, peace and purification and is a message that the favour of the Universe is upon us, and that we shall be the victor in this stage of our lives. At the women’s feet lie various flowers, symbolising joy, beauty, compassion and growth. The flowers remind us of the good times in life, the sweet smell of success, and the beauty that surrounds us if only we open up to its presence.',
	         upright: 'The Three of Cups is representative of friendships and collegiate, harmonious relationships. It is a time when you are open to helping others, which in turn means that others are open to helping you. It is about spending quality time with your loved ones and your friends.\n\nThis card reminds me of the wonderful connection and friendship that exists between the four female characters in “Sex and the City” – Carrie, Charlotte, Samantha and Miranda. They stand by each other, through thick and thin, and they are always there for one another as they make their way through various relationships, careers and other life journeys. Nearly every episode, they can be found enjoying each other’s company, often over a Cosmopolitan or another fancy New York cocktail. You get the feeling that these girls will be friends forever and will know that they can always count on each other for support and compassion.\n\nYou may find that by turning to your female friends, you receive the love, support and compassion you need right now. Your close circle of friends may be a mothers’ group, old school friends, a women’s networking group or a collection of friendships that you have built up over the years. There is a oneness shared between your close friends and you, and there is a general feeling of sensitivity and sympathy with one another.\n\nThe Three of Cups heralds a very sociable period. You will find a harmonious balance between meeting your commitments and spending quality time with friends and family. This is a great time to let your hair down and indulge yourself a little! You may be particularly drawn to the bar or restaurant scene, indulging in great food, wine and cocktails! You may also be celebrating something special, such as a birth, engagement, wedding, re-union, or birthday.\n\nFor the moment, even though life’s problems go on, you can take time out to forget about the hassles of the everyday world and enjoy the company of your friends and loved ones. Such respites are often needed before and after periods of high stress, to stop you from getting burned out emotionally or physically. When this card appears and you are experiencing a high level of stress, take some time off to recuperate, and gain the support of friends before returning to ‘reality’.\n\nMore broadly, the Three of Cups indicates the end or conclusion of any problems you have been experiencing, particularly those that relate to your interactions with others. A compromise will be found which will serve all the interests of those involved and will allow for a more harmonious environment. You can facilitate this process by bringing about positive change within yourself and changing your attitude and the way you react or deal with what is happening. Treat the situation with compassion and give the benefit of the doubt where possible.\n\nThe Three of Cups represents community and groups of people coming together to focus on a common goal for the greater good of others. You may find that by reaching out to others and banding together, you can achieve a huge amount in terms of sharing your positive energy and passion with others, benefiting the wider community. It is a sign that you should seek out other people to celebrate your successes along with you.\n\nThe Three of Cups is also a very creative card, suggesting that you may pursue a creative outlet within a group environment, such as an art class or a dance class. This is a great way to connect with others and to access your creative abilities.',
	         reversed: 'Out of all the different readings that I do, more often than not I see the Three of Cups reversed come up in relationship readings when there is a third person involved. Often it is a reflection that you, the querent, are that third person and may be involved in an affair or dealing with an unfaithful partner. When this card appears in a reading, look to the other cards for more detail on the nature of the relationship. If you see the Seven of Swords, there is a likely betrayal of trust and possible cheating; if you see the Five of Swords, it is likely that you already know about the other relationship but you are trying to ignore that it exists; if you see the Devil, think carefully about the nature of the relationships as they are likely to be hedonistic and generally unhealthy to those involved. It is unlikely that this situation is sustainable as ‘three’s a crowd’, thus something has got to give.\n\nOn a broader scale, the reversed Three of Cups can indicate that your creativity is being stifled and instead you are being forced to conform to the group in which you are operating. You may be part of a very tight-knit group that does things a certain way and is not open to innovation or alternative approaches. You need to consider whether you are willing to sacrifice your creative abilities in favour of the group’s desires.\n\nThe Three of Cups reversed may reflect isolation from others. If this is the case, it is time to take charge of the situation and to reconnect with your community. Consider joining a group or organisation, and if the need for support is present, seek out the necessary resources.\n\nSimilarly, the Three of Cups reversed can indicate that you have lost touch with your close friends, perhaps due to a falling out or other, more demanding priorities such as work or family commitments. See this card as a reminder to reconnect with your friends, let your hair down and have a good time, without worrying too much about the consequences.\n\nOn the other hand, the Three of Cups reversed may indicate over-indulgence in the party scene. You may be spending most nights out at bars and nightclubs, indulging in drugs and alcohol and throwing caution to the wind. You may also be in the ‘work hard, play hard’ mindset, when what you need is greater balance in your life. Be mindful about the longer-term consequences of your actions and ask yourself whether this is indeed a sustainable lifestyle. Take a break from the social scene to regroup and get some much needed sleep.'
	      }
	   }, {
	      name: 'Four Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/53_Cups04.jpg',
	      keywords: {
	         upright: 'Meditation, contemplation, apathy, re-evaluation',
	         reversed: 'Boredom, missed opportunity, being aloof'
	      },
	      description: {
	         basic: 'The Four of Cups depicts a young man sitting under a tree far away from others in what looks like deep contemplation and meditation. In fact, he is so engrossed in deep contemplation that he does not appear to notice the cup being presented to him by an outstretched arm. A further three cups stand at his feet, symbolising the world and its attractions but again, he pays little attention to these. In this sense, he indicates the need to look deep into our Self to discover the answers we seek. External influences can be distracting and may not lead us to the goal we seek even if those influences purport to be of a spiritual nature./n/nThis young man and his predicament suggest the story of the Buddha under the Bodhi Tree, contemplating the state of the Universe and unwilling to rise until he has reached the Truth. He is not taking the cup and indeed appears to be paying no attention to it whatsoever. He misses this gift of love and opportunity because he’s completely tuned within.',
	         upright: 'The Four of Cups often appears when you are bored or dissatisfied with the status quo. You may be feeling disengaged, apathetic, or unmotivated. Life has become stale or ‘flat’ and there is little that excites you anymore. To overcome this, the Four of Cups suggests a need to re-evaluate your situation and to look deep within your own psyche to find understanding and meaning. Turn your attention inward to find the Truth for which you are searching. Avoid distractions and examine your heart and mind to gain clarity.\n\nSimilarly, the Four of Cups signifies disappointment in someone or in a situation. You may be growing tired of the same old struggle that has been carried on too long in the past. As a result, you have started to withdraw and go within yourself to seek greater peace and tranquillity. If you are becoming particularly ‘pouty’ or sulky about your predicament, the Four of Cups is then a call to action; it is time to wake up, be alert and to be open to new experiences that offer a more positive outcome.\n\nThe Four of Cups can sometimes point to defensiveness. This can be noticed in the body language displayed in the crossed arms and legs of the man on the card. He chooses to ignore the possibility of what the cup has to offer. Possibly he has been hurt emotionally before, as this is the Suit of Cups, and he is fearful to expose himself to that again, hence he is closing himself off to this opportunity. Consider what opportunities you are ignoring or declining, and ask yourself whether this is because you truly believe you would not benefit from it, or whether this is because you are fearful of what may follow. Be mindful of any defensiveness in your responses and reactions.\n\nAt its worst, the Four of Cups is a stubborn, ungrateful and self-absorbed card. Whether you are off in your own little world, depressed, selfish, afraid to reach out or are nursing wounds from a bad relationship, the isolation in your world is self-imposed. You may be only concerned with your own troubles and problems, neglecting the needs of others. Be mindful that your detachment from being part of the world is becoming an issue. Remember, there is always an opportunity for you to reconnect with the world around you. Look at that cup being offered to you!\n\nOften, the Four of Cups indicates that an offer has been presented to you but you are holding off making any sort of decision or evaluation of that opportunity until you have had more time for reflection and consideration. Notice that while the man in this card has not accepted the offer being presented to him, he has not completely rejected it either. The cup will continue to be there and the decision to accept or reject it can be made at any point. For now, though, it is the time for contemplation, research and meditation. When all of the answers are in, and it feels right emotionally, then you can take action but in the short-term, you do not need to make an immediate choice.\n\nThe Four of Cups serves as a reminder not to take life for granted. Numerologically, four signifies that you have created a solid foundation for yourself and a strong sense of stability and security. However, sometimes this can play to your disadvantage, where you feel so content, safe and secure that you begin to take your relationships and other aspects of life for granted. Thus, when the Four of Cups appears it must be taken as a cautionary note. It bears the message that there is a lot of love in your life but it can and will slip away if you do not continue to nurture it and demonstrate your appreciation for everything that you have gained so far. Most of the time, people do not realise the abundance they live in every day. They are too concerned with what they want, and they have no time to look at their lives and see how much they already have. A lot of the disappointment in life comes from people who want more but who already have all that they need. The key to overcoming this disappointment is simply to see all the good that is in your life already, and be thankful for it every day. So open up your eyes and look for yourself!',
	         reversed: 'The Four of Cups reversed suggests that there is a good possibility that an offer will come your way but you must work hard to go out and get it. It is sitting right under your nose, so make sure you snap it up before you miss out! You may also be too focused on your own issues that you completely miss this opportunity or are unaware that it even exists. Keep your eyes and heart open to new possibilities, and release some of the focus on yourself to allow new opportunities to appear.\n\nThe Four of Cups reversed also reflects a time when you may be reluctant to open your heart to someone or to express your true feelings, instead withdrawing and isolating yourself from the other person. Be mindful of how this may be impacting those who are close to you and be considerate of their needs as well as your own.\n\nOn a more positive note, if you have been going through a period of stagnation, boredom or apathy, you will begin to feel restless with this state of being, and will want to break free from this rut. Put aside any negative thoughts or sulky behaviour. Embrace the opportunities that are already being offered to you. Reconnect with others and let them know how much you appreciate them.'
	      }
	   }, {
	      name: 'Five Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/54_Cups05.jpg',
	      keywords: {
	         upright: 'Loss, regret, disappointment, despair, bereavement',
	         reversed: 'Moving on, acceptance, forgiveness'
	      },
	      description: {
	         basic: 'The Five of Cups is a card that signifies difficulty, loss, and the challenges of dealing with that loss. The figure in the card wears a black cloak in which he hides his face in apparent despair. At his feet are five cups, three of which have fallen and spilled onto the ground and the other two behind his back remain standing. He does not seem to notice these upstanding cups because he is so focused on the fallen cups instead. Ahead of him a powerful river flows between himself and a castle or home in the distance. To his right is a bridge that can lead him to the security of the house across the river. Despite the fact that this card has a strong indication of loss and tribulation, there is a positive aspect that must be considered. Is your cup half full or half empty?',
	         upright: 'The Five of Cups represents a lack of fulfilment or non-attainment of expected results. You are feeling disappointed that a situation has not turned out as you had hoped, and instead of moving on to greener pastures, you are wallowing in self-pity and regret about what has been lost. The water spilled from the cups shows that the cause for regret is more emotional than financial. You are quickly becoming disillusioned with life and increasingly pessimistic about your future.\n\nThe Five of Cups suggests that you are having trouble letting go of the past and learning from your mistakes. This card can often reflect a person who is caught up in the past and unable to move on, missing out on new opportunities. Bitter memories from the past continue to bother you, and often a great deal of the blame for past actions is placed on yourself and your inadequacies. To some it would seem that there is no way out of this situation but the Tarot always shows problems on one hand and solutions on the other.\n\nForgiveness and the ability to recover after emotional loss are necessary. If you are feeling disappointed by another person’s actions, and then find it within your heart to forgive that person, releasing yourself from the disappointment. You may also need to re-assess your expectations that have led you to this disappointment. Were you expecting too much?\n\nRemember, too, that hindsight is much clearer than foresight and present-day wisdom is gained from the mistakes of the past. Reflect on what lead you to this point and understand what important lessons you can take from the experience. Even when things go pear-shaped, there is always something positive that can be gained by reflecting on the lessons learned.\n\nWhile it is true that much has been lost, there is still a ray of hope because some of the cups in this card remain full and upright. You must not pity yourself when you find yourself in his situation. Instead of looking at the situation from a ‘glass is half empty’ perspective, look at it from a ‘glass is half full perspective.',
	         reversed: 'The reversed Five of Cups shows recovery from regret and an acceptance of the past. Now, you are beginning to realise the full implications of the past and you have come to appreciate the lessons learned from the experience. You may even recognise the value of the painful experience in the broader scheme of things in preparing you for later experiences. You are ready to pick up the remaining two cups that are full of the water of emotional growth and go on.\n\nThis card is also about learning to be open and to take risks again. It is a card of a lingering sense of regret, nostalgia and bittersweet memories but the card itself speaks of being hopeful for the future, getting over whatever you need to get over, and of seeing the sun peek through the clouds once again! If you have suffered a broken romance, the reversed Five of Cups signifies an end to the suffering, and a beginning to new loves and relationships, new interests, and new emotional outlets. You are starting to engage with the inspiring, creative and feeling side of life again.\n\nThe reversed Five of Cups is about values and knowing what you truly want and what will really make you happiest. It is about the hidden blessings that lie behind obvious disappointments. Sometimes disappointments are required to see through illusions and free you to find what is truly of value in life. Once you have made this transition, you will be free to embrace new opportunities.\n\nSometimes, the reversed Five of Cups indicates a feeling of being trapped in the past, holding on too tightly to the might-have-beens, and not being able to focus on the positive. The reversal could also indicate buried feelings of regret, that you are not allowing to surface and therefore they never get dealt with and brought to closure. Five is also the number of change, and indicates an emotional destabilisation that is intended to create change in how you approach your life.'
	      }
	   }, {
	      name: 'Six Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/55_Cups06.jpg',
	      keywords: {
	         upright: 'Reunion, nostalgia, childhood memories, innocence',
	         reversed: 'Stuck in the past, naivety, unrealisticOn the Six of Cups, there are six cups filled with white, five-pointed flowers. A young boy seems to smell one flower, offering this filled cup to another young child. The small child symbolises the past and the taller child symbolises the future, and together they symbolise happy reunions with past friends or lovers. They share old pleasures with lots of nostalgia. In the background, there is an older figure walking away, symbolising our worries leaving us to be locked in the turret. The house symbolises comfort and security but the barren garden symbolises the lost happier times of the past. Everything is bright yellow which indicates great happiness in this overall scene.'
	      },
	      description: {
	         basic: 'On the Six of Cups, there are six cups filled with white, five-pointed flowers. A young boy seems to smell one flower, offering this filled cup to another young child. The small child symbolises the past and the taller child symbolises the future, and together they symbolise happy reunions with past friends or lovers. They share old pleasures with lots of nostalgia. In the background, there is an older figure walking away, symbolising our worries leaving us to be locked in the turret. The house symbolises comfort and security but the barren garden symbolises the lost happier times of the past. Everything is bright yellow which indicates great happiness in this overall scene.',
	         upright: 'The Six of Cups is a card of childhood, nostalgia, naïve happiness, and generosity. You want to return to the happy memories of your past, whether as a child, teenager or adult. Oftentimes, though, these memories are indeed a thing of the past and reflect aspects of your life that have since vanished. You may feel that the only way to connect to this happiness is to escape into the past where you can reflect on your happy and beautiful memories, instead of dealing with current challenges. This is fine if you are simply taking a walk down memory lane but it is important that you live in the present and accept your current circumstances rather than always living in the past.Oftentimes, there is nothing wrong with looking back at the good times for inspiration when things are not going so well. In the midst of change and crisis, the Six of Cups suggests that looking back at what you have endured is a good way to assure yourself that, whatever trials lay ahead, you will meet them and you will overcome them as you overcame others. After losses such as those on the Fives, the Six of Cups suggests that you need to take time out to heal, look back on the past and all the good that lies there. During this period of reflection, there is no need to focus on the negative. Instead, bring all of the positive energy from the past into your present and your future. The fallen cups are now full and upright again but with blooming flowers that cannot be spilled or washed away. Now that you have looked back, the way forward will be clear and enlightening.The Six of Cups can represent a return to a familiar environment or to a childhood place. You may return to your home town, to your parents’ house, to your high school or even kindergarten. You could be going to a high school reunion or reconnecting with a childhood acquaintance. A teenage sweetheart or past lover may turn up again. Allow yourself positive, nostalgic memories of childhood, friends and family. If you can, spend time with younger people.The Six of Cups can also point to your inner child and suggests a need to experience child-like joy. The child you were still lives within you and must be cared for. This is often referred to as working with your inner child. People with persistent problems such as addiction, depression, troubled relationships and chronic dissatisfaction can transform their lives with inner child work and find a new joy and energy in living. The source of your problems may be in past events that are triggered in the present. We are made up of many parts and inside we still have the little child and adolescent we were with all of its experiences and feelings. This can lead to the inner child reacting strongly to certain experiences, situations and feelings in the present, based on experiences of the past. Working with your inner child and getting to know where these feelings come from can change that and enhance your choices in miraculous ways. When we are being playful, spontaneous, creative, intuitive and surrendering to the spiritual self, our genuine authentic Self, who we know deep within us, our real Self is being welcomed and encouraged to be present.The Six of Cups can also refer to children in your life. It can denote a pregnancy, birth or adoption, depending on the other cards in the reading. Or, it may indicate that you are about to spend more time with young children, playing, laughing and learning together. Children play a significant role in your present life, and can serve as great advisors. Children are good role models to follow when this card is present. They see the world as a completely perfect place and their hearts are open to experience the myriad pleasures of the world around them.The Six of Cups almost radiates an aura of joy, because it represents the past with all its memories, the present with all its gifts, and the future with all its wondrous opportunities. The Six of Cups can thus signal a gift given or received, or some other similar gesture. You may be inspired to act kindly or charitably, or to do a good turn for another person. You are more open to sharing what you have and being well-intentioned.',
	         reversed: 'The Six of Cups reversed may indicate that you are clinging on to your past. There may be issues from your past that you have not yet fully processed. It is important to explore the memories of your past but do not get stuck there. Your ideas and beliefs that were established in the past may be prohibiting your progress. Use your past as a guide for your future, and focus on living in the present.\n\nThe Six of Cups is a card of nostalgia, childlike love and generosity, and a carefree, naïve outlook on life. Reversed, it suggests that you may have had unrealistically rosy ideas about a particular stage of life, based on your dreams and ideals from when you were younger. For example, you may have always pictured yourself as married with children by 25, only to realise that once you hit 25, you had other goals in mind. Or you may be disappointed that you have reached a particular age but have not fulfilled your childhood dreams just yet.\n\nThe Six of Cups reversed can indicate fertility issues and problems with bearing children. If you already have children, there may be disciplinary issues that you are trying to get under control.\n\nSometimes, the reversed Six of Cups can indicate child abuse or sexual abuse sustained as a young person. You may still be working through these issues and trying to release yourself from the harmful memories. Alternatively, you may be working with others who have repressed memories from their childhood and who need your support.'
	      }
	   }, {
	      name: 'Seven Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/56_Cups07.jpg',
	      keywords: {
	         upright: 'Fantasy, illusion, wishful thinking, choices, imagination',
	         reversed: 'Temptation, illusion, diversionary tactics'
	      },
	      description: {
	         basic: 'The Seven of Cups depicts an individual faced with the mysterious appearance of strange images from cups in a floating cloud. Clouds conjure ideas, dreams, thoughts, illusions, transitions and mystery. Though the character’s back is toward us, we can see from the half-raised arm-gesture that the apparitions before him are something of a surprise. The various prizes appearing from the cups are a mixture of positive and negative visions. These cups each have a single item rising from them – a snake, representing wisdom and knowledge; a shrouded figure, representing the need for illumination; a human head, representing a companion for the conjurer; a tower, representing stability and power; treasure, representing abundance and wealth; a laurel wreath, representing victory or honour, and status; and a dragon, representing supernatural forces. The character faced with these spectres is taken aback by their confusing nature. Although the seven cups appear as gifts or prizes, there is always danger hidden within one or two of them to sting anyone who ventures near. What this suggests is that sometimes you have to choose between many options, all of which may be tempting but only one of which is the best choice. At others times not all of those choices are real options at all; they are delusions of the imagination.',
	         upright: 'The Seven of Cups indicates that the images in your mind must be dealt with not only in your dreams but in the world of reality. Be careful of wishful thinking or illusions in the choices you currently face. The character in the Seven of Cups is a dreamer who is able to see beauty and excitement as well as fearful trials and difficulties in the future. If you are constantly caught up in your own dreams, fantasies, and/or fears, we will never be able to move forward and make those dreams a reality or overcome those fears.\n\nTherefore, the Seven of Cups indicates that although dreaming is beautiful and provides inspiration for action, you must at some point abandon your ‘castles in the sky’ and begin to build those castles in your real life. A choice must be made even though the apparent multiplicity of options seems to paralyse you with either fear or excessive anticipation. If you are unable to make a decision because of too many options, it is time to carefully evaluate the pros and cons of each option and make a thoughtful choice. You also need to be very clear about what it is you are working towards so that you can make the best choice. Make your decision with caution as all is not what it seems to be. Great opportunities may turn out to be major problems later on, while less enticing options may turn out to be golden opportunities.\n\nWith the Seven of Cups, there is a risk of illusion. You need to separate what is real from what is illusion. Protect yourself against unclear or wishful thinking and habitual day dreaming. Avoid intoxication and escapism.\n\nOftentimes, this card shows choices and plans that have little or no basis in reality. Such things are typical of the developed imagination, and fine if they stay in the imagination. However when you try to implement those ideas in the real world you are leaving yourself open to inevitable disappointment when you realise that your vision simply does not work.\n\nThe Seven of Cups is also a wish card. Each of the cups is filled with wishes such as wealth, beauty, success, and a nice home (the castle or tower). However, not every cup is filled with a positive result. Some cups holding a snake or a demon and thus the Seven of Cups can be a mixed blessing. Be careful what you wish as you may just get it, and at a price.\n\nTemptation is associated with the Seven of Cups. With so many choices presented to you, it is easy to be swayed to that cup containing the snake of jealously and cunning. Since this card is from the suit of Cups, the temptation is likely to be sexual or emotional in nature – the one-night stand, the extramarital affair, and all those other things that seem innocent and pleasurable at the time they are undertaken. But in the vast majority of cases, the pleasure gained temporarily is far outweighed by the consequences that last, in most cases, for an entire lifetime.',
	         reversed: 'The Seven of Cups reversed is a card of illusions, temptations, and diversionary tactics. Your views of life at this time are a bit illusory, and may tend toward fantasies that cannot actually be realised in the real world. There is an unwillingness to deal with the day-to-day reality of life, and a need to get your head out of the clouds. You may be feeling unclear about what you are really searching for in order to become fulfilled. You may also be hiding something from yourself that probably has to do with your subconscious emotions. These illusions and diversions need to be stripped away and seen for what they really are. You may find that returning to the energy of the Six of Cups and finding yourself in more familiar territory, such as the family home or the area in which you grew up, may have a calming effect.\n\nThe Seven of Cups reversed can suggest that you are refusing to examine yourself and to ask yourself what will truly fulfil you. Instead of taking a few quiet moments to reflect, you are using every waking hour to consume yourself with the active pursuits of things which may or may not satisfy you. You need to stop and give yourself some time and space to think carefully about where your best intentions lie.\n\nOn a more positive note, the reversed Seven of Cups can indicate a time when you are finally breaking through a fog of confusion and illusion to focus on your chosen goal. With resolution and purpose, you are now setting your intentions and finding solutions.'
	      }
	   }, {
	      name: 'Eight Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/57_Cups08.jpg',
	      keywords: {
	         upright: 'Escapism, disappointment, abandonment, withdrawal',
	         reversed: 'Hopelessness, aimless drifting, walking away'
	      },
	      description: {
	         basic: 'The Eight of Cups is a card of change and transition. The card evokes an immediate reaction of sadness and a sense of solitude. The young man in this card has turned his back on all he has accumulated or accomplished before. He disappears by night into a barren and difficult terrain with only a cloak on his back and a staff in hand. The character in the Eight of Cups has lived and experienced life’s joys and sorrows. His journey is undertaken because of a sense of restlessness and unhappiness experienced as the result of achieving all he has desired, yet finding those things to be less fulfilling than expected. This individual has chosen to forsake the familiar and the comfortable in the pursuit of higher goals. He is embarking upon the spiritual journey because he has not found deep satisfaction in the things of the world, the things with which he is familiar.',
	         upright: 'The Eight of Cups indicates that it is time to ask yourself what you can do to bring a deeper satisfaction and joy to your life beyond the obvious pursuit of material satisfaction and/or physical enjoyment. You are seeking deeper meaning to life and focusing in on your personal truth. You want to escape from the ‘rat race’ and pursue deeper, more spiritual goals at this time. You are willing to let go of your material possessions in favour of something more meaningful. Thus, the Eight of Cups is often reflective of the start of a journey of discovery, particularly on a spiritual level.\n\nThe Eight of Cups also indicates that you are disappointed enough to walk away from everything you have built up so far. It could indicate a disappointment in love or dissatisfaction with material success. It could also indicate that you have over-extended yourself to the point of emotional exhaustion. Even though you have already come so far, you feel that you can no longer go on and your only choice is to walk away from the situation. You feel disappointed with yourself but you know that this is the right thing to do before you completely burn out. You may also be feeling that you are giving too much and not getting nearly enough in exchange.',
	         reversed: 'The reversed Eight of Cups suggests that you may be feeling confused about where your best options lie. Part of you wants to explore new horizons and possibilities but another part of your fears that in doing so, you will miss out on what your current circumstances have to offer.\n\nThe Eight of Cups reversed also represents knowing when to walk away from a situation that is ultimately not working for you. Even though there are some fundamental issues that have not been resolved, you know that no matter how hard you try these will probably never be resolved. It hurts you to have to walk away with this lack of closure but you know this is what is needed right now. Sometimes, however, there may be a lack of commitment to walking away, whereby one day you are ready to leave and by the next day you are having doubts and wanting to stay.\n\nThe reversed Eight of Cups can reflect hopeless, aimless drifting from one place to the next by someone who cannot stand to be confined to just one setting or someone who never quite fits in. You may fear intimacy and have difficulty making and keeping your commitments. When things become too difficult, you quickly escape and leave behind your troubles, rather than dealing with them head on.'
	      }
	   }, {
	      name: 'Nine Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/58_Cups09.jpg',
	      keywords: {
	         upright: 'Wishes fulfilled, comfort, happiness, satisfaction',
	         reversed: 'Greed, dissatisfaction, materialism'
	      },
	      description: {
	         basic: 'In Nine of Cups, a portly, middle-aged man sits upon a wooden bench with his arms crossed in contentment. He is dressed smartly and wears an expression of true satisfaction on his face and his red head-dress symbolises an active mind. Behind him is a wall with nine golden cups arranged in a structured, well-organised arch. The man enjoys success both materially and spiritually and represents the fulfilment realised after the accomplishment of our deepest desires.',
	         upright: 'Nines represent personal integrity and completion, or the final stage of development. This final stage may bring certain problems with it, and past experiences and methods of coping become important here and are an intrinsic part of the meaning attached to the nines. Thus, the Nine of Cups shows a tendency to daydream and enjoy the pleasures of life. You are likely to spend more time thinking about big ideas and grand schemes for an ideal lifestyle than doing the work you need to do right now to execute those ideas. While it is good to ‘think big’, you also need to balance this with action to ensure that you can fulfil your dreams.\n\nMore generally, the Nine of Cups reflects happiness in all areas such as health, finances, work, luck, love or relationships. After the difficult choices of the Seven and the stagnation of the Eight, the Cups suit starts to balance out with the Nine. One of the most positive and uplifting cards of the entire deck, the Nine of Cups shows satisfaction on all levels – emotional, physical, and sensual. It is no wonder that many Tarot readers refer to this card as the Wish Card as its appearance is often taken as a sign that, whatever your heart’s desire, it shall be granted in the coming days or weeks. Know that you have paved our own way on the path to success.\n\nAs a Cups card, the Nine usually refers to an emotionally fulfilling situation, such as the strengthening of a romantic bond, the solidification of a friendship or the consummation of a sexual relationship. It shows that joy and happiness are within your grasp. In fact, you probably already have them. It is a sign to enjoy the abundance of life and to feel each of your emotions as if you had never felt any of them before. See the perfection all around you.\n\nThe Nine of Cups is also about counting your blessings, living in the moment, and enjoying the good things that life has to offer. Start or end every day by creating a mental list of the three things you are most grateful for. You will find that over time, you indeed have a lot to be happy about and it may increase your feeling of deep contentment and fulfilment.\n\nThe Nine of Cups represents stability and advancement. This card signals delight and pleasure, contentment with what you have accomplished so far and forms a steady foundation for the future. Your worries are all in the past and you can look forward to a bright future.\n\nThe man in the Nine of Cups also appears to have a certain smug look on his face. This suggests that you can relish in the fact that you are about to finally achieve what you set out to achieve. Do not be too shy or modest about it either! Indulge yourself in knowing that you have worked hard to get here and you have achieved the results you had hoped for.\n\nThe Nine of Cups can also indicate splurging and indulging in life’s luxuries. This includes enjoying good food and wine, appreciating the arts, making love, relaxing in a beautiful resort, or experiencing beauty. Of course, balance is needed to ensure that you do not become lazy or greedy but generally the upright version of this card suggests that this is more a time of enjoyment than of suffering the negative consequences of such enjoyment.',
	         reversed: 'The Nine of Cups is a card of satisfaction and wishes. When reversed, it suggests that you may be disappointed that your wishes are not materialising as expected. Your expectations may be unrealistic or you may not be actively pursuing your dreams, instead hoping that they will manifest with little input or action from you.\n\nOn a more emotional level, the Nine of Cups upright typically indicates a wonderful feeling of satisfaction you get from knowing that everything has fallen into place and you have everything you could imagine. Reversed, however, there is a sense that there is still something missing deep down, and the inner fulfilment you have been seeking is still not present. There may be disappointments due to imperfections and mistakes, smugness, overindulgence, greed, superficial or materialistic values, shallowness, gluttony, and excessive preoccupation with gratifying your own desires, often times at the expense of the needs of others.\n\nPhysically, the reversed Nine of Cups can indicate ill-fortune due to over-indulgence in food, alcohol or drugs and the consequences that come with them. Be careful not to overdo the sensual pleasures and instead demonstrate some moderation in your indulgences.\n\nThe reversed Nine of Cups can suggest greed and a lack of concern for other people’s needs in favour of your own. You may have an inadequate regard of how your behaviour is impacting others, and are often found gloating or boasting about your successes while others are suffering. Be considerate, and even if you have something to rave about, think about the impact that may have on others.'
	      }
	   }, {
	      name: 'Ten Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/59_Cups10.jpg',
	      keywords: {
	         upright: 'Harmony, marriage, happiness, alignment',
	         reversed: 'Misalignment of values, broken home or marriage'
	      },
	      description: {
	         basic: 'On the Ten of Cups we see a loving couple united by the bonds of true, everlasting love. They not only have each other but all that they wish for in life as well, represented by the two children frolicking at their side and the small but comfortable home in the distance, surrounded by trees and water. The family home symbolises stability and homely comforts, while the green garden symbolises fertility and the river symbolises a free flow of feelings. A rainbow of cups is overhead, blessing the scene. The cups symbolise an abundance of heavenly gifts and the rainbow signifies the end of hard times and is also is considered to be a highly spiritual omen in many of the world’s religions. It is a sign that the idyllic scene we see represented has been blessed from above and reinforces the idea that the achievement of perfect love is one sure way of experiencing the glory of the heavens here on earth.',
	         upright: 'The Ten of Cups embodies happiness, joy, contentment and emotional fulfilment, particularly in the area of your relationships and family. It represents almost an idyllic state of peace, harmony and love where all your dreams and wishes have come true and you are delighting in your good fortune. Given it is a Ten, this card indicates attainment of this idyllic state so stop for a moment to appreciate everything that you have accomplished and be incredibly grateful for the blessings that fill your life right now.\n\nWith the image of a happy family and a comforting home in the background, the Ten of Cups is indicative of a harmonious and loving family life. All family members are getting along with each other and there is a lot of happiness and love shared. No-one is fighting or causing any tension. Instead, it is an environment of peace and happiness that lends itself to warm and loving relations. The presence of the Ten of Cups may even reflect an upcoming family holiday where you can rest and relax together, creating fun and happy family memories. There may be a family reunion or a family celebration where members of your extended family come together. This is a wonderful time to bond with your family and lay the foundation for a happy and harmonious future together.\n\nThe Ten of Cups is also a very positive card in terms of romantic relationships and may indicate either the beginning of a new, very happy relationship, or the ultimate satisfaction of a long-term relationship. Commitment and love are the requirements of such satisfaction, yet this card promises that with the required effort a lasting love can be built. The time will also be made for the enjoyment of pleasures, which may be shared with another person whom you love.\n\nOutside of relationships and the family, the Ten of Cups is also reflective of your personal values system and what you believe will bring you the ultimate fulfilment and happiness in your life. This card represents a time when you are very clear on where your personal beliefs and values lie and you have successfully created a life that is aligned to those values. It may reflect a spiritual or religious person who lives in peace and harmony. It may also reflect strong family values that were instilled within you early in life which are now helping you to create a fulfilling lifestyle.\n\nThe Ten of Cups encourages you to follow your heart and go with your intuition about where the best opportunities lie. As an intuitive person, you know that you can trust your gut feeling to guide you. When you feel truly happy and inspired about something, you know that that is the way to go! Aim to seek out opportunities that make you feel fulfilled and that are aligned with your personal values, rather than simply following the path that others expect you to take. You have to do what feels right to you and you only.',
	         reversed: 'Upright, the Ten of Cups is a card of happy families and deep love and respect for all involved. Reversed, however, something is getting in the way of this perfect picture and the emotional connection is being blocked. You may have been hoping for some special time with a loved one but it feels as if everything is falling apart at the seams. You may be quarrelling, not spending enough quality time together or not really respecting or caring for each other. Your hopes of a harmonious relationship are being thwarted, for now. Aim to treat each other with respect and love in order to restore harmony and peace to your relationship. Focus on how you can treat others with compassion and respect, in order for them to eventually follow suit and give you the same treatment.\n\nThe Ten of Cups reversed can also highlight when there is a misalignment of personal values. You are not living by your personal values and you are not being true to yourself. You are allowing others to determine what will and will not make you happy rather than looking within for that source of fulfilment. As a result, you are questioning whether you really believe in what you are doing. While you are madly rushing around trying to get things done, it is also very important that you address any lingering issues of values alignment with what you are doing; otherwise this may become a showstopper later down the track.\n\nThe reversed Ten of Cups may also suggest that you are neglecting your family while you pursue more material goals such as progressing your career or making more money. Your work/life balance is out of whack and you are spending less and less quality time with your family. You need to be clear about where your personal values lie and what is truly achievable. If you continue to neglect your family, you will find that relationships will suffer and you may not be able to achieve an overall sense of contentment and happiness as planned.'
	      }
	   }, {
	      name: 'Page Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/60_Cups11.jpg',
	      keywords: {
	         upright: 'A messenger, creative beginnings, synchronicity',
	         reversed: 'Emotional immaturity, creative block'
	      },
	      description: {
	         basic: 'The Page of Cups, like the Pages in all the suits, represents some sort of beginning or renewal. The Page of Cups is dressed in a blue tunic with floral print all over it and sports a bohemian type of beret on his head with a long, flowing scarf attached to it. The young man stands alone on the seashore with a single golden cup in his hand. Surprisingly, a fish pops its head out of the cup and looks at the young man. The young man simply expects to raise his cup for a toast or a drink, and instead is confronted with the ominous appearance of a fish, which even appears to be speaking to him. The Page of Cups indicates the surprising and unexpected nature of inspiration that comes to us from the realm of the unconscious and the spirit. Inspiration is seen to be something which comes upon us most unexpectedly and often in a manner which we do not understand.',
	         upright: 'The Page of Cups signifies the beginning of a creative project or venture. It is an indication that there is creative energy trying to burst forth into your consciousness. Explore this newfound creativity through art, drama, dance, etc.\n\nYour unconscious mind is also trying to speak to you, possibly through your dreams or through synchronistic encounters with significant people. The message to be taken is that you must be open to the unexpected, occasionally bizarre impulses of the creative spirit and not shut out inspiration simply because it does not fit in with a rational point of view. The Page of Cups may also be an indication that your intuition is very sharp and you may receive messages from your unconscious mind. You may be more inclined to act on a hunch or have a psychic experience. This is a good time to trust your intuition and your gut feeling.\n\nOften, the Page of Cups heralds a positive message or news from loved ones. You may hear about the birth of a child, an engagement or marriage, a wonderful idea or plan, pregnancy, a new relationship, travel plans, etc. This positive message is unexpected but welcomed, and you are likely to respond to the news or message in an emotional manner.\n\nThe Page of Cups suggests that you are more likely to show or express your emotions now. You may be more emotional or moved by simple things. Do not be afraid to let your feelings show and to wear your heart on your sleeve. It is ok to be sentimental and romantic. Let your heart lead the way!\n\nThe Page of Cups is like your ‘inner child’ – youthful, free, creative, intuitive and inspired. This Page has never been taught to suppress his innate emotional and intuitive power, and therefore he is a kindred spirit whose imagination is totally free, free to dream wonderful dreams and to create his life exactly as he chooses. In this way, the Page of Cups represents renewal of your emotional and creative self to allow that sense of freedom to reappear in your life.\n\nThis card encourages you to take a fresh perspective on a difficult issue and to approach that situation with benefit of the doubt, love and compassion. The Page of Cups’ appearance tells you to never stop listening to your intuition and believing in your dreams. If you cease to dream, then your dreams shall never come true because they do not exist anymore. In your darkest moments, dreams can often provide a ray of hope through with the Page of Cups can manifest. Dare to dream and all things become possible.',
	         reversed: 'The Page of Cups reversed represents someone who is immature or has emotional troubles. It can depict a person who is escaping through drugs or alcohol, or someone who is running away from reality and living in their own world. This is a person who is emotionally insecure and unable to conduct healthy relationships as he expects too much and gives too little. He is lacking in self-love and self-acceptance, and may be emotionally abusive. This person has rampant and unfocused emotions, and may therefore get his or her feelings hurt without reason. He is suspicious, self-doubting, insincere, selfish and easily depressed. This may be someone you know or even a reflection of your shadow self.\n\nYou or someone you know may also be prone to childlike tantrums and a loss of emotional control in the face of adversity. The reversal of the Page of Cups points to exaggerated emotional outbursts and a temperamental, overly dependent personality.\n\nThe Page of Cups reversed can sometimes indicate substance abuse, particularly if paired with the Devil. You may be using drugs or alcohol as a way to escape your reality and to dream about a more favourable possibility. It will eventually catch up with you.\n\nGiven the Page of Cups is reflective of your creative abilities, its reversal can indicate a creative block. Alternatively, you may feel thwarted when it comes to doing the types of stimulating, creative projects that you find really interesting but which may not bring in as much income as other things. The ideas are there but you are having trouble figuring out how to make them into reality.\n\nThe reversed Page of Cups can indicate that you are following an inclination or a hunch but with little thought about whether it is realistic or not. You may be acting without thinking or allowing your immediate desires and emotions to seduce you, particularly if they go against your common sense, such as making a promise you cannot keep or a commitment that does not mean anything to you.'
	      }
	   }, {
	      name: 'Knight Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/61_Cups12.jpg',
	      keywords: {
	         upright: 'Romance, charm, ‘Knight in shining armour’, imagination',
	         reversed: 'Unrealistic, jealousy, moodiness'
	      },
	      description: {
	         basic: 'The Knight of Cups is seen as a young knight, riding along on his white horse, holding a cup as if he is a messenger of some type. Unlike the Knight of Wands or the Knight of Swords, the Knight of Cups is not charging along but rather his horse moves slowly forward, giving an impression of calmness and peace. The horse represents power, energy, and drive, and of course the colour white is a symbol of purity, spirituality, and light. The Knight wears a cloak covered with images of fish, the symbol of the spirit, consciousness and creativity. His helmet and feet are winged, a symbol of an active and creative imagination.',
	         upright: 'The Knight of Cups is the most feminine of the Knights; although that does not mean that he is any less of a Knight. It simply implies that he is in touch with his intuition and emotions, and he uses them for his own good during his quests of romance and seduction. He is charming and attractive to others, regardless of their sex, while still expressing the romantic, poetic view of life in his unique way. He may be in love with love itself. This Knight also looks to his emotions to provide a map for his life direction. He is someone who is ruled by his heart rather than his head. When faced with a decision, he will always go with what his heart tells him, whether it is logical or not. Decisions will be made without much thought and instead they are made drawing upon inner direction, with the experience of warmth, friendliness, love and the need to share these qualities with everyone.\n\nAs with all Court Cards, the Knight of Cups can manifest as an event, a person in your life, or as a part of yourself.\n\nThe Knight of the Cups often appears as a messenger, an invitation or the arrival of someone or something with an emotional benefit. He offers an interesting invitation, which will result in an emotional experience that will bring high energy and lift you to an exhilarating state as new situations appear from nowhere. In addition to the physical sources of information, the Knight of Cups can also represent wisdom that comes from your dreams and that helps you to surmount life’s obstacles.\n\nThe Knight of Cups represents the undertaking of the creative adventure hinted at in the Page of Cups. Whereas the Page encounters the mystical fish out of the golden cup and is thus initially inspired with creativity, the Knight has already encountered his inspiration and is about to undertake the journey of imagination and creativity to which the unconscious has impelled him. If you are about to start a new creative project, direct your imagination into the ‘real’ world. True imagination feeds on ‘action’ thus if you do nothing with your dreams they will remain vague and unrelated to the rest of your life. The Knight of Cups brings a warning about getting too caught up in fantasy and the romanticism of life. Fantasy excites but it lacks any real meaning as you deny your basic commitment to the world and your imagination produces nothing.\n\nBe open to exploring your passions and your grand ideas at this time. You may find that you have been drawn to a particular passion or hobby and now is the time to start turning into ‘something’. You do not need to go at a cracking pace but it is important to balance your ideas with action and ensure that you are taking proactive steps to achieve your goals and ambitions.',
	         reversed: 'The Knight of Cups reversed allows his emotions to control his life too much. He may be moody, jealous or emotional to the point of incapacity. He may jump to conclusions before getting all the facts. If this card shows up reversed, either look at yourself and at how you are acting, or realise that the person involved may be acting from his emotions rather than from any form of logic.\n\nThe Knight of Cups reversed indicates a situation which was initially incredibly appealing, romantic and exciting but which later turns out to be something very different, and one walks away feeling quite disappointed. It is as though you are wearing the rose-coloured glasses, or going through the honeymoon period, only to come out realising that the situation is quite different to what you thought.'
	      }
	   }, {
	      name: 'Queen Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/62_Cups13.jpg',
	      keywords: {
	         upright: 'Emotional security, calm, intuitive, compassionate',
	         reversed: 'Emotional insecurity, co-dependency'
	      },
	      description: {
	         basic: 'The Queen of Cups is the Queen of the realm of emotions. She is a beautiful, introspective woman who sits on a throne at the edge of the sea. In her hands, she cradles a beautiful cup with handles shaped like angels. The cup is closed, an indication that the thoughts of the Queen originate from the unconscious, from the depths of her own soul. Wearing a gold crown and silver robe, she is alone, sitting and staring at this cup, which she holds before her with both hands on the base. The stone throne upon which she sits is decorated with images of sea-nymphs, fish, and scallop shells. The sea and fish are symbols of the unconscious mind and water in general represents emotion, spirit, and feeling. The cloudless bright blue sky and placid water of the sea surround her. Her feet do not touch the water; they rest comfortably on colourful rocks washed up in front of her.',
	         upright: 'The Queen of Cups is nurturing, caring, compassionate and sensitive. She is a good wife and a loving mother as she is emotionally secure and can connect on an emotional level with others. She is admired for her fairness and honesty, and is warm-hearted. Often a healer, counsellor or psychic, this is a woman who seems to know what is wrong even before you open your mouth. She seems to have exactly the right solution to problems relating to relationships, emotions and feelings. She easily tunes in to what you are feeling and is able to help you make sense of it in a sensitive and compassionate manner. As such, her intuition is very strong and she has a unique talent at being able to pick up on emotional energy.\n\nAs with the Court Cards, the Queen of Cups can manifest as a person in your life or as a part of yourself. She often appears as a mature female.\n\nNo intuition is more powerful than that of the Queen of Cups. She is the pure force of Water, and her connection with the subconscious is rivalled only by the High Priestess. She is often like a mirror, reflecting the hidden depths of others back to them, so they can see their own mysteries for themselves. Thus, the Queen of Cups indicates that you need to trust your intuition and listen to your inner voice. Trust the sensations and the feelings you are getting from your outside environment.\n\nWhen the Queen of Cups appears in a reading, it suggests that you need to empathise with others and to show true compassion. Focus on the emotional well-being of others rather than relying on rational or logical explanation. You are here to support and to teach others, by drawing upon your own intuition and sense of calm and emotional connectedness. Learn how those in need cope with life’s challenges and share your knowledge. Hug someone you care about.\n\nOne of the greatest assets of the Queen of Cups is her ability to sense the needs of those around her. Due to her associations with the element of water, the Queen of Cups can be passive and receptive. Her sensitivity draws those who struggle and suffer towards her. In many ways, she is a safe harbor for others. Her ability to connect on a soul level enables her to remedy the broken hearts of others. Her warmth and genuine caring make her a beacon of light. Because she is so responsive to the feelings of others, the Queen of Cups must constantly uphold her boundaries between herself and others. If not properly protected, the Queen of Cups can lose her own sense of self. This is her greatest vulnerability.\n\nThe Queen of Cups tends to think with her heart, rather than her head. She may lack common sense and rationality but she is highly intuitive and sometimes psychic and dreamy. Similarly, if you are finding that the logical approach is not working, then the Queen of Cups encourages you to follow your heart and not your mind. You may be required to turn inward and explore your emotions about a particular situation.\n\nThe Queen of Cups symbolises achievements made possible by the use of imagination and creativity. This is a woman who is highly imaginative and artistically gifted, affectionate and romantic in outlook. She is often involved in creative or literary pursuits, and enjoys art, good music, literature and things of beauty. Therefore, you may be more inclined to pursue creative projects, particularly if it acts as a form of self-expression.',
	         reversed: 'The Queen of Cups reversed suggests that you may be feeling out of touch with your emotions or that you are forced to restrict how you are really feeling deep inside. You may be struggling to express yourself effectively, instead bottling up your feelings internally. If you do not address these emotional issues, they will eventually reach boiling point. Your stress levels may increase and your ability to cope with everyday issues could suffer.\n\nThe Queen of Cups reversed suggests some dissatisfaction or feeling of disconnection from your spirituality that has arisen in your life. This may be as simple as a growing realisation that you need to find your path and get more involved on a meaningful level with others in your faith.\n\nThe reversed Queen of Cups may also suggest that you are allowing your imagination to run away with you. You mean well but unfortunately you cannot be relied on. You are letting your emotions take hold and you are not thinking clearly with your head. At its worst, the precious qualities of imagination and flowing fantasy might turn out to be weakness and thoughtlessness, turning in any direction that any wind may blow, getting lost in a dream world of unreal fantasies. You are becoming easily overwhelmed by emotion, and you are becoming moody, unstable, brooding, suspicious, and overly secretive.\n\nThe Queen of Cups reversed represents an overemotional wreck who can be driven to manipulative and vindictive behaviour. Your mood swings are making life difficult for others and you are emotionally draining on those around you. You tend to play the emotional heartstrings to your advantage. Within you, you may also harbor angst and self-loathing for your inability to do more with yourself and your talents.\n\nIn relationships, this card heralds a time when separating the emotions from any sense of sensibility may be difficult. Strong emotions may seem to take all parties on a roller coaster ride. Within projects, jobs, or workplaces, all members may feel their emotions are a little frayed from stress. With this in mind, the reversed Queen of Cups also warns against entering into any agreements with those who seem to play on your sense of guilt or pull on your emotional heartstrings, for they may not be what they seem.\n\nThe reversed Queen of Cups can indicate an over-reliance on other people’s emotional responses, which may result in a co-dependency type relationship. You may want to examine your current relationships. Is there co-dependency? Are you giving too much of yourself and not getting anything in return? This Queen nurtures for the sake of inducing dependency, and places undue importance on being in a relationship, no matter what its quality. There could also be a tendency towards having too many expectations from your partner.\n\nA reversed Queen of Cups can also indicate the abuse of alcohol and substances, particularly if this abuse is driven by your emotional state (i.e. you drink more when you are feeling upset).'
	      }
	   }, {
	      name: 'King Of Cups',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/63_Cups14.jpg',
	      keywords: {
	         upright: 'Emotional balance and control, generosity',
	         reversed: 'Emotional manipulation, moodiness, volatility'
	      },
	      description: {
	         basic: 'The King of Cups sits on his throne on a grey stone block, calmly in the midst of a turbulent sea and wears a necklace with a fish amulet. The fish is the symbol of spirit and creativity and represents the balance of the unconscious with the conscious. Behind him on his right, another fish jumps wildly from the tumultuous ocean, and, on his left, a ship sails steadily in the choppy ocean. These images are a sign that the unconscious has been allowed to break through and has been recognised by the King, yet it remains within his power and does not overwhelm him. The King of Cups does not repress his emotions and unconscious impulses but has learned to accept and deal with them in a mature and balanced manner.',
	         upright: 'The King of Cups, like all the court cards in the suit of Cups, represents emotion, creativity, and the unconscious. Unlike the preceding three court cards, however, the King of Cups expresses much more restraint in his emotional state. He is a master of his own feelings, and remains in control of his emotions. Not to say that he represses those feelings and sentiments. On the contrary, the King of Cups represents the balance between the emotions and the intellect. He is a master of compassion and kindness and his card often indicates strong bonds in a relationship based on temperance and understanding.\n\nAs such, the King of Cups indicates that you feel very emotionally balanced and in control. You have a very deep understanding of your feelings and emotions, and are able to connect with this when necessary. As you deal with some of the scenarios that life throws at you, draw on this deep emotional maturity to help you navigate these challenges. Also, know that this is an incredible gift you have and be open to sharing your emotional stability and calm approach with others.\n\nIf you are facing challenges, then the King of Cups is an indication that you must create balance in the realm of the emotions. The King of Cups represents compassion; one of the most powerful and beautiful qualities of the human spirit. Ask yourself, “How can I develop a stronger awareness of the unconscious without being overwhelmed by its power? How can I develop a stronger sense of compassion without falling into the trap of sentimentality?”\n\nThe King of Cups encourages you to be considerate in your dealings with others and as you counsel others. You may need to understand why strong feelings have surfaced and how to best cope with them. It is important that you do not repress emotions but instead explore them with an open heart and an open mind.\n\nSometimes, the King of Cups can represent an older male who may appear in your life. This card represents a man of business, law or divinity, who is kind, considerate and willing to take responsibility for his actions. He is paternalistic but in a sensitive, generous manner, and he enjoys the quiet power associated with providing loving energy to others. He is able to listen mindfully to others and he responds calmly in a crisis. He uses diplomacy rather than force, and reached out to help, not to stifle or have it only his way!\n\nSimilarly, the King of Cups shows you generosity, graciousness, love, calmness, caring and will give you his healing ways. He has power in the business world and loves law and order. You would love him to be your doctor. If there were a crisis at hand, this is someone you would hope to have near.\n\nThe King of Cups is highly diplomatic and politically correct. He has a real talent at being able to balance the needs of many people and keeps everyone working together harmoniously and productively. He knows how to show care and sensitivity as he leads others towards a common goal. He responds carefully to others’ emotional needs and can diffuse a tense situation by reading and responding to the different people involved.\n\nIf you are being challenged personally, the King of Cups suggests you will need to remain emotionally mature in dealing with the negative energy from others. You need to be clear in your own mind about what your boundaries are and what is and is not acceptable on an emotional level. This King is level-headed and in control of his emotions. He uses his emotional intellect to make smart decisions and does not let other circumstances or whims sway him from his central belief system and his morals.',
	         reversed: 'The King of Cups reversed is incredibly emotionally controlling and manipulative. This is someone who is toxic, moody, sulky and withdrawn from others, particularly if things do not go his way. He can be vindictive and vengeful and has a talent at being able to punish others through emotional manipulation. He uses emotional blackmail to get his way and to push his own agenda. He leaves you feeling uncertain about yourself and as if you are the problem, not him. This only leads to emotional instability within you, which is entirely undeserved. If this sounds like someone you have met in the past, there is still some work to be done in releasing yourself from his controlling forces.\n\nA reversed King of Cups can also represent a mature and loving, emotional person, who has let their emotions begin controlling their life. The King of Cups may depend too much on others and view himself through the eyes of others. He may fall into delusions or alcoholism, or others forms of escapism to deal with emotional pain. This could show you trapped in a relationship with someone that is dependent and emotional, or a co-dependency situation. You may be struggling with self-deception and/or the deceptions of others, and the most important thing in this situation is to see yourself and others as they actually are, with clear and loving eyes but not foster any sense of dependence or weakness through your own actions.\n\nIn a relationship reading, the reversed King of Cups suggests that you feel quite confused about your relationship and your emotions are out of balance and out of control. You are uncertain about your true feelings, and every day they seem to chop and change, leaving you completely confused. You need to be careful, too, about the messages you are sending to your partner as he/she may become easily confused too if you are ‘up’ one day and ‘down’ the next. It is probably best to keep some distance now until you work out your feelings and are more in control of your emotional state.\n\nFinally, the reversed King of Cups suggests that you need to take greater control and responsibility for your emotional state. Right now, you are a loose cannon, letting your emotions rule and flip-flopping from one point of view to another. You want to take charge of your life but then you are waiting for the Universe or for fate to show you the way. You need to be more accountable for your emotional well-being.'
	      }
	   }, {
	      name: 'Ace Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/64_Swords01.jpg',
	      keywords: {
	         upright: 'Raw power, victory, break-throughs, mental clarity',
	         reversed: 'Confusion, chaos, lack of clarity'
	      },
	      description: {
	         basic: 'The Ace of Swords shows a hand, cloaked in white, holding an upright sword, symbolic of the mind and the intellect. At the tip of the sword is a wreath, indicating success and victory, and a crown, indicating mental clarity. However, the barren, mountainous landscape below the sword reflects the often cold nature of intellect.',
	         upright: 'The Ace of Swords shows the beginning of a situation whose potential is as double-edged as the blade of the sword itself. The Ace implies the use of great power, even excessive power at times, to further one’s ends but what is not clear is how those powers will be used, or what it is that you are trying to achieve. No matter what the goal, there is always great power behind the attempts to reach it and, as such, very little can stand in the way of the energy of the Ace of Swords without being destroyed.\n\nThe power of the Ace of Swords can be drawn up by anyone whose heart, mind and will are strong. However, it is up to the bearer of the Sword to tap that potential and use it in a way that is beneficial for the greater good.\n\nThe Ace of Swords represents a period of great insight and mental clarity. It signifies a ‘break-through’ or an ‘aha’ moment where suddenly conscious understanding and mental reasoning reach their peak, and achievement of goals suddenly becomes a lot easier. You have a new understanding of some issue that has been of concern, or, in a broader sense, a new world view. This is a perfect time to clear away the fog that has kept you from seeing the inner truth, so that you can now cut to the heart of the matter. This is also a good time to act, and if you set your mind to accomplishing your goals, you can achieve anything you desire.\n\nThe Ace of Swords highlights a new idea, inspiration, original thinking and creative vision. It represents a point at which you have a new way of thinking and the energy to go with it. You are excited to pursue new opportunities that draw upon your creative and mental abilities.\n\nThe Ace of Swords also encourages you to seek out the truth of the matter and to find justice. You may be championing a cause or standing up for your rights or the rights of others. Thus sometimes, the Ace of Swords can suggest that you are prepared for ‘battle’. You have great clarity on a situation and can now argue your case with the view to come out victorious. You may have a new idea for which you are ready to fight, or you may be all fired up on an issue that you are particularly passionate about, such as human rights, the environment or your personal beliefs. This card invites you to use mental force and to use your intellect and critical reasoning. If faced with a challenging situation, you need to be ready for ‘battle’ and be prepared to find the strength to overcome these challenges.',
	         reversed: 'The reversed Ace of Swords suggests that you lack clarity around what your true goals and aspirations are. You have a high-level understanding but have you been able to define this in more specific terms? This card often appears when there is a lack of clarity or complete understanding of the task at hand, and asks you to spend some more time on clearly defining in very real terms what it is you want in life. Set yourself some SMART goals (specific, measurable, achievable, realistic and time-bound) so you can be really clear on what you are working towards. Focus on the basics and do some better planning.\n\nThe Ace of Swords reversed also reflects an idea or concept which you have not yet put into action, perhaps because you are unsure about whether or not it will bring the results you want. You are having difficulty with the early stages of formulating an idea, a plan or your goals. You may have too many ideas on the go and are unable to make a decision, creating challenges with completion.\n\nThe Ace of Swords reversed identifies clouded judgement and lack of mental clarity around a specific situation. You are missing important information or evidence that will assist you in your predicament, so invest your time and energy into seeking out the truth, rather than simply taking things at face value.\n\nThe reversed Ace of Swords can also suggest that a situation has regressed into to a state of complete chaos and confusion. Whatever clarity you had about the specific situation is now gone, and instead it feels like there is just one big mess.'
	      }
	   }, {
	      name: 'Two Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/65_Swords02.jpg',
	      keywords: {
	         upright: 'Indecision, choices, truce, stalemate, blocked emotions',
	         reversed: 'Indecision, confusion, information overload'
	      },
	      description: {
	         basic: 'The Two of Swords depicts a young, blindfolded woman who holds a sword in each hand. She sits before a sea filled with rocks and crags that present obstacles to ships which need clear passage. The blindfold shows that the woman in this card is confused about her situation and that she can see neither the problem nor the solution clearly. The swords she holds are perfectly balanced, showing a balanced and stable mind, and that both sides of the situation need to be addressed. The crossed swords are also symbolic of the need for a truce and the Suit of Swords indicates that the problem at hand needs to be resolved using logic and intellect. The waxing moon to the right of the woman shows a new beginning arising out of the solutions found for this problem.',
	         upright: 'The Two of Swords is a card of choice and of the difficulty of making a decision. The woman in this card is blindfolded, and this may be intentionally so, indicating that she is avoiding making a very difficult decision. Her state of calm and relaxation may be indicative that she is trying to avoid this important decision in order to bring about peace of mind. However, the decision must still be made. Therefore, the appearance of the Two of Swords indicates that you are currently being faced with a difficult decision but you are attempting to hide from it and pretending to yourself and others that if you ignore the decision long enough, it will go away of its own accord. However, the decision will not go away simply by your willing it to depart. Your conscience will eventually force you into facing your refusal to deal directly with the situation.\n\nThe Two of Swords therefore serves as a reminder that life’s decisions are frequently quite difficult and raise the possibility of painful consequences. However, you must “take the bull by the horns” and make your decisions with your best intentions, fully aware of the possible consequences. Avoidance will ultimately lead to a greater conflict.\n\nThe blindfolded woman in this card is also an indication that you lack the information you need to make the right decisions at this time. You may be missing something, such as threats or potential risks, alternative solutions, or key pieces of information. Once you are able to remove your blindfold and see the situation for what it really is, you will be in a much better position to determine your path forward. Research your options more widely, seek outside opinions and feedback, and ask yourself what you are missing here. Why is this decision so challenging to make? What extra information do you need?\n\nGiven the two swords in this card are in perfect balance as they cross the front of the woman, this card reflects the need for greater balance in your intellectual life. You need to take a break from your usual way of thinking, so that you can begin to consider alternative ideas and viewpoints. You also need to be very diplomatic and weigh up the pros and cons of both options that are available to you, and to consider that there may indeed be another way around the problem. You need to compromise or let things stand as they are.\n\nThe Two of Swords often represents a stalemate where there is no winner or loser. You may be at loggerheads with another person and failing to see each other’s points of view. What is needed is a truce, where you either ‘agree to disagree’ or you seek to understand each other’s points of view before coming to a final solution. Thus, not only does this card represent potential conflict through a stalemate, it also represents making peace through a truce.\n\nSimilarly, the Two of Swords can reflect indecision and being at an impasse with regards to an important matter. Again, there is only so much that you can try to put off. At some point or another, you are going to have to make a decision or have a point of view in order to get things moving again.\n\nIn a reading, it may be helpful to draw a further two cards, either side of the Two of Swords. This will highlight what it is you are trying to balance or decide upon. This may also identify the two alternative solutions from which you are trying to choose.',
	         reversed: 'The Two of Swords reversed shows that you are caught between a rock and a hard place and you are finding it incredibly difficult to make a decision about what to do. You are really struggling to see what the right choice is as either option will lead to negative consequences. Lay out the pros and cons of each option that is available to you and weigh up which option will have the most favourable outcome.\n\nThe reversed Two of Swords may also indicate mental confusion as a result of information overload. You are overwhelmed with other people’s points of view and additional, detailed information about what options are available to you. At the end of the day, you are going to have to make a decision, so sift through the advice and the information that is available to select only the most relevant and helpful.\n\nThe reversed Two of Swords may suggest that you are feeling stuck in the middle of two competing sides. You may be trying to play the peace-maker role but in doing this you are just confusing yourself and creating more tension. For example, you may be trying to bring two conflicting family members together in the hope of a harmonious family environment but instead you are finding yourself being the messenger or the dumping ground for each of their concerns. Decide whether or not you truly do have a role to play and whether you can indeed create peace between the two opposing parties. Otherwise, get yourself out of there!'
	      }
	   }, {
	      name: 'Three Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/66_Swords03.jpg',
	      keywords: {
	         upright: 'Painful separation, sorrow heartbreak, grief, rejection',
	         reversed: 'Releasing pain, optimism, forgiveness'
	      },
	      description: {
	         basic: 'The Three of Swords is a simply illustrated card with a difficult message. A heart, suspended in the air, is pierced by three swords. The heart is symbolic of emotion and beauty, while the piercing swords reflect the ability of logic and power to harm the physical body and the emotions of a person. The sky is heavily clouded and rain pours down violently, representing a grim moment in time.',
	         upright: 'The Three of Swords represents rejection, sadness, loneliness, heartbreak, betrayal, separation and grief. Such events feel so painful because they are unexpected. However, the Three of Swords often serves as a warning sign to show when one or more of these are possible. By preparing for this difficult event, the emotional blow can be minimised or even prevented entirely.\n\nThat said, pain, sorrow and grief are often a necessity in the journey of life. Without pain, there would be no challenge and no lessons learned. Pain can be a great motivator because it encourages you to surmount obstacles and ultimately learn from your mistakes. Each challenge you encounter creates that initial pain, which is inevitably turned into an opportunity to grow stronger and to change the direction of your life as a result of the lessons learned. While the pain may cloud your vision for a certain period, it will eventually allow you to see clearly and to put the past behind you. Though life seems meaningless at the time, recovery can and will occur. It takes faith, self-love, forgiveness and time. Count your blessings.\n\nThe Three of Swords therefore serves as a reminder that if you can start to see pain as a learning opportunity, life will suddenly become less painful. You need to really get in touch with pain and sorrow. Challenges remain but once they are no longer perceived as negative or ‘bad’, they lose a lot of their impact. This card is therefore encouraging you that you have the ability to conquer any pain that comes your way. Understand how the pain can help you grow. If someone has betrayed you and you do not think you can ever love again, challenge that belief. Do not be surprised when your heart emerges from darkness, capable of loving even more than before.\n\nSimilarly, the Three of Swords speaks of loss and difficulty, of sacrifice and broken relationships. It follows the difficult decision required in the Two of Swords, where you may be avoiding the necessity of making a tough choice. In the Three of Swords, the choice has been made, and you are now experiencing the consequences of your action. Often the choices make involve choosing one good over another, or one evil over another, and thus when you have finally made your decision, you are still left with the pain of losing the option you have not chosen. Often, however, the pain of losing something you once valued (such as a ‘comfortable’ relationship in which you are no longer growing) is necessary in order to prepare you for a more fulfilling experience in the future.\n\nThe Three of Swords is also about release. When you have suffered a major setback, or loss, it is a good time to have a good cry, which is all part of the cleansing process. Expressing your sadness and letting it all out will then help you to move on to better times. However, it is also important that you continue to focus on the future path ahead. There can be a risk that you may become overly absorbed in the loss and the surrounding emotions that you lose sight of the need to just let go and move on. The loss becomes your focus rather than the recovery. It is time to accept the loss and then move forward with your life.',
	         reversed: 'In its reversed position, the Three of Swords indicates that you have recently gone through a difficult patch where perhaps a relationship has ended or has experienced challenging times, a loved one has passed, or you felt hurt from a situation that affected you deeply. Thankfully, this time has passed and you are on the path to recovery, realising that with behind every cloud is a silver lining and there are indeed other things in your life which you can feel happy about. You have reached a point where you can accept the pain and hurt and are ready to move on.\n\nOn the flipside, the reversed Three of Swords can also suggest that you are finding it very hard to move on from a recent loss or heartbreak. This card suggests that inside you are still suffering emotionally from a previous loss and need to go through an emotional purging process to allow yourself freedom from your past. You are doing your best to leave this behind and make a new life but it is still a long journey ahead. Be careful that you are not getting ‘stuck’ in the moment of grief, and instead you are focused on leaving behind your past and embracing new opportunities. It is always hard to bear the pain of separation or understand why you have been inflicted with such sorrow. Learn to accept your situation so that the healing process will not become blocked. Allow yourself to experience the pain, give yourself the right to grieve and release the heartache. Let it go, and then, once the upset, pain and tears have gone, open the door to new experiences.\n\nIf you are experiencing challenges in your relationships, the reversed Three of Swords serves as a reminder to be the peacemaker. Never be afraid to say you are sorry. Always think before you speak so that you will not later regret what you have said.\n\nWhen you see the reversed Three of Swords, ask yourself, “In what ways am I suffering? What do I most feel sorrowful about? What can I do to release this pain and learn from it?”'
	      }
	   }, {
	      name: 'Four Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/67_Swords04.jpg',
	      keywords: {
	         upright: 'Contemplation, recuperation, passivity, relaxation, rest',
	         reversed: 'Restlessness, burn-out, lack of progress'
	      },
	      description: {
	         basic: 'The Four of Swords depicts the effigy of a knight lying upon a tomb. His hands are in the position of prayer and the tomb sits within a church. The stained glass behind the statue depicts a woman and child together. One sword lies beneath the knight, symbolising that there is only one key issue that is dominating your life at this time. Three further swords hang above him, pointing downwards.',
	         upright: 'The Four of Swords shows a period of rest and recovery after a time of challenge, with the promise that, once recovered, you can and will return to the challenge. In the meantime, the Four of Swords provides a new challenge – to stay silent and inactive. This is the time build up your mental strength. Meditate and spend time in a calm atmosphere. You need to replenish your strength and spend time in spiritual thinking. You need to rest and relax.\n\nThe Four of Swords is a reminder that after every crisis and before every new challenge, there is always a time of relaxation and contemplation. Constant stress and tension will break even the hardest and most resilient of people but brief periods of rest enable you to refresh your energy, concentration and focus, ready for the next challenge. These rests should be used wisely, to heal the body and ready the mind.\n\nThe Four of Swords is also a sign that you can stop worrying, put down your defences and take a breather from the chaos around you. For the moment there is a truce and you can catch your breath without being attacked again. However, bear in mind that a truce and peace are not the same thing. The Four of Swords is a guarantee that challenges will return to your life as soon as you are ready to face them, so make the most of the stillness and quiet you have earned but never lose sight of the fact that the battle is not yet over, and that there is still work to be done.\n\nThis card suggests that now is the time to rest from some difficult times, perhaps the trauma of breakup or departure, relationship or family problems, financial and health worries, stress and conflict. Take a break. This is also not the time to make decisions, particularly when you are at your most vulnerable.\n\nThe Four of Swords suggests the need for seclusion. You need seclusion to deal properly with your situation and need to experience time apart from others to gather your thoughts and feelings. Following on from the painful loss of the Three of Swords, the Four of Swords indicates your need to spend time alone to re-evaluate your life. Solitude, although often difficult to bear, is necessary for you to be able to recharge your batteries and rejuvenate your spirit. This solitary experience always bears fruit in an experience of greater inner strength and confidence. Retreat from pain, conflict and distractions, and rid yourself of stress and anxiety. Ground and re-charge yourself. Look inward for a real change and meditate daily.\n\nIn a practical sense, the Four of Swords is an indicator that you need to have some time out from your current circumstances, to reflect and review your progress so far. This is a good time to re-evaluate and re-assess your priorities. It is almost like conducting your own “Post Implementation Review” following a major milestone or a major challenge. Create some time and space to reflect on what has worked well, what has not worked well and what you need to change for the future. Pausing for reflection after each major challenge will position you well for success in the future.',
	         reversed: 'The Four of Swords reversed can indicate that you are feeling restless and wanting to do everything at once. Even if your body is telling you that you need to rest and relax, your mind may be pushing you forward, trying to accomplish a long list of tasks. You may be getting quite sick or stressed as a result, so it is vital that you force yourself to pause and take it easy to ensure that you do not become completely run down and exhausted.\n\nYou may also be trying to avoid any period of contemplation or meditation on a particular issue because you are worried about what it might bring up. You need to return to the energy of the Three of Swords and confront the pain and grief that exists within your heart. You need to experience that pain as it is preventing you from being able to move on. Once you have experienced it, it will begin to subside and you will be able to live a more fulfilling life.\n\nThe Four of Swords reversed can also represent stagnation and a lack of action that is leading to increased frustration. For example, a long-term marriage is no longer progressing and is spiritually and emotionally empty. You may need to take a break from this stalled situation and come back to it when the energy is flowing better.\n\nSimilarly, the Four of Swords reversed suggests that you are feeling frustrated with the lack of progress and change in your life. Many things have stood still or have failed to change in the way you were hoping they would. Part of this lack of change, however, is as a result of your passive approach. There may have been situations that were frustrating to you or that you were unhappy with but you may have opted to just sit it out and hope that they would eventually change, rather than taking action to create a more desirable outcome.'
	      }
	   }, {
	      name: 'Five Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/68_Swords05.jpg',
	      keywords: {
	         upright: 'Conflict, tension, loss, defeat, win at all costs, betrayal',
	         reversed: 'Open to change, past resentment'
	      },
	      description: {
	         basic: 'In the Five of Swords, a young man, with a look of contempt on his face, stares at his conquered enemies. He possesses five swords, most of which he has taken from the other people in the card. The other two figures walk away from him slowly, with a sense of sadness and loss. The sky is cloudy and tumultuous, indicating that not all is well despite the battle being seemingly over.',
	         upright: 'The Five of Swords sees you engaging in conflict or finding yourself disagreeing with others, leading to tension and hostility. Despite thinking you have won, you may still end up the loser because you have hurt or annoyed others and have subsequently isolated yourself. You try to pick up the pieces and act as if the conflict is now in the past but others have now lost faith in you and do not want to be around you. This might be one of those times when it feels like everyone is against you and you may lose some friends along the way. You will need to make a decision about whether your point of view is so important to you that it is ok to put your relationship with others in jeopardy, or whether you can compromise and try to see eye-to-eye with others.\n\nThe Five of Swords can also represent conquest. If you have been aggressive in your struggles, then you will soon accomplish your objectives. However, if you have been passive, you may need to compromise on your personal interests, giving in to the wishes of the opposing force. You will feel that there are more obstacles ahead, and you will not want to face the ordeal you know you must if you are to have what you want or the way you want it. Overall, you are in for a struggle and there is more work or problems ahead than you are aware of now. Things will not go as well as they should, and you will have conflicts or clashes of will with others.\n\nThus, the Five of Swords is a card representing ambition but in the negative sense. Too much ambition without regard to the consequences to yourself or others results ultimately in a situation of loss for everyone. You may be represented either by the callous winner or the dejected losers. In any case, there is a negative connotation. If your focus is solely on winning your goals at any cost, you will eventually discover to your own dismay that the price of winning may not have been worth the reward. Arrogance and pride often go hand-in-hand with a difficult triumph such as this, and you must be careful not to think you are invincible. You have overcome a challenge, and you have the right to feel proud but know that there will be other rivals to face and that some of them will eventually defeat you. Boasting to others that you are invincible is an invitation for someone to prove you wrong. If your victory was won through cheating or unethical conduct, beware of an attempt at vengeance.\n\nThe Five of Swords can relate to a betrayal or sneak attack by someone you trust and do not suspect as your enemy. There may be an unfaithful partner or a jealous person in your life who is sabotaging you behind your back. Look to other Court cards in the reading to understand who may be working against you. You must be very careful whom you trust at this point in time because you are vulnerable to attack and gossip.\n\nThe Five of Swords may simply point to defeat. It shows that, despite your best efforts, you are likely to be beaten. If you allow yourself to become disillusioned after such a loss, then you are on the path to increased ruin and torment. Accept your defeat, learn from it, and then make sure that next time you succeed. Be smarter and wiser as a result of your loss. Just as they say in the reality TV show Survivor, “Outwit, Outplay, and Outlast.”\n\nAlternatively, the Five of Swords can be seen from quite a different angle – that of a hollow victory. It is possible that the two ‘defeated’ men in this card were really not defeated at all; they simply laid down their arms and walked away. The men either knew that they would lose, or they knew that trying to win would be a waste of energy and a pointless exercise. By choosing not to fight, they are really the winners here, because he who knows when to fight, and when not to fight, will be victorious.\n\nThe advice of the Five of Swords is to pick your battles. You may be tempted to fight every conflict to ensure you get your way, to prove that you are right, or to defend yourself when you are feeling challenged or threatened by another person. However, most experts agree, choosing your battles wisely is a much better way of life than battling out every disagreement. Not only will picking your battles lead to a more peaceful existence, it is also more likely to strengthen your interpersonal relationships.',
	         reversed: 'As a card of conflict, tension and disagreement, the reversal of the Five of Swords shows that you really just want this period of fighting to be over, so that you can forgive and forget, and then focus your energies on more constructive activities such as restoring your relationship back to normal. The conflict is becoming upsetting now and you realise that there can only be losers in this battle. You now just want to put this behind you and move on.\n\nThus, the Five of Swords reversed suggests that you are now more open to change. The arguing is over and you are more willing to look at the situation with fresh eyes. You are willing to lay down your sword and begin negotiating, honestly trying to arrive at a win-win solution rather than always knocking heads. A return to the Four of Swords is required, where tranquillity and peace drive your thoughts and behaviour, moving away from tension and conflict. This is a good time to reach out to those with whom you have recently had conflict or disagreements, and make amends.\n\nThe Five of Swords reversed can sometimes indicate conflict in your life that you have tried to walk away from but which continues to follow you. For example, there may still be an ex in your life who is making things difficult and who may be preventing you from moving on to new relationships. So long as there is conflict, tension and raw emotion at play, avoid this person or situation.\n\nSimilarly, the reversed Five of Swords can suggest that an old wound has been re-opened and you are experiencing fear and tension associated with that memory. You may be particularly worried that history might repeat itself or that you could be hurt again. Aim to forgive and forget so that you can indeed move on.\n\nThere may also be some residual resentment following a recent or past argument with someone close to you. You have had some very challenging and heated conversations together and you still harbour some negative emotion from these discussions. This may still be unresolved and unaddressed and this in itself is impacting your ability to create a harmonious relationship.\n\nThe reversed Five of Swords serves as a reminder that, at times, it may be appropriate to disregard the opinions of others. Sometimes you just cannot please everyone and unfortunately there may be some friendships lost along the way. Sadly, not everyone is going to be as accommodating of your desire to pursue your own goals, particularly if it impacts on them and their ability to live their life the way they want to. What you will have to accept is that you cannot please everyone and there are going to be people who are annoyed that you cannot be there for them as much as in the past. They will just need to deal with this and get over it, I’m afraid.'
	      }
	   }, {
	      name: 'Six Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/69_Swords06.jpg',
	      keywords: {
	         upright: 'Regretful but necessary transition, rite of passage',
	         reversed: 'Cannot move on, carrying baggage'
	      },
	      description: {
	         basic: 'The Six of Swords depicts a woman and a young child being rowed across a body of water towards a land that lies not far ahead. The woman’s head is covered, indicating sadness or loss as she moves away from something in her past. The water to the right of the boat is turbulent but the water to the left and near the land to which they are journeying is calm and steady. Although there is an indication of change or loss in the Six of Swords, and therefore a sense of moving away from something, there is also a sense of moving towards a more promising future. The calm waters in the distance suggest that the woman and child are now moving away from turmoil and conflict toward peace and tranquillity, even though they are both sad to leave behind their pasts. In the boat are six upright swords, symbolising the power of a rational mind over the heart and the intuition',
	         upright: 'The Six of Swords shows that you will need to make a regretful transition, as a likely result of the decisions you make. You know that in order to move forward, you must leave something important behind, and while you do this with some regret, you know that in the long-term it is the best option for you. There are times when you will be forced to let go of something to which you have been attached, and the process of letting go is often quite challenging. However, the sadness of your loss will soon be replaced by greater clarity, bringing about a renewed acceptance of change. Do not be afraid to let go of whatever it is that is holding you in the present or the past. Instead look to your future and choose the best option that has the greatest long-term potential. There are going to be some hard decisions and some compromises that you will need to make but this is ultimately a ‘rite of passage’ that will take you into a new phase of your life.\n\nYou need to realise that you are now headed towards a much better position in life. You have endured, or are currently enduring, a difficult life transition but as a result, you will be more able to deal with what may come. Do not dwell on the past or what you have left behind. Instead, use this as an opportunity for changing your beliefs about yourself, moving away from whom you used to be and towards whom you really want to be.\n\nSometimes the only way to solve life\'s problems is to leave them behind you and go somewhere new to start over. While it may feel as though you are giving up or being a coward, escape is often the only approach left when all others have failed. The important thing now is that you chart a new course that will lead to greater happiness and joy. The Six of Swords also shows the need to draw upon a state of mental clarity, logic and objectivity in order to examine where you have been and where you are going. This mental clarity will also serve to smooth the way ahead, and make the passage from negative to positive as peaceful as possible. You can use your intuition to guide you through easy situations and call upon your impartial and analytical nature when it is needed for a more complex decision.\n\nThe Six of Swords can also indicate a state of depression or ‘the blues’. You are doing your best to just get through each day as it comes, not particularly enjoying what it has to offer but not really giving up either. You may feel listless, lacking energy and motivation, and somewhat depressed. You are getting by but only just.\n\nMore literally, the Six of Swords can indicate a trip across water (for example, via a ferry, boat, or plane overseas). There may be some sadness in terms of who you will need to leave behind you but you know that this trip will do you a world of good! An example might be someone who is about to travel on their own, leaving behind a partner who they will sorely miss. You may also be required to make a longer-term move from one location to another, where you will leave behind friends and family in order to explore or experience a new territory. Again, while you will miss those you leave behind, you will also find that you have an amazing time on your travels and will learn so much about yourself.',
	         reversed: 'The Six of Swords reversed indicates that you are trying your best to move on from the past and make the important transition that you know you need to make. You are trying to physically and mentally move from any past experiences which you know that have not been helping you. However, given this card is reversed, it is clear that you are experiencing some challenges in doing this and no matter how hard you try to leave the past behind you, it keeps catching up with you. It is like there is something pulling you back to where you have come from, rather than allowing you to move on to new territories. What is hard is that there are a lot of unresolved issues from the past, which you had hoped you could just leave behind you but they keep rearing their ugly head and preventing you from getting to that new place of being that you really want to be. There may also be moments when you doubt whether you are making the right decision in leaving behind your past but this card gently encourages you forward, reminding you that you are heading towards a better future.\n\nSimilarly, the reversal of this card may suggest that you are resisting this necessary transition. Perhaps you feel that it has been forced upon you or that you were not included in the decision to move. For example, your partner may be required to relocate for work and you must go along with him/her. What is important is that you look at the benefits of the transition rather than focusing on the drawbacks so that even if this transition is out of your control, you can at least look forward to something and get some sort of personal value out of it.\n\nIn a relationship reading where the relationship is relatively new, the reversed Six of Swords may indicate that you have not moved on from a past relationship and are carrying a lot of ‘baggage’ with you. You need to work hard at leaving this behind you otherwise it will continue to plague your current and future relationships.'
	      }
	   }, {
	      name: 'Seven Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/70_Swords07.jpg',
	      keywords: {
	         upright: 'Betrayal, deception, getting away with something, stealth',
	         reversed: 'Mental challenges, breaking free'
	      },
	      description: {
	         basic: 'The Seven of Swords shows a man sneaking away from a military camp with a bundle of five swords in his arms. Two other swords remain planted in the ground just behind him. His expression exhibits a sense of over-confidence and mocking, as though he felt absolutely sure of his success of getting away with the theft. However, in the distance a small group of soldiers can be seen to the left of the thief, and one of them holds a sword upraised. The thief has been found out!',
	         upright: 'The Seven of Swords is a card of deception and betrayal. It indicates the difficulty of trying to ‘get away with something’ undetected and unnoticed. Often when you do something in secret, hoping that you are safe and undiscovered, something goes awry and your secret is revealed to your embarrassment. This card therefore urges caution when attempting to use cunning or deception to gain an advantage over someone or something else. There is no question that there are times in life when it is necessary to act shrewdly or do something in secret. Perhaps you had to think on your feet and act in a way that was not exactly all ‘above board’. Perhaps you had to go behind other people’s backs in order to manifest your desires. Perhaps you felt like you needed to cheat or take the easy way out. If acting shrewdly is something you must do, it is essential that you do this with a clear conscience and you are fully aware of the potential consequences of your actions. Taking the easy path is not always the best path, and sometimes you just have to exert a decent amount of effort to achieve what you want.\n\nThe Seven of Swords indicates that you may be tempted to sneak away from a particular situation that is not working for you any more, rather than dealing with it head on. As you do not feel ready to deal with the issues, you are aiming for a solution where you can just escape and not have to worry about it all. Are you trying to run away from commitment, responsibility, hard work or love? You may be procrastinating, letting problems slip and become worse because you do not want to deal with them. Sometimes you just have to face what has to be faced. So, the question is, “Is this realistic?” Will this ‘escape’ really accomplish what you want to and need to accomplish? Will it address the fundamental issues at hand here? The likely answer is no, and it may simply be an easy way out for now.\n\nYou might think you have gotten away with something but have you? What impact has your actions had on other people? Could someone else suspect something? Is this going to come back to bite you again? Even if you have managed to go undetected, be aware that in the long run, deception will not produce the rewards you desire and may instead cause significant damage to your relationships and reputation. Consider taking a more ethical and morally balanced approach to life from here on.\n\nOn the flipside, the Seven of Swords asks you to be very cautious and wary so that you do not become a victim of someone else’s deception, betrayal, cheating and false motives. You may trust someone who then turns out to be running their own agenda, leaving you high and dry. You need to be very careful of who you trust over these coming months as you are at risk of being taken advantage of. Look out for any sneaky behaviour and trust your gut instinct about when something does not feel right or is too good to be true.\n\nSometimes, the Seven of Swords indicates a desire to go it alone. You want to discover, investigate and solve every problem using only your own wits and resources. You may believe that you have a better chance at success if you act on your own accord, ignoring the advice or inputs of others. This approach is useful when you need to bypass an ineffectual group or assert your independence but it can also have its limitations. You may end up feeling isolated and excluded, missing that great feeling of collaboration and synergy gained when you work with others. If you feel inclined to act alone, be sure this isolation will really work for you.',
	         reversed: 'The Seven of Swords is a card of mental challenges and rites of passage. The reversal of this card shows that you are finding it difficult to take the first step in a new direction. At times it may seem impossible that you could create the types of changes you want as you continually come up against setback after setback. Yet, you know in your soul, that when the timing is right, you will be able to follow through on your dreams, releasing an old pain from your heart.\n\nThe Seven of Swords reversed suggests that you need to break free from old habits and ways of thinking in order to overcome the blockages that currently stand in your way. You need to accept what is happening to you and act on it, rather than trying to escape. You need to do things differently, releasing yourself from past behaviours or limiting beliefs so that you can move forward in your life. Do not become trapped into thinking that you can only do certain things with which you are familiar. Expand your consideration set to broader horizons.\n\nIf you are involved in an affair or extra-marital relationship, the reversed Seven of Swords shows a growing reluctance to keep up the charade of having this type of relationship. You or your partner may be feeling increasingly uncomfortable with this relationship and would much rather come out in the open about what is happening.'
	      }
	   }, {
	      name: 'Eight Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/71_Swords08.jpg',
	      keywords: {
	         upright: 'Isolation, self-imposed restriction, imprisonment',
	         reversed: 'Open to new perspectives, release'
	      },
	      description: {
	         basic: 'The Eight of Swords shows a woman tied up, blindfolded, and surrounded by swords that act as a kind of prison or enclosure. It appears that there is no possibility of escape. She appears isolated and alone as she stands in the midst of a barren, watery wasteland far from the town in the distance. The sky is grey and cloudy, indicating despair and a lack of hope. The woman’s feet do not touch the water, indicating that the feeling of being restricted in the Eight of Swords is based on an intellectual assessment of the situation and not an emotional one. There is a path cleared before her, so there is actually a way out of this situation but the blindfolds prevent the woman from seeing her way out.',
	         upright: 'The Eight of Swords reflects that you feel trapped by your own thoughts and perspectives. The woman in this card is blindfolded and bound, trapping her into thinking that she has no way out. However, if only she could remove the blindfold and change her thinking, she would see that she does indeed have options. So, the Eight of Swords suggests that you need to look at a difficult situation from a new angle. Draw upon your intellectual self and your emotional self to determine the best path forward, one that avoids any possible victimisation or restriction.\n\nThe Eight of Swords is often a sign that it is best not to make any important decisions at this point because your thinking has been limited and constrained by self-imposed boundaries. You are struggling to see a situation for what it is and have been lead to believe certain things that may or may not be true. There are choices available but first you must be within the right mindset to know which option to choose. This means releasing the bindings and the blindfold to see the situation from a different, less imposing angle. There may also be too many ideas running through your head, thus it is best to wait until you feel more secure and certain about a situation before making important decisions and taking action.\n\nThe woman in the Eight of Swords is often seen as powerless. She has surrendered her power to an unknown entity, thus rendering herself completely powerless. She has become the victim and is now waiting to be rescued. If you see part of this woman in yourself, then it is imperative you take back your power and personal accountability and open your eyes to the options that lie in front of you. The fact is that you do have options, even if you do not like those options. This is fine, so long as you accept that you do indeed have options and you do not have to be the victim here.\n\nThe Eight of Swords portrays a dilemma whereby you are faced with the difficulty of a painful decision and you are at an impasse, uncertain of which way to go. However, what you may not realise is that the decision in the Eight is the result of our own actions. Despite the fact that you have boxed yourself into a corner, there is a way out. The solution is simply to deal with the situation in the most direct yet tactful manner possible, and face your choice with inner strength. It is time to be honest with yourself and others in order to be free of the burden of fear or guilt that is implied with the Eight of Swords.\n\nThe Eight of Swords can indicate that your interests will be opposed by other people, and this may create restrictions to what it is you want to achieve. Take back your power and realise that you have options whether others oppose you or not. You do not have to be constrained by their way of thinking or their rules.',
	         reversed: 'The Eight of Swords reversed indicates that you have come through a difficult time and you are becoming more open to change and self-acceptance. You have been able to reflect on what did and did not work in the past and have changed your perspective and approach. You acknowledge that you do indeed have options, and you are refusing to play the role of ‘the victim’, taking greater accountability for where you are in life.\n\nThe Eight of Swords reversed indicates that you need to free yourself from some of the limiting factors of your past. You have some skeletons in the closet that need clearing out. Allow yourself to let go of old patterns of behaviour and belief systems that have previously held you back.'
	      }
	   }, {
	      name: 'Nine Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/72_Swords09.jpg',
	      keywords: {
	         upright: 'Depression, nightmares, intense anxiety, despair',
	         reversed: 'Hopelessness, severe depression, torment'
	      },
	      description: {
	         basic: 'The Nine of Swords shows a woman with her head in her hands, sitting up in her bed. She appears to have just woken up from a bad nightmare, and is obviously upset, fearful and anxious following her dream. Nine swords hang on the wall behind her and the base of the bed is decorated with a carving of a duel in which one person is being defeated by another. The quilt covering the woman is decorated with roses and the outlines of astrological symbols.',
	         upright: 'The Nine of Swords is the card of fear and nightmares, and has an apparently negative ‘feel’ to it. However, the troubles alluded to in the Nine of Swords are primarily of a psychological nature and do not necessarily indicate suffering in your external reality. That is, it is what is inside your mind that is creating the fear and anxiety, not your actual circumstances. Your experience of the world is greatly influenced by our expectations, desires, and fears, and therefore you are largely the creator of your own world, and your attitudes determine how you experience that world.\n\nThe Nine of Swords can also reflect fear of the future, or what may possibly happen in the future. If you allow yourself to be bound by fear of the future, you are at risk of eventually creating a negative reality for yourself by virtue of your expectations. Your nightmare becomes your self-fulfilling prophecy, which is clearly not a desirable outcome.\n\nGenerally, this card is an indication that you are worrying excessively about a situation. You are literally being kept up at night because you are so anxious about a particular issue. It is possible you are working yourself up unnecessarily and, if you were to look at the situation more objectively, you may come to realise that it is not as bad as you are making it out to be. In fact, all that worry and despair is what is making it worse, so rather than fretting about it, do something to change it.\n\nAlthough most people experience fear, frustration and uncertainty at some point in their lives, you should not allow those negative emotions to immobilise you or keep you from pursuing your goals with enthusiasm and hope. Expect at least some level of uncertainty in the future, and draw upon your inner strength to remain as flexible and adaptable to that uncertainty as possible.\n\nThe Nine of Swords can also indicate that you are being incredibly hard on yourself, putting yourself down or engaging in negative self-talk. For every mistake you make, you blame yourself and become worked up and angry at yourself for messing up again. So, when the Nine of Swords appears in a reading, ask yourself why you are being so hard on yourself, how are you putting yourself down or what is the source of your depression? What can you do to make yourself feel better? You may need to make a more conscious effort to quit the negative self-talk and replace it with positive reinforcement for a job well done.',
	         reversed: 'The Nine of Swords is about worry, anxiety and not being able to sleep because your thoughts are running at one hundred miles an hour. Reversed, the Nine of Swords indicates that you are working yourself up and becoming incredibly stressed and anxious when, really, this does not have to be a complicated issue. You have a tendency to get very worked up about how bad a situation appears, losing sight of what it is really happening and what opportunities are available to you. What is needed here is for you to stop and objectively examine the reality of the situation. Bring yourself back to earth by uncovering your fears and anxieties and working to reduce the impact of those fears and anxieties on your life. Know that it is going to be ok, no matter what.\n\nThe Nine of Swords reversed also suggests that your worry and despair may actually be causing you harm. The more you worry about something, the more likely it is you will manifest your worst nightmares. Do not let this nightmare become your reality! Take a deep breath and realise that life is not as bad as it seems and that the more you worry, the more harm you are doing to yourself.\n\nIt is also possible that you have already worked through this period of worry and depression and are beginning to make a recovery. You may have recently come to the realisation that it is not as bad as you had made it out to be, and you are beginning to relax and calm yourself about what was once a terrifying situation.\n\nYou may also find that your dreams are very telling at this time. Use a dream journal to help you analyze what is happening at a subconscious level.'
	      }
	   }, {
	      name: 'Ten Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/73_Swords10.jpg',
	      keywords: {
	         upright: 'Back-stabbed, defeat, crisis, betrayal, endings, loss',
	         reversed: 'Recovery, regeneration, fear of ruin, inevitable end'
	      },
	      description: {
	         basic: 'The Ten of Swords shows a man lying face down with ten long swords embedded in his back. A red cape is draped over the lower half of his body, while his top half remains unclothed. The sky above him is pitch black and there is a general feeling of pain, loss, and misfortune. However, despite these ominous images, there are positive aspects to this card. The sea before which the body lies is still and calm and the sun is rising in the distance beyond the mountains, indicating that the darkness will soon be dispelled. Thus, each new beginning must come from an end, and with every defeat are sown the seeds of future victory.',
	         upright: 'The Ten of Swords usually symbolises a sudden and unexpected failure or disaster, whereby a power beyond your control crushes you without warning or mercy. Sometimes you will be able to alter the course of this impending disaster but most of the time you will simply have to let go and take the hit. This card can also indicate a time when you have been backstabbed or betrayed by someone you thought you could trust. You feel incredibly hurt and shocked by such a betrayal.\n\nAs such, the Ten of Swords is often associated with feeling the ‘victim’ in a situation. You may feel powerless as something comes to a crashing and sudden end, and you feel as if you are being attacked or backstabbed by someone else. You crave pity from others with a small sigh of, “Poor me!” You may even use this challenging time to portray yourself as a martyr, to show that you have put your interests last but have suffered as a result.\n\nThe Ten of Swords also indicates a difficult experience of endings, loss, pain or release. However, the saving grace is that you have a new awareness and a positive sense of relief that the difficulty and pain will soon be over and will evolve into something new. As with all endings there will be a new beginning, a rebirth, and a rejuvenation of the spirit. So, while this card may seem negative at first glance, it is a card of hope and an indication that your troubles will not be permanent.\n\nFurthermore, this is the final ordeal, and no more pain will come to you from that source. It is darkest before the dawn, and as gloomy as it looks, the sun will rise again. It can only get better from here.\n\nThe Ten of Swords is about letting go and accepting your current circumstances. You no longer resist change but allow it to happen, even if it causes some initial pain and hurt to you. You accept that there must be change in order to facilitate renewal, and you allow it to occur rather than fighting it.\n\nWhen this card appears after a painful situation, it is a signal to pick yourself up off the ground and to reflect upon what happened to you and why, and what you can learn from the experience. Hidden deep beneath the surface of the Ten of Swords is the ultimate power of the Swords suit – the ability to analyze the situation and your responses, and learn from yourself. True wisdom does not come from without but from within. The Ten of Swords is a sign that the pain and hurt you have endured has not gone without purpose. The positive power within you can be used to learn from your pain and draw wisdom from defeat.\n\nIt is worth noting that the Ten of Swords is very similar to the Death card of the Major Arcana. It is not a literal indication of actual death but is instead evidence of an impending change or ending which may initially be difficult to accept.',
	         reversed: 'Reversed, the Page of Swords can suggest you are acting hastily, without thinking things through properly. You have a lot of energy behind you to get things moving but the way you are going about it is not an effective use of your energy. Tackle things one at a time, rather than trying to deal with everything at once. This will lead to more meaningful outcomes.\n\nThe reversed Page of Swords can also be all talk and no action. You have to be very careful of making promises that you know you cannot keep, or saying things that you later regret. Before making a specific promise or commitment, ensure that you can and will deliver on it in order to maintain your integrity and reputation. Also, be wary of other people’s commitments to you and put in place measures to ensure that they will deliver on what they promise to deliver. This reversed Page can be a bit of a ‘know-it-all’ and may be trying to impress you with big stories about his past and his achievements (which you later find out are big exaggerations of the truth!).\n\nThe Page of Swords reversed may also indicate that you are beginning to annoy others by your constant questioning and challenging of ideas. While you may simply be trying to understand a situation or a concept better, there are more constructive and non-threatening ways to go about it. Use sentences such as, “Help me understand...” Be conscious of how you may be coming across to others when you are constantly asking, “Why?” And only challenge or question those ideas that are really important to you, rather than challenging everything that is presented.\n\nFinally, the reversed Page of Swords suggests a fear of public speaking. You may be anxious that you do not have sufficient experience or knowledge to present on a particular topic, or you may be afraid of being the center of attention. Know that people simply want to hear your point of view, even if it is different from others’.'
	      }
	   }, {
	      name: 'Page Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/74_Swords11.jpg',
	      keywords: {
	         upright: 'Talkative, curious, mentally restless, energetic',
	         reversed: 'All talk and no action, haste, undelivered promises'
	      },
	      description: {
	         basic: 'The Page of Swords shows a young man standing in the midst of rough terrain with a sword held in both hands. The sky is filled with turbulent clouds and the trees in the background are obviously wind-blown, as is the young man’s hair. The waters behind the Page are rough and the general feeling of this card is one of tumultuous energy.',
	         upright: 'The Page of Swords reflects an abundance of energy, passion and enthusiasm. You cannot wait to get started on a new project or an idea, and to share that with others. You start all new projects, ventures and journeys with a huge amount of energy and excitement. The challenge, however, is whether you can keep it up! As with all Pages, the beginning always looks promising but something else is needed in order to maintain the pace.\n\nThe Page of Swords is almost like a green light to say, “Go for it”. There are always going to be challenges with whatever option you choose and not everyone is going to be happy with your choices but when it comes down to it, you need to follow your passions and go where your true energy lies. This Page encourages you to move forward and to get the wheels in motion, despite any challenges or setbacks that may potentially stand in the way.\n\nThis card shows you as a young and idealistic person, with lots of plans and ideas for the future. At this moment, you feel as though you could do almost anything. As a Page, you are just beginning to make your way in life, and it is important that you align with others who will not overwhelm you or stifle your direction and ideas. Instead, seek to align yourself with people who will nurture your ideas and will help you to manifest them in an organised manner. Choose a relationship that feels natural, with someone who will learn and grow along with you and give you a chance to develop your own personality and expression. You have an intelligent and sensitive nature, and you may suffer a lot if there is no outlet for your ideas and feelings.\n\nThe Page of Swords is as perceptive as the Queen of Swords. He has the ability to find out the truth regarding all matters by asking all the important questions. However, what makes him different to the Queen is that he lacks experience and maturity, so his questioning and probing may become annoying to others as he constantly asks “Why?” Nonetheless, he has both mental and physical agility and is full of anticipation, making him an avid learner and an excellent student.\n\nThe Page of Swords is also all about communication, information and ideas. This card is an indication that you need to appreciate and communicate ideas, information and theories. These ideas, information and theories may be your own or someone else’s. It does not really matter, so long as you are involved in talking, sharing and conversing with others about these ideas. You are always coming up with something new and then finding someone to share it with. You also have a way with words, being a good writer or speaker, and you are passionate about what you are doing. However, be careful that you do not engage in gossip. While this Page loves to talk and to be ‘in the know’, it is important that you use this talent to benefit others, rather than to create negativity. You may also want to be careful about what you say to whom, as you may be more prone to sharing confidential information about yourself. So, protect your privacy. And you may need to first ground your thoughts, before speaking, in order to ensure that you do not later regret what you have said.\n\nThe Page of Swords can also stand for a child or young-at-heart adult whose relationship to you involves truthfulness, the search for information and new ideas, or matters of the mind and intellect. You may have your moments with this Page, as the Swords often indicate a level of tension or conflict, and this bundle of energy may sometimes prove too much to handle. If you need to, give yourself a break from this youthful person, and return with fresh eyes. They do have a lot to share with you, and despite their inexperience, they may actually teach you something about yourself. You need to remain open to their high levels of energy and enthusiasm to learn more about the world. As a child, the Page of Swords encourages you to have fun with mental activities of all kinds, including learning, exploring, and researching. Enjoy the world of thought your mind can open to you.\n\nThe downside of the Page of Swords is the turbulent nature of intellectual discovery and inspiration unchecked by experience or wisdom. This Page seems to be either on the defensive, protecting his ideas, or on the offensive, looking for some victim of the double-edged sword of his mind. Perhaps he is seeking a confrontation in the intellectual sense or has the desire to prove himself mentally superior to others. The trouble is that he does not yet have the maturity to express himself in a way that is always constructive, and may come across as oppositional or just too ‘in your face’.',
	         reversed: 'Reversed, the Page of Swords can suggest you are acting hastily, without thinking things through properly. You have a lot of energy behind you to get things moving but the way you are going about it is not an effective use of your energy. Tackle things one at a time, rather than trying to deal with everything at once. This will lead to more meaningful outcomes.\n\nThe reversed Page of Swords can also be all talk and no action. You have to be very careful of making promises that you know you cannot keep, or saying things that you later regret. Before making a specific promise or commitment, ensure that you can and will deliver on it in order to maintain your integrity and reputation. Also, be wary of other people’s commitments to you and put in place measures to ensure that they will deliver on what they promise to deliver. This reversed Page can be a bit of a ‘know-it-all’ and may be trying to impress you with big stories about his past and his achievements (which you later find out are big exaggerations of the truth!).\n\nThe Page of Swords reversed may also indicate that you are beginning to annoy others by your constant questioning and challenging of ideas. While you may simply be trying to understand a situation or a concept better, there are more constructive and non-threatening ways to go about it. Use sentences such as, “Help me understand...” Be conscious of how you may be coming across to others when you are constantly asking, “Why?” And only challenge or question those ideas that are really important to you, rather than challenging everything that is presented.\n\nFinally, the reversed Page of Swords suggests a fear of public speaking. You may be anxious that you do not have sufficient experience or knowledge to present on a particular topic, or you may be afraid of being the center of attention. Know that people simply want to hear your point of view, even if it is different from others’.'
	      }
	   }, {
	      name: 'Knight Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/75_Swords12.jpg',
	      keywords: {
	         upright: 'Opinionated, hasty, action-oriented, communicative',
	         reversed: 'Scattered thought, disregard for consequences'
	      },
	      description: {
	         basic: 'The Knight of Swords shows a young man in his armour riding a powerful white horse into the midst of a battle in the distance. The white colour of the horse symbolises the purity of the intellectual energy that motivates the rider. The sky behind him is filled with storm clouds and the trees are tossed wildly by the wind. The horse’s harness is decorated with images of butterflies and birds and the knight’s cape is also decorated with birds. He charges forward with great momentum and apparently without any regard to the dangers he may encounter.',
	         upright: 'When we are obsessed by an idea and wish to manifest that idea, we are often so blinded by the desire for its fulfilment that we fail to see the difficulties we may encounter or the consequences of our actions. The Knight of Swords is a powerful figure full of life and energy who needs to be balanced with a realisation of responsibility and compassion. Once he has set forth on his journey, there is no stopping him! He does not see, nor care about, any upcoming challenges, risks or dangers, and instead moves forward with his strong intent to succeed and win. On the positive side, this card shows great ambition, determination and strength to succeed no matter what. On the negative side, however, he can be blind to potential challenges and consequences of his actions, and may charge forth into a dangerous territory without any foresight or preparation. He may also neglect to understand the needs of others as he fervently pursues his own goals.\n\nThe Knight of Swords often reflects a time when you are embarking on a new project or idea and there really is no stopping you. You have had this sudden burst of energy that is propelling you forward and inspiring you to take quick action to manifest your goals. You are ready to overcome any problem, challenge or obstacle that is in your path. How could anything stand in your way if you are this focused and this committed to your goal? However, you may be prone to rushing things or cutting corners in order to get a job done. Sometimes this works for you but other times it does not. For example, using low cost providers will help you get the job done quickly and cheaply but quality may suffer in the long-term and you may consume more time fixing their work. Also, ensure that you keep others on side, particularly if they are part of your longer-term success. You might be all fired up and ready to go but if your colleagues, partner, friends, or family are not, then you are likely to run into trouble later down the track.\n\nThe Knight of Swords also represents your need to understand the world from an intellectual point of view. You have well-developed communication skills and can easily form solid arguments and opinions on current affairs and important matters. You love to engage with others who have similar skills so that you can share your ideas and develop new points of view. You may be best suited to discussion groups with like-minded individuals where you can fire each other up and motivate one another.',
	         reversed: 'This reversed Knight is incredibly impatient, impulsive and bursting with energy. This person has so much energy but so little direction that this results in them making rash decisions and pulling down others with them. Their thoughts are scattered and all over the place. They are likely to be very disorganised, flippant and unpredictable. If you encounter this type of person, you need to be very wary and make sure that you do not get caught up in all the hype and energy that surrounds them. It will be easily done for this person is a greater talker and is full of ideas and thoughts about future opportunities. Do not get sucked in to their whirlwind of activity and energy!\n\nThe Knight of Swords reversed indicates that you need to go it alone in order to build up valuable life experience and maturity. As you search for freedom and independence, it is likely you will make mistakes on your way due to your reckless and impatient nature but this is all part of the journey. This card can often reflect a rebellious teenager who is fighting for their own independence, and the parents who need to allow that teenager to make the mistakes and to be accountable for their actions.\n\nThe reversed Knight of Swords can also suggest that you need to slow down otherwise you are at risk of serious burn-out and exhaustion. You want to be involved in everything but you are not succeeding at anything due to this scattered thought and energy. As such, you are spinning your wheels and accomplishing very little but growing more and more tired by the day. Take some time out so that you can first ground yourself, gather your thoughts and focus on only the top priorities.'
	      }
	   }, {
	      name: 'Queen Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/76_Swords13.jpg',
	      keywords: {
	         upright: 'Quick thinker, organised, perceptive, independent',
	         reversed: 'Overly-emotional, bitchy, cold-hearted'
	      },
	      description: {
	         basic: 'The Queen of Swords sits high on her throne with a stern look on her face indicating that no-one can fool her. In her right hand, she comfortably holds a sword pointed to the sky, and her left hand extends as if she has something to offer to others. Behind her is a spring sky, different from the winter settings on most other Swords cards, and this has an emergence and growth quality to it. The sky is clear, representing her clarity of mind as she considers matters of the intellect. The bird above her head symbolises the mind’s ability to soar above day-to-day issues in order to arrive at appropriate solutions.',
	         upright: 'The Queen of Swords represents the sternness of a mature intellect which is devoid of emotion. In mythology, the feminine is associated with emotion, yet in this card the woman is stern and composed, and without much feeling. This card therefore represents the intellect’s ability to judge and discern impartially, without the influence of emotion or sentimentality. She likes to know the how, what, why, where, when and who of everything to help her make sense of her environment and to better understand others. It is not that she does not care about others but she connects to other people through an intellectual understanding rather than an emotional understanding.\n\nThe Queen of Swords is a sign that you need to be independent in thought and in judgement. You must use your unbiased intelligence in order to make a judgement of a particular situation, drawing upon every piece of information and fact that you have gathered along the way. Empathy or compassion towards others may distract you from the task at hand, so it is important that you think with your head and not with your heart at this particular time. Do not let emotion get in the way. Rather, use fact and logic to make your decisions.\n\nThe Queen of Swords also has an innate ability to tell it like it is. She is a quick thinker and highly perceptive, and as such, she can cut through the noise and confusion to get straight to the point. There is certainly no ‘beating about the bush’, or ‘softening’ of her comments, opinions and thoughts. She is upfront and honest about her opinions, and expects the same from others. The best way to interact with the Queen of Swords, therefore, is to remain as impartial as possible, and to present your thoughts and opinions concisely and honestly.',
	         reversed: 'The Queen of Swords reversed indicates that currently you may be thinking more with your heart than your head. You may be very emotionally involved in a particular situation or issue but this may be distorting your perception of the situation at hand. You need to use your head a little bit more to understand what is happening and read the signals more accurately. Look at your situation objectively and think with your head and not your heart as this may give you a better picture of the situation and help you evaluate what you need to do next.\n\nSimilarly, the reversed Queen of Swords suggests that relationships are clouding your usually clear vision. You need to refocus your goals or direction, yet you are hesitating due to a desire not to disturb the positive balance and harmony of your relationships with others. At the end of the day, you need to be more hard-edged, confident and assertive in order to be successful. Clear sight and analysis, objective weighing of options and ideas for the future, and even carefully considering but not necessarily choosing, the alternatives are essential right now.\n\nOn the other hand, the reversed Queen of Swords can come across as cold-hearted, bitter, resentful and bitchy, particularly if she is completely devoid of any emotion or compassion for others. In her quest to get to the bottom of an issue, she puts a lot of other people off-side and loses her support base. She isolates herself from others and is seen as narrow-minded, intolerant, and mean.'
	      }
	   }, {
	      name: 'King Of Swords',
	      src: 'ttps://raw.githubusercontent.com/NCal/Tarot/master/assets/Tarot/77_Swords14.jpg',
	      keywords: {
	         upright: 'Clear thinking, intellectual power, authority, truth',
	         reversed: 'Manipulative, tyrannical, abusive'
	      },
	      description: {
	         basic: 'The King of Swords sits upon his throne of command, holding a large upward-pointing, double-edged sword in his right hand, while his left hand rests gently upon his lap. On his left Saturn finger is a ring, symbolic of power and taking his responsibilities seriously. The King wears a blue tunic, symbolic of a desire for spiritual understanding, and a purple cape, symbolic of compassion combined with intellect. The back of his throne is decorated with butterflies (transformation), crescent moons and an angel just near his left ear, positioned as if to give him subtle guidance. The sky is relatively clear with a few clouds, representing general mental clarity. The trees in the background appear motionless and reflect the stern judgement of the King.',
	         upright: 'The King of Swords is a symbol of intellectual power and authority, and has the courage and intellect to accomplish all that he desires. He represents judgement, command, and rulership. His character indicates the stern leadership of a judge, lawyer, or military commander whose emotions must be kept in check under the pressure of battle. Therefore, the King of Swords asks you to remain detached and objective in a specific situation, in order to ascertain the truth and seek out only the facts. You need to use your intellect to prove your point and succeed. Your education and experience are important but so are your day-to-day observations and thoughts. You can also solve problems by using history, rules, laws and diplomacy.\n\nThe King of Swords suggests that you need to adopt a very stern but fair role. You have clarity of mind and can perceive the truth right now, so you must take the lead with providing an objective point of view. You are well-positioned to judge your situation appropriately and identify the limiting behaviours that are getting the way. This is a time when you need to leave emotions out of it, and remain as objective and rational as possible. You may need to reason with others and be quite direct about what you are observing. You may be concerned that you are not being particularly caring or sympathetic but at this point in time, this detachment is what is needed most.\n\nSimilarly, the King of Swords encourages you to use your logic and intellect to navigate your path ahead. You will need to get to the heart of the matter, make firm and well-researched decisions, and ensure that you are firm but fair in your dealings with others. You need to be able to take any situation, look at it with total impartiality, and then come to a decision that is both fair and insightful.\n\nOftentimes, the King of Swords represents a professional advisor, such as a solicitor or attorney, financial adviser or taxation consultant. This advisor has a solid reputation and a vast amount of knowledge in his particular field, and will provide you with objective, well-researched advice about your own situation. He is completely impartial, and will draw upon his experience and his innate knowledge of the rules, systems and structures that are in place. He may come across as detached or disinterested in your personal circumstances, unless it relates specifically to the type of advice he is giving you. This is so that he can provide only the most relevant and objective advice to you. He prides himself in his expertise and qualifications, and is likely to charge a high fee for his services. Nonetheless, he offers the rigour and specialist knowledge that you need right now.\n\nIf you have not engaged the help of an expert, the appearance of the King of Swords suggests that it may be worthwhile getting some legal or financial advice. If you are expecting changes or particular circumstances to arise that will require expert advice, you can be on the front foot by seeking advice before they happen. That way, when they do roll through, you are ready to demand your rights and seek an outcome that benefits you. You may also benefit by finding an advocate or mentor who will look out for your needs and who can provide you with objective and smart advice about what to do.\n\nThis King is also a man of the highest ethical standards. It is impossible to corrupt him and as such he acts as a pillar of strength who gives sound advice to everyone, no matter who they are. What is more, he firmly expects others to operate by the rules of the law and will not tolerate others who break the law. As a father, for example, he will become very angry if his children do not follow the ‘house rules’.',
	         reversed: 'The King of Swords reversed can suggest the misuse of one’s mental power, authority, and drive. The reversed King of Swords represents manipulation and persuasion in order to fulfil selfish needs. He is a very intelligent older male (or sometimes female) who likes to show off to others about how smart he is by using big words or talking about topics about which no-one else knows. He may also be very cutting in his words, critical of others, and stern in his manner. This card may represent a person in your life or even yourself. You need to be wary of this type of person because, although he/she may be charming and intelligent, they can do only harm. They have only their personal interests in mind and will do whatever they can to achieve these interests, even if it means stepping on others.\n\nSimilarly, the King of Swords reversed can be quite a tyrant and a ‘loose cannon’. He is prone to aggression and angry outbursts, particularly if you make him look bad or challenge his authority. He is not pleasant to be around and is likely to leave you feeling demoralised and put down.\n\nThe reversed King of Swords can also reflect a lack of decisiveness about where your best opportunities lie or in what direction you want to head. You are still making up your mind about what you really want to do and what is going to inspire you. This lack of decision means a lack of direction at this time, so it is essential that you drive energy towards making a decision and then acting upon it. The longer you wait around until everything is 100% clear, the longer you delay your fulfilment. You may also be lacking the mental clarity to work out what it is that you need to do in your situation. Your thoughts are scattered and may be starting to feel quite panicky and out of control when it comes to knowing exactly what to do and what choices to make. Upright, the King is typically a very rational man who uses his intelligence and clear understanding of a situation to make critical decisions but reversed, this card indicates that you are feeling very lost and uncertain about your options, let alone the decisions you need to make. As a result, you are delaying necessary decisions and generally not achieving anything because you are getting so worried.'
	      }
	   }]
	}];

	exports.default = cardData;

